INSERT INTO `astrolagy` (`id`, `astrolagy_cat`, `astrolagy_type`, `description`, `insert_date`, `display_date`) VALUES
(22, 2, 2, 'నూతన ఉద్యోగ యత్నాలు కలిసివస్తాయి.\r\nశారీరకంగా, మానసికంగా అలసట, పనిభారం అధికంగా ఉంటాయి. కషికి తగిన\r\nఫలితాలుంటాయి. ముఖ్యమైన పనులను వాయిదా వేస్తాయి. ఆర్థికంగా బాగుంటుంది.\r\nఆంత రంగిక చర్చలు జరిగేచోట కొత్త వ్యక్తులకు చోటు ఇవ్వకండి. మాటమీద నిలబడే\r\nవ్యక్తిగా మంచి పేరు పొందుతారు.', '2010-01-06 00:00:00', '2010-12-29'),
(7, 1, 1, 'ఉద్యోగస్తులు,\r\nప్రైవేటు సంస్థల్లోని వారికి అధికారులతో అవగాహన కుదరదు. ప్రేమికులకు\r\nఎడబాటు, చికాకులు తప్పవు. ఖర్చులు పెరిగినా ఇబ్బందులు ఏ మాత్రం తలెత్తవు.\r\nఇతరుల హామీలకు, మధ్యవర్తిత్వాలకు దూరంగా ఉండటం మంచిది. నూతన వ్యాపారాలకు\r\nశ్రీకారం చుడతారు. గృహంలో ఒక శుభకార్యం చేయాలనే ఆలోచన స్ఫురిస్తుంది.', '0000-00-00 00:00:00', '2010-01-06'),
(8, 1, 2, 'రాబడికి\r\nమించిన ఖర్చులు ఆందోళన కలిగిస్తాయి. చేపట్టిన పనులు మొక్కుబడిగా పూర్తి\r\nచేస్తారు. అవివాహితులకు శుభదాయకం. పెంపుడు జంతువుల గురించి ఆందోళన\r\nచెందుతారు. స్పెక్యులేషన్ రంగాల వారికి పురోభివృద్ధి. ఏ విషయమైనా జీవిత\r\nభాగస్వామితో చర్చించటం మంచిది. విద్యార్థినుల మొండితనం అనర్థాలకు\r\nదారితీస్తుంది.', '0000-00-00 00:00:00', '2010-01-06'),
(9, 1, 3, 'అయినవారి\r\nనుంచి అభిమానాన్ని, ప్రేమను మరింత పొందుతారు. దంపతుల ఆలోచనలు పలు విధాలుగా\r\nఉంటాయి. ఉత్తర ప్రత్యుత్తరాలు, ఆహార వ్యవహారాల్లో ఏకాగ్రత అవసరం. దూరపు\r\nబంధువుల నుంచి అందిన ఒక లేఖ మీకు ఎంతో ఆశ్చర్యం కలిగిస్తుంది. స్త్రీలు\r\nవేడుకలలో కలుపుగోలుతనంగా వ్యవహరించి అందరి ప్రశంసలు పొందుతారు.', '0000-00-00 00:00:00', '2009-12-29'),
(10, 1, 4, 'విద్యార్థులు\r\nఅనవసర విషయాలకు దూరంగా ఉండటం క్షేమదాయకం. ఖర్చులు సామాన్యంగా ఉంటాయి.\r\nఉద్యోగస్తుల శ్రమకు తగిన గుర్తింపు లభిస్తుంది. వృత్తి వ్యాపారులకు\r\nసంతృప్తి, పురోభివృద్ధి. దూర ప్రయాణాల్లో మెలకువ వహించండి. చిట్స్,\r\nపైనాన్స్, బ్యాంకింగ్ రంగాల వారికి చికాకులు అధికం అవుతాయి. ప్రముఖులకు\r\nబహుమతులు అందిస్తారు.', '0000-00-00 00:00:00', '2010-01-06'),
(11, 1, 5, 'దైవదీక్షలపట్ల\r\nఆసక్తి పెరుగుతుంది. మీ వాక్చాతుర్యం, లౌక్యంతో అనుకున్నది సాధిస్తారు.\r\nఅయినవారి నుంచి ఒక ముఖ్య సమాచారం అందుకుంటారు. స్త్రీల ఆరోగ్యం\r\nమెరుగుపడుతుంది. రుణ సమస్యల నుంచి విముక్తులు అవుతారు. నిర్మాణ పనుల్లో\r\nకాంట్రాక్టర్లకు ఏకాగ్రతా లోపంవల్ల చికాకులు తప్పవు. నిరుద్యోగులను ఒక\r\nప్రకటన ఆకర్షిస్తుంది.', '0000-00-00 00:00:00', '2010-01-06'),
(12, 1, 6, 'పత్రికా\r\nరంగంలోని వారికి, కళాకారులకు, రచయితలకు అనువైన సమయం. కాంట్రాక్టర్లు\r\nనిర్మాణ పనులు చురుకుగా సాగటంతో ఒకింత మనశ్శాంతి పొందుతారు. సిమెంటు, కలప,\r\nఐరన్, ఇటుక వ్యాపారులకు మిశ్రమ ఫలితం. స్త్రీలకు తల, కాళ్లు, నరాలకు\r\nసంబంధించిన చికాకులు అధికం అవుతాయి. లిటిగేషన్ వ్యవహారాలలో జాగ్రత్త\r\nవహించండి.', '0000-00-00 00:00:00', '2010-01-06'),
(13, 1, 7, 'దైవదర్శనాలకై\r\nచేయు ప్రయత్నాలు అనుకూలిస్తాయి. వైద్య, ఇంజనీరింగ్ రంగంలోని వారికి మెలకువ\r\nఅవసరం. ఆడిటర్లకు పురోభివృద్ధి. వ్యవసాయ, తోటల రంగాల్లోని వారికి\r\nవాతావరణంలో మార్పు ఆందోళన కలిగిస్తుంది. స్టేషనరీ, ఫ్యాన్సీ సుగంధ ద్రవ్య\r\nవ్యాపారులకు కలసివచ్చేకాలం. భూమికి సంబంధించిన చికాకులు పరిష్కారం అవుతాయి.', '0000-00-00 00:00:00', '2010-01-06'),
(14, 1, 8, 'సన్నిహితులు\r\nఒక వ్యవహారంలో మిమ్మల్ని ఒత్తిడికి గురిచేస్తారు. స్త్రీల ఆలోచనలు పలు\r\nవిధాలుగా ఉంటాయి. వ్యాపార విస్తరణ, సంస్థల స్థాపనలకు అనువైన సమయం.\r\nవిద్యార్థులకు లక్ష్యంపట్ల ఏకాగ్రత కుదురుతుంది. మార్కెట్, ప్రింటింగ్\r\nరంగాల వారికి చికాకులు తప్పవు. పార్టీలలో హుందాగా వ్యవహరించి అందరినీ\r\nఆకట్టుకుంటారు.', '0000-00-00 00:00:00', '2010-01-06'),
(15, 1, 9, 'పారిశ్రామిక\r\nరంగాల వారికి కార్మికులతో సమస్యలు తప్పవు. ఆకస్మిక ఖర్చులు, తప్పనిసరి\r\nచెల్లింపుల వల్ల ఇబ్బందులకు గురవుతారు. వృత్తుల వారికి సదవకాశాలు\r\nలభిస్తాయి. అవివాహితులు శుభవార్తలు వింటారు. ఉద్యోగస్తులకు బదిలీలు, నూతన\r\nబాధ్యతలు చేపట్టే అవకాశం ఉంది. బంధువులతో సత్సంబంధాలు నెలకొంటాయి.', '0000-00-00 00:00:00', '2010-01-06'),
(16, 1, 10, 'ప్రముఖుల\r\nకలయిక మీకు ఎంతో ఉపకరిస్తుంది. ముఖ్యమైన పనులు ఆశించిన రీతిలో పూర్తి\r\nచేస్తారు. స్త్రీలకు తమ బంధువర్గాల నుంచి సంతోషకరమైన వార్తలు అందుతాయి.\r\nనిరుద్యోగులకు సదవకాశాలు లభించినా సద్వినియోగం చేసుకోలేరు. అవివాహిత\r\nయువకులకు అందిన ఒక సమాచారం ఆందోళన కలిగిస్తుంది. చిరు వ్యాపారులకు\r\nలాభదాయకం.', '0000-00-00 00:00:00', '2010-01-06'),
(17, 1, 11, 'ఆర్థిక\r\nవిషయాల్లో ముందుచూపు అవసరం అని గమనించండి. గత అనుభవాలు జ్ఞప్తికి రాగలవు.\r\nహోటల్, తినుబండారాల, కేటరింగ్ రంగాల్లోని వారికి కలసివచ్చే కాలం. స్త్రీల\r\nతెలివితేటలకు, వాక్చాతుర్యానికి మంచి గుర్తింపు లభిస్తుంది.\r\nమాట్లాడలేనిచోట మౌనం వహించంటం మంచిది. ఆధ్యాత్మిక సేవా కార్యక్రమాల్లో\r\nపాల్గొంటారు. ఖర్చులు అధికం అవుతాయి.', '0000-00-00 00:00:00', '2010-01-06'),
(18, 1, 12, 'నూతన\r\nవ్యాపారాలకు, ఒడంబడికలకు అనుకూలమైన కాలం. స్థిర చరాస్తుల క్రయ విక్రయాలకు\r\nసంబంధించి ప్రముఖులతో సంప్రదింపులు జరపుతారు. మీ అభిప్రాయాలు బయటకు\r\nవ్యక్తం చేయటంవల్ల సమస్యలు తలెత్తుతాయి. బంధుమిత్రులతో సఖ్యత నెలకొంటుంది.\r\nమీ సంతానంతో కలిసి విందు, వినోదాలలో పాల్గొంటారు.', '0000-00-00 00:00:00', '2010-01-06'),
(19, 2, 1, 'పుణ్యక్షేత్రాలను సందర్శిస్తారు.\r\nచేపట్టిన వ్యవహారాలు, వివాదాస్పద కార్యక్రమాలు విజయవంతమవుతాయి. భూమి,\r\nవిద్య, వాహన సంబంధ విషయాల్లో లాభం చేకూరుతుంది. ఖర్చులు అధికమైనా ఆర్థిక\r\nవెసులుబాటు ఉంటుంది. ఆత్మగౌరవం, అభిమానం తాత్కాలిక ప్రయోజనాలకన్నా\r\nముఖ్యమని భావించి అలానే ప్రవర్తిస్తారు. మానసిక సంతప్తితో ఉంటారు.', '2010-01-07 00:00:00', '2010-01-07'),
(24, 2, 1, 'ఆర్ధికంగా&nbsp; బలపడతారు. రుణాలు తీరతాయి. కొత్త పరిచయాలు. ఆలోచనలు కలసివస్తాయి. శుభకార్యాలు.										  	', '2010-01-19 16:48:11', '2010-01-24'),
(20, 3, 1, 'మేషరాశి\nవారికి ఈ మాసం అనుకూలంగా ఉంది. పట్టుదలతో ప్రతి పనిని సానుకూల\nపరచుకుంటారు. ఋణాలు తీర్చి వేస్తారు. మిమ్మల్ని అభిమానించేవారికి గట్టి\nమేలును చేయగలుగుతారు. అత్యంత ఆశ్చర్యకరంగా ఎక్కువగా శ్రమించకుండానే మంచి\nఫలితాలు సాధించగలుగుతారు. ఆర్ధికంగా అనుకూలంగా ఉంటుంది. వృత్తి ఉద్యోగాల\nపరంగా సంతృప్తికరమైన ఫలితాలు సంప్రాప్తిస్తాయి. వ్యాపారోన్నతికి గాను మీరు\nఅవలంబించే ప్రణాళికలు సత్ఫలితాలనిస్తాయి. కుటుంబంలో స్వల్పమైన స్పర్ధలను\nగ్రహస్థితి సూచిస్తోంది. శుభకార్యాలను జయప్రదంగా నిర్వహించగలుగుతారు.\nమిత్ర బృందాలను మరింతగా విస్తరింపజేస్తారు. వైజానిక కార్యక్రమాలలో\nపాల్గొంటారు. సలహాలతో మనుషులను మార్చలేమని అనుభవ పూర్వకంగా తెలుసుకుంటారు.\nసంతాన యోగక్షేమాలకు గాను అధికంగా ఖర్చు చేస్తారు. వివాదాలకు దూరంగా\nఉంటారు. మానసిక ప్రశాంతతను కలిగి ఉంటారు. ఈ రాశివారు ప్రతినిత్యం హనుమాన్‌\nచాలీసా పఠించడం చెప్పదగినది. గ్రహణ జాగ్రత్తలు పాటించండి.', '0000-00-00 00:00:00', '2009-12-29'),
(21, 4, 1, '01 ఏప్రిల్ 2009 నుండి 31 మార్చి 2010\r\nవరకు\r\nమేషరాశి ఫలితములు\r\nఆదాయం : 02 వ్యయం : 08 గౌరవం : 01 అగౌరవం : 07\r\nమేషరాశి వారికి ఈ సంవత్సరం ఎక్కువ భాగం మంచి ఫలితాలు సూచిస్తున్నాయి.\r\nసంవత్సర ప్రారంభం ప్రోత్సాహకరంగా, ఉత్సాహకరంగా ఉంటుంది. జీవితాశయ సాధనకు\r\nచేసే ప్రయత్నాలు ఒక కొలిక్కి వస్తాయి. అయితే ఫలితాలు మాత్రం మీ ఒక్కరికే\r\nదక్కవు. విషయ వ్యవహారాలలో ఏమాత్రం సంబంధం లేని వ్యక్తులకు కూడా మీరు\r\nవాటాలు పంచవలసిన పిరిస్ధితతి ఏర్పడుతుంది. పోటీ పరీక్షలలో విజయం సాధించి\r\nప్రభుత్వ ఉద్యోగాన్ని సాధిస్తారు. మీ ఎదుగుదల అభివృద్ది కొందరికి కంటకంగా\r\nమారుతుంది. అసూయాగ్రస్తులైన ఇటువంటి వారితో మీ స్నేహితులు కూడా చేరిపోవటం\r\nమీకు ఆశ్చర్యం కలిగించే అంశంగా మారుతుంది. సంవత్సర ప్రధమార్ధంలో ముఖ్యమైన\r\nవ్యక్తులకు మీరే అంతరంగికులు అవుతారు. చీకటిని చీల్చి రవికిరణం\r\nప్రకాశించునట్లుగా,ఎంతో శ్రమించగా వచ్చిన ఫలితాలు ఆనంద డోళికలలో మిమ్మల్ని\r\nమైమరపిస్తాయని భావిస్తారు. మామో!మర్మమో!గానీ కొందరి జీవితం ఒడ్డించిన\r\nవిస్తరి. కష్టపడకుండానే ఫలితాలు చేతికందివస్తాయి. కాదుకాదు వారు ఇతరుల\r\nకష్టాన్ని వాటి తాలుకు ఫలితాలను నక్కతెలివితో తమకు అనుకూలంగా మలచుకుంటారు.\r\nఆశించిన లాభాలు మీ చేతికందుతున్న వేళ ఇటువంటి వారే మీకు అడ్డుపడతారు.\r\nజాగ్రత్త వహించండి.పన్నులు వసూలు చేసే అధికారుల వల్ల ఇబ్బందులు\r\nఎదురుకావచ్చు. చిన్ని చిన్న వ్యాపారాలు చేసుకొనే వారికి కాలం చాలా\r\nఅనుకూలంగా ఉంటుంది. ఉద్యోగ పరంగా నూతన', '2010-01-06 00:00:00', '2010-12-29'),
(23, 2, 2, '<font><font class="DailyHoroscopeText">నూతన ఉద్యోగ యత్నాలు కలిసివస్తాయి.\nశారీరకంగా, మానసికంగా అలసట, పనిభారం అధికంగా ఉంటాయి. కషికి తగిన\nఫలితాలుంటాయి. ముఖ్యమైన పనులను వాయిదా వేస్తాయి. ఆర్థికంగా బాగుంటుంది.\nఆంత రంగిక చర్చలు జరిగేచోట కొత్త వ్యక్తులకు చోటు ఇవ్వకండి. మాటమీద నిలబడే\nవ్యక్తిగా మంచి పేరు పొందుతారు.</font></font>', '0000-00-00 00:00:00', '2009-12-30'),
(25, 2, 1, 'ఆర్ధికంగా&nbsp; బలపడతారు. రుణాలు తీరతాయి. కొత్త పరిచయాలు. ఆలోచనలు కలసివస్తాయి. శుభకార్యాలు', '2010-01-19 16:57:33', '2010-01-24'),
(26, 3, 1, '<font id="summery" style="font-size: 14px; line-height: 24px;">&nbsp; జస్టీస్ శ్రీకృష్ణ \nనేతృత్వంలో ఏర్పాటు చేసిన కమిటీ కేవలం సంప్రదింపులకు మాత్రమే అని కేంద్ర \nహోంశాఖ స్పష్టం చేసింది. రాష్ట్రంలోని మూడు ప్రాంతాల్లోని ప్రజలు, వివిధ \nవర్గాలు, రాజకీయ పార్టీల </font>', '2010-02-03 16:04:54', '2010-02-28');
