INSERT INTO `cinema` (`id`, `type`, `heading`, `eng_heading`, `summary`, `description`, `insert_date`, `active`, `views`) VALUES
(3, 1, '<font class="UnicodeContent">కెఆర్వీకి ఎస్వీఆర్</font>', '', '<font class="UnicodeContent">తెలుగు చలన చిత్ర పరిశ్రమలో నభూతో నభవిష్యతి\nఅన్న తరహాలో ఎన్నో పాత్రలకు ప్రాణప్రతిష్ఠ చేసిన స్వర్గీయ ఎస్.వి.రంగారావు\nపేరిట ఏర్పాటు చేసిన ఎస్వీఆర్ స్మారక కంకణాన్ని సీనియర్ నటి కె.ఆర్.విజయ\nస్వీకరించనున్నారు. అమ్మవారి</font>', '<font class="UnicodeContent">పాత్రలకు తనకు తానే సాటి అనిపించుకుని,\nనటిగా 400కు పైగా చిత్రాల్లో నటించి తెలుగు, తమిళ ప్రేక్షకుల హృదయాలలో\nచెరగని ముద్ర వేసిన నటి కె.ఆర్.విజయ. ఎస్వీ ఆర్ ఇంటర్నేషనల్ అకాడమీ\n(యుఎస్ఎ)తో కలిసి ప్రముఖ సాంస్కృతిక సంస్థ ''ఆరాధన'' ఈనెల 3న రవీంద్రభారతిలో\nఈ స్వర్ణకంకణ ప్రదానోత్సవాన్ని నిర్వహించనుంది. అమెరికాలోని ప్రవాస\nభారతీయలు ఈ కార్యక్రమ నిర్వహణకు ఆర్థిక సౌజన్యాన్ని అందిస్తున్నట్టు\n''ఆరాధన'' అద్యక్షుడు గుదిబండ వెంకటరెడ్డి, ఎస్వీ రంగారావు ఇంటర్నేషనల్\nఅకాడమీ చైర్మన్ చందు శ్రీనివాస్ తెలిపారు.<br>\n<br>\nస్వర్ణకంకణ ప్రదానోత్సవ కార్యక్రమానికి ఆర్థిక మంత్రి కె.రోశయ్య ముఖ్య\nఅతిథిగా విచ్చేస్తారు. దర్శకరత్న డాక్టర్ దాసరినారాయణరావు చేతులమీదుగా\nఅవార్డు ప్రదానం జరుగుతుంది. సభాధ్యక్షులుగా ''ఆంధ్రప్రభ'' సంపాదకులు\nపి.విజయబాబు, గౌరవ అతిథిగా రాష్ట్ర ప్రభుత్వ ప్రధాన కార్యదర్శి (రెవెన్యూ\nధర్యాదాయ శాఖ), విశిష్ట అతిథిగా ఇండియన్ మీడియా సెంటర్ (న్యూఢిల్లీ)\nచైర్మన్ శ్యాం ఖోస్లా పాల్గొంటారు. పద్మశ్రీ శోభానాయుడు జ్యోతి ప్రజ్వలన\nచేస్తారు. వర్దమాన రచయిత్రి శ్రుతకీర్తి వ్యాఖ్యాతగా వ్యవహిస్తారు.\nఎస్వీఆర్ స్మారక కంకణాలను యు.వి.కృష్ణంరాజు 2007లోనూ, కైకాల సత్యనారాయణ\n2008లోనూ అందుకున్నారు.</font><br>', '2009-07-02 11:22:14', 1, 0),
(5, 1, '<font class="UnicodeContent">''నింగి నేల నాదే'' వెబ్ సైట్</font>', '', '<font class="UnicodeContent">ఆత్మ విశ్వాసం, పట్టుదల ఉంటే సాధంచలేనిది\nఏదీ లేదనే సందేశం ఇచ్చే ''నింగి...నేల...నాదే'' చిత్రం ప్రతి ఒక్కరికీ\nస్ఫూర్తి కావాలని ముఖ్యమంత్రి డాక్టర్ వై.ఎస్.రాజశేఖర్ రెడ్డి\nఆక్షాక్షించారు. పలు అవార్డులు రివార్డులు అందుకున్న చైనా</font>', '<font class="UnicodeContent">చిత్రం ''ఇన్విజబుల్ వింగ్స్'' ఇప్పుడు\nతెలుగులో ''నింగి నేల నాదే'' పేరుతో అనువాదమై జూలై 3న ప్రేక్షకుల ముందుకు\nరానుంది. నిర్మాత చావ సుధారాణి ఈ చిత్రాన్ని తెలుగు ప్రేక్షకులకు\nఅందిస్తున్నారు. ఈ చిత్రం వెబ్ సైట్ ను ముఖ్యమంత్రి రాజశేఖర్ రెడ్డి\nహైద్రాబాద్ లో ఆవిష్కరించారు.<br>\n<br>\nఒక పని తలబెడితే ఆ పనిని చివరి వరకూ పూర్తి చేసే స్థైర్యం ఉండాలని\nబర్తృహరి చెప్పారనీ, అలాంటి స్థైర్యం మెండుగా ఉన్న యువతే ఈ చిత్రంలోని\nకథానాయిక అని వై.ఎస్. అన్నారు. నేటి యువతరానికి అలాంటి ఆత్మవిశ్వాసనమే\nకావాలనీ, ఏదైనా సాధించాలనే పట్టుదల అవసరమనీ, అంగవైకల్యం అవరోధం కాదనే\nధైర్యం కావాలని ఆయన ఉద్బోధించారు. చావా సుధారాణి మాట్లాడుతూ, ఎన్ని పనుల\nఒత్తిడిలో ఉన్నప్పటికీ ''నింగి నేల నాదే'' వెబ్ సైట్ ను ఆవిష్కరించిన\nముఖ్యమంత్రికి తన కృతజ్ఞతలని అన్నారు. యువతరం ఈ చిత్రం నుంచి\nఆత్మవిశ్వాసాన్ని నేర్చుకోవాలన్నదే తమ కోరిక అని అన్నారు. తమను చూడగానే ఈ\nచిత్రం పేరు బాగుందంటూ ముఖ్యమంత్రి ఆశీర్వదించడం చాలా సంతోషంగా ఉందన్నారు.\n''www.ninginelanaade.com''లో ఈ చిత్రానికి సంబంధించిన పూర్తి వివరాలను\nచూడవచ్చని ఆమె చెప్పారు.</font>', '2009-07-02 11:35:49', 0, 0),
(6, 3, '<font class="UnicodeContent">మీరా ప్రేమ బెడిసికొట్టిందా?</font>', '', '<font class="UnicodeContent">వెండితెరపై ఎంతటి సెలబ్రెటీలైనప్పటికీ\nప్రేమ, పెళ్లి వదంతులు వారిని కూడా వదిలిపెట్టవు. జాతీయ ఉత్తమ నటి\nమీరాజాస్మిన్ ప్రేమలో పడిందంటూ ఎప్పటికప్పుడు పలు వదంతులు రావడం, వాటిని\nఆమె ఖండించడం దాదాపు ఏడాది నుంచి సర్వసాధారమైంది. ఇప్పుడో రేపే మీరా\nజాస్మిన్ </font>', '<font class="UnicodeContent">సినిమాలకు స్వస్తి చెప్పనుందందనే వార్తలు\nరావడం, ఇందుకు భిన్నంగా మీరా కొత్త ప్రాజెక్టులు ఒప్పుకోవడం జరుగుతూనే\nఉంది. కొద్దికాలంగా మీరాజాస్మిన్, మాండలిన్ యు.రాజేష్ ప్రేమ వ్యవహారం\nచర్చనీయాంశమవుతోంది. మాండలిన్ శ్రీనివాస్ తమ్ముడే మాండలిన్ రాజేష్.\nమ్యూజిక్ కంపోజర్ అయిన రాజేష్, మీరా కొద్దికాలంగా చెన్నైలో కలిసే\nఉంటున్నప్పటికీ పెళ్లికి మాత్రం ఇంకా సమయాత్తం కాలేదు. అయితే ఈ శుభ ఘడియ\nరాకముందే వారిద్దరి మధ్య ప్రేమ వ్యవహారం బెడిసికొట్టిందనే ప్రచారం\nప్రస్తుతం జరుగుతోంది.<br>\n<br>\nరాజేష్ కంటే ముందుగానే తమిళ హీరో ప్రశాంత్, మీరా ప్రేమించుకున్నారంటూ\nఅప్పట్లో ప్రచారం జరిగింది. ప్రశాంత్ ఇటీవల తన భార్య గృహలక్ష్మితో\nవిడాకులు తీసుకోవడం కూడా ఆ వదంతులకు బలం చేకూరినట్టయింది. అయితే ఆ\nవదంతులను ప్రశాంత్ ఖండించారు. అయినప్పటికీ రాజేష్ తల్లిదండ్రులు మాత్రం\nమీరాను పెళ్లాడాలనుకున్న రాజేష్ కోరిక పట్ల సానుకూలంగా స్పందించలేదని\nఅంటున్నారు. ఈ క్రమంలోనే మీరా-రాజేష్ లు ప్రేమ వ్యవహారానికి కూడా ఇప్పుడు\nతెరపడిందంటూ చెన్నై వర్గాలు చెబుతున్నాయి. రాజేష్ సైతం ఈ విషయాన్ని\nధ్రువీకరించారని వారు చెబుతున్నారు. ''కాలమే అన్ని గాయలనూ మాన్పుతుంది.\nనేను ఎంతో ఊహించుకున్నాను. వాటికీ, ప్రస్తుతం జరుగుతున్న పరిణామాలకూ\nఏమాత్రం పొంతన లేదు. కాలమే అన్నిటికీ సమాధానమిస్తుంది'' అని రాజేష్\nవ్యాఖ్యానించినట్టు తెలుస్తోంది. ఇంతకుమించు తాను ఏమీ చెప్పదలచుకోలేదనీ,\nప్రస్తుతం తన దృష్టంతా మ్యూడిక్ కెరీర్ మీదే కేంద్రీకరించబోతున్నాననీ\nరాజేష్ చెబుతున్నారు. మీరా సైతం ప్రస్తుతం తన కెరీర్ పైనే ఎక్కువ దృష్టి\nసారించాలని నిశ్చయించుకుందని అంటున్నారు. కొత్త హీరోలతో పనిచేసేందుకు కూడా\nఆసక్తి కనబరుస్తూ వరుసగా పలు తమిళ, మలయాళ చిత్రాలకు కమిట్ అవుతోంది.</font>', '2009-07-02 12:21:10', 1, 0),
(7, 4, '<font class="UnicodeContent">''మల్లన్న'' జూలైలో లేనట్టే?!</font>', '', '<font class="UnicodeContent">''అపరిచితుడు'' చిత్రం తర్వాత హీరో విక్రమ్ ను\nమళ్లీ ఆ స్థాయిలో ప్రెజెంట్ చేస్తున్న చిత్రంగా ''మల్లన్న'' కొద్దికాలంగా\nవిపరీతమైన పబ్లిసిటీని చూరగొంటోంది. సుశీ గణేషన్ దర్శకత్వంలో కళైపులి థాను\nసుమారు 45 కోట్ల భారీ బడ్జెట్ తో ఈ చిత్రాన్ని </font>', '<font class="UnicodeContent">నిర్మించడం, విక్రమ్ కు జోడిగా గ్లామర్ నటి\nశ్రియ నటిస్తుండటంతో పాటు పలు హైలైట్స్ ఈ చిత్రంలో చోటుచేసుకుంటున్నాయి.\nతమిళంలో ఈ చిత్రం ''కందసామి'' పేరుతో విడుదల కానుంది. దాదాపు రెండేళ్ల పాటు\nచిత్రీకరణ జరుపుకొన్న ఈ చిత్రం ఎప్పుడెప్పుడు విడుదలవుతుందా అని చియాన్\nవిక్రమ్ అభిమానులు ఎదురుతెన్నులు చూస్తున్నారు. అయితే మరో నెలరోజుల పాటు ఈ\nనిరీక్షణ తప్పదనీ, జూలైలో ''మల్లన్న'' వెలుగుచూసే అవకాశాలు దాదాపు\nలేనట్టేననీ చెన్నై వర్గాల ద్వారా తెలుస్తోంది. హాలీవుడ్ సినిమా చూస్తున్న\nఅనుభూతిని కలిగించే విధంగా కంప్యూటర్ గ్రాఫిక్స్ ఇందులో ఉండబోతున్నాయనీ,\nవీటి కోసం మరికొంత వ్యవధి అనివార్యం కానుందనీ, ఏరకంగా చూసినా ఆగస్టులోనే ఈ\nచిత్రం విడుదలయ్యే అవకాశాలున్నాయనీ ఆ వర్గాలు చెబుతున్నారు.<br>\n<br>\nసమాజంలో అంతకంతకూ విశ్వరూపం దాలుస్తున్న ఆర్థిక అసమానతలపై పోరాటం సాగించిన\nఓ ప్రభుత్వాధికారి కథే ''మల్లన్న''. సిబిఐలో ఆర్థిక నేరాల విభాగాన్ని\nపర్యవేక్షించే అధికారిగా విక్రమ్ ఇందులో కనపించనున్నారు. రాబిన్ హుడ్\nతరహాలో ఆయన పాత్ర ఉండబోతోంది. విదేశాల నుంచి ఇండియాకి తిరిగి వచ్చిన\nఅభ్యుదయ భావాలు కలిగిన అమ్మాయిగా శ్రియ నటించింది. నటశేఖర కృష్ణ ఓ కీలక\nపాత్ర పోషించారు. గీత రచయిత సాహితి ఈ చిత్రం ద్వారా మాటల రచయితిగా పరిచయం\nకావడం, దేవిశ్రీప్రసాద్ సంగీతం ప్రత్యేక ఆకర్షణలు కాబోతున్నాయి. విక్రమ్\nఐదు గెటప్స్ లో కనిపించ నుండగా, ఇందులోని పాటలన్నింటినికీ ఆయన స్వయంగా\nనేపథ్యగానం అందించారు. తెలుగులో తన పాత్రకు డబ్బింగ్ కూడా చెప్పుకున్నారు.\nఇన్ని ప్రత్యేకతలున్న ''మల్లన్న'' చిత్రాన్ని వివిధ భాషల్లో 900కు పైగా\nథియేటర్లరో ప్రపంచవ్యాప్తంగా విడుదల చేసేందుకు నిర్మాత కళైపులి థాను\nప్లాన్ చేస్తున్నారు.</font>', '2009-07-02 12:23:04', 1, 0),
(8, 5, '<font class="UnicodeContent">''భీష్మ'' తెరవెనుక స్టోరీ?</font>', '', '<font class="UnicodeContent">''మిత్రుడు'' చిత్రం తర్వాత యువరత్న బాలకృష్ణ\nకథానాయకుడు ప్రముఖ నిర్మాత బెల్లంకొండ సురేష్ ''భీష్మ'' సినిమా అనౌన్స్\nచేయడంతో బాలయ్య బాబు అభిమానుల్లో ఉత్సాహం తొంగిచూస్తోంది. బెల్లంకొండకు\nనిర్మాతగా స్టార్ ఇమేజ్ బాలకృష్ణ సినిమాలతోనే వచ్చిందనేది</font>', '<font class="UnicodeContent">కాదనలేని సత్యం. ఈ ఇద్దర్నీ మంచి మిత్రులుగా\nకూడా చెబుతుంటారు. ''లక్ష్మీనరసింహా'' చిత్రం విషయంలో ఈ ఇద్దరికీ\nపొరపొచ్చాలు వచ్చాయనీ, పర్వవసానంగానే బాలకృష్ణ ఇంట్లో కాల్పుల సంఘటన\nచోటుచేసుకుందనీ అప్పట్లో అంతా అనుకున్నదే. బాలకృష్ణను ఈ సంఘటన ఇరకాటంలో\nపెట్టే అవకాశాలున్న తరుణంలో ఇద్దరి మధ్యా కుదిరిన ''రాజీ''తో ఆ వ్యవహారం\nసద్దుమణిగింది. ఇందులో భాగంగానే బెల్లంకొండతో పనిచేసేందుకు బాలయ్య భరోసా\nఇచ్చారనే కథనాలు కూడా అప్పట్లో వినిపించాయి. ఇప్పుడు ఆ తరుణం వచ్చింది.\nబెల్లంకొండ ''రైడ్'' చిత్రం ఆడియో వేడుకకు బాలయ్య విచ్చేయడం, బాలయ్య\nపుట్టినరోజును తన చిత్ర యూనిట్ తో సహా బెల్లంకొండ జరుపుకోవడం అందరి\nదృష్టినీ ఆకర్షించింది. బాలయ్య బాబు డేట్స్ ఇస్తే వెంటనే సినిమా తీయడానికి\nసిద్ధంగా ఉన్నానంటూ సురేష్ ప్రకటించారు. ఇది జరిగిన వారం రోజులకే\nబాలకృష్ణతో ''భీష్మ'' చిత్రాన్ని అనౌన్స్ చేయడం, పూజా కార్యక్రమాలు కూడా\nజరపడం చకచగా జరిగిపోయాయి. రమేష్ వర్మ (''రైడ్'' ఫేమ్) దర్శకత్వంలో ఆగస్టు\nనుంచి రెగ్యులర్ షూటింగ్ కు కూడా సన్నాహాలు జరుగుతున్నాయి. ఆసక్తికరంగా\nఇప్పుడో రసవత్తరమైన చర్చ ఫిల్మ్ సర్కిల్ లో జరుగుతోంది. బెల్లంకొండ వద్ద\nబాలకృష్ణకు చెందిన మూడు సినిమాల డేట్స్ ఉన్నాయన్నదే ఈ చర్చ సారాంశం.<br>\n<br>\nఅందర్నీ కలవరపెట్టిన ఆనాటి ఉదంతం అనంతరం బెల్లంకొండతో మూడు సినిమాలకు\nబాలయ్య డేట్స్ కమిట్ అయ్యారట. అయితే ఇక్కడ ఓ మెలిక ఉందట. ఆ మూడింటినీ\nబెల్లంకొండ స్వయంగా నిర్మించనూ వచ్చు. ఆ డేట్స్ ను వేరేవారికి (తనవాళ్లకు)\nబదలాయించనూ వచ్చట. అయితే మాటకు కట్టుబడటానికే బాలయ్య ఇప్పటికీ\nమొగ్గుచూపుతున్నారట. ''భీష్మ'' ఇప్పటికే బెల్లంకొండ అనౌన్స్ చేసినందున\nమిగిలిన రెండు చిత్రాల విషయం తేలవలసి ఉంటుందని ఫిల్మ్ వర్గాలు అంటున్నాయి.\nఏదిఏమైనా...ఇలాంటి ''ఒప్పందాలు'' ఏవైనా ఉంటే పరస్పర అవగాహనతోనే కుదురుతాయి\nకాబట్టి వేచిచూడటం మినహా నిజానిజాలు బయటకు వచ్చే అవకాశాలు అంతగా ఉండవు\nమరి... </font>', '2009-07-02 12:24:31', 1, 0),
(9, 6, 'ప్రయాణం', '', '<font class="UnicodeContent">రెండు పాత్రలతో ''షో'' చూపిస్తే జాతీయ స్థాయి\r\nగుర్తింపు వచ్చింది. అప్పట్లో అదో వైవిధ్యం. కేవలం రెండు గంటల్లో ప్రేమ\r\nపుట్టి...మొగ్గతొడిగి...పువ్వు పూస్తే ఎలా ఉంటుంది? సైట్</font>', '<font class="UnicodeContent">మీద నమ్మకం ఉన్న వాళ్లు సైతం ''డెడ్ లైన్''\nగీసుకుని ప్రేమను సాఫల్యం చేసుకున్నట్టు ఎక్కడా కనబడదు. అయితే రొటీన్ కు\nభిన్నంగా ఏది చేసినా అది ఓ ప్రయోగమే అవుతుంది. ''ఐతే'', ''అనుకోకుండా\nఒకరోజు'', ''ఒక్కడున్నాడు'' వంటి వైవిధ్యమైన చిత్రాలు తీసిన చంద్రశేఖర్\nయేలేటి ఇప్పుడు అలాంటి సాహసయానమే చేశారు. కేవలం ఆరేడు పాత్రలతో\nప్రేక్షకులను రెండు గంటల ప్రేమ ''ప్రయాణం'' చేయించారు. చూపులు కలవడం,\nప్రేమలో పడటం, ప్రపోస్ చేయడం, లవ్ క్వశ్చనీర్, ఫైనల్స్ ...ఈ\nసంఘటనలన్నింటికీ నేపథ్యం కౌలాలంపూర్ ఇంటర్నేషనల్ ఎయిర్ పోర్ట్. నిజానికి\nఇవాల్టి కమర్షియల్ ట్రెండ్ కు భిన్నమైన ప్రయత్నం ఇది. ఇలాంటి థీమ్ తో\nరిస్క్ చేయడానికి నిర్మాతలు సాహసించరని గ్రహించడం వల్లనో ఏమో...చంద్రశేఖర్\nయేలిటి నిర్మాతగా మారి ఆర్యకి ఆర్ట్స్ బ్యానర్ నుంచి ఈ చిత్రానికి కర్త,\nకర్మ, క్రియ అంతా తానే అయ్యారు. ఆయన ''ప్రయాణం''లోని పదనిసల్లోకి\nతొంగిచూస్తే...</font>', '2009-07-02 12:25:50', 0, 0),
(24, 2, '<font class="UnicodeContent">సిక్స్ ప్యాక్ సిద్ధార్ధ</font>', '', '<font class="UnicodeContent">హీరోలకు సిక్స్ ప్యాక్, హీరోయిన్లకు టట్టూలు\nఇప్పుడు ఇండియన్ సినిమాకు సరికొత్త ట్రెండ్ గా మారింది. ''నటన మాట ఎలా\nఉన్నా ఇవాల్టి రోజుల్లో సిక్స్ ప్యాక్ ఉన్నవాడే హీరో'' అంటూ వర్మ</font>', '<font class="UnicodeContent">అడవి'' లో ఓ తమాషా సంభాషణ కూడా ఉంది. ఆ మాట\nఎలా ఉన్నా...తొలుత బాలీవుడ్ లో సిక్స్ ప్యాక్ ట్రెండ్ ఊపందుకుంది. ఫిజికల్\nఫిటెనెస్ ను మొదట్నించీ నమ్మే సల్మాన్ వంటి ఒకరిద్దరు హీరోలు మినహాయిస్తే\nషారూక్, అమీర్ వంటి మిడిల్ ఏజ్డ్ హీరోలు సైతం ఇటీవల సిక్స్ ప్యాక్ డవలప్\nచేసి ప్రేక్షకులను అలరించారు. తెలుగులో ఈ తరహా ట్రెండ్ కు ఓరకంగా అల్లు\nఅర్జున్ ''దేశముదురు''తో ఆద్యుడయ్యాడని చెప్పవచ్చు. ఆ తర్వాత నితిన్ 8\nప్యాక్ డవలప్ చేసి పలు సినిమాల్లో కనిపించారు. ''కుర్రోడు'' చిత్రంలో వరుణ్\nసందేష్, ''వరుడు'' లో మహేష్ బాబు సిక్స్ ప్యాక్ చేయబోతున్నారనే ప్రచారమూ\nజరుగుతోంది. ఇప్పుడు సిక్స్ ప్యాక్ హీరోల జాబితాలో లవర్ బాయ్ ఇమేజ్ ఉన్న\nసిద్దార్ధ కూడా వచ్చిచేరబోతున్నారు.<br>\n<br>\n''బొమ్మరిల్లు'', ''కొంచెం కష్టం కొంచెం ఇష్టం'' చిత్రాలతో తన లవర్ బాయ్ ఇమేజ్\nను పదిలం చేసుకున్న సిద్దార్ధ తన తదుపరి ప్రాజెక్ట్ ల విషయంలో\nదేహదారుఢ్యాన్ని పెంచుకుని సిక్స్ ప్యాక్ డవలప్ చేసే పనిలో పడినట్టు\nసమాచారం. సిద్దార్ధ ప్రస్తుతం యాక్షన్ తో కూడిన సోసియో ఫాంటసీ చిత్రానికి\nకమిట్ అయ్యారు. ఈ చిత్రాన్ని కోవెలమూడి ప్రకాష్ (కె.రాఘువేంద్రరావు\nతనయుడు) దర్శకత్వంలో ఎబోడ్ (ఎ బెల్లీఫుల్ ఆఫ్ డ్రీమ్స్ ఎంటర్ టైన్ మెంట్)\nబ్యానర్ పై కె.రాఘువేంద్రరావు నిర్మించనున్నారు. దీనికితోడు అల్లరి\nరవిబాబు దర్శకత్వంలో మరో చిత్రాని కూడా సిద్దార్ధ కమిట్ అయినట్టు సమాచారం.\nఇది యాక్షన్ ప్యాక్డ్ చిత్రమనీ, హృతిక్ రోషన్ హిందీ ''లక్ష్య'' చిత్రానికి\nదగ్గరగా ఉంటుందనీ తెలుస్తోంది. తన కొత్త ప్రాజెక్ట్ లలో పాత్రలకు\nఅనుగుణంగా సిద్దార్ధ సిక్స్ ప్యాక్ డవలప్ చేస్తున్నట్టు చెబుతున్నారు.\nఇందుకోసం అమీర్ ఖాన్ వ్యక్తిగత ఫిజికల్ ట్రైనర్ వద్ద సిద్దార్ధ శిక్షణ\nతీసుకోబోతున్నారు. లవర్ బాయ్ సిద్దార్ధ సిక్స్ ప్యాక్ తో యువ ప్రేక్షకుల\nగుండెల్లో ఎలాంటి గుబులు పుట్టించనున్నారనేది చూడాలి...</font>', '2009-08-12 11:00:24', 1, 1),
(10, 6, '<font class="UnicodeHeadline">మరో ప్రేమోన్మాది ఘాతుకం</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : ప్రేమ పేరుతో యువకులు\nఉన్మాదుల్లా మారిపోతున్న సంఘటనల జాబితాలో గురువారం ఉదయం మరో తాజా సంఘటన\nచోటు సంపాదించుకుంది. పాలిటెక్నిక్ చదువుతున్న విద్యార్థినిని వరుసకు\nమేనబావ అని భావిస్తున్న సుధాకర్ నాయక్ అనే వ్యక్తి గొడ్డలితో దాడిచేసి\nతీవ్రంగా </font>', '<font class="UnicodeContent">గాయపరిచాడు. రాష్ట్ర హోం శాఖ మంత్రి పి.\nసబితా ఇంద్రారెడ్డి నియోజకవర్గంలో ఈ దారుణం చోటుచేసుకుంది. ప్రస్తుతం\nనిందితుడు సుధాకర్ నాయక్ ఎల్.బి. నగర్ పోలీసుల అదుపులో ఉన్నాడు. తీవ్రంగా\nగాయపడిన లావణ్యను మలక్ పేట యశోదా ఆస్పత్రికి వైద్య చికిత్స నిమిత్తం\nతరలించారు. ప్రస్తుతం ఆమె పరిస్థితి విషమంగానే ఉందని, అయితే ప్రాణానికి\nహాని లేదని వైద్యులు వెల్లడించారు.<br>\n<br>\nరంగారెడ్డి జిల్లా మహేశ్వరం అసెంబ్లీ నియోజకవర్గం పరిధిలోని మీర్ పేటలో\nఉన్న టిఆర్ ఆర్ పాలిటెక్నిక్ కళాశాలలో లావణ్య డిప్లొమా ఇన్ కంప్యూటర్\nసైన్స్ చదువుతోంది. గత కొంతకాలంగా తనను ప్రేమించాలంటూ వెంటబడి సుధాకర్\nనాయక్ లావణ్య వెంటపడి వేధిస్తున్నాడు. అయితే, సుధాకర్ ప్రతిపాదనను లావణ్య\nతిరస్కరిస్తూ వస్తోంది. గురువారం ఉదయం కళాశాల ల్యాబ్ లో లావణ్యపై\nఅత్యాచారం చేసేందుకు యత్నించాడు. లావణ్య బలంగా ప్రతిఘటించింది. తనకు\nలావణ్య ఇక దక్కే అవకాశాలు కనిపించకపోవడంతో సుధాకర్ నాయక్ గురువారం ఉదయం\nఆమెపై గొడ్డలితో దాడి చేశాడు. ఈ దాడిలో లావణ్య చెస్ట్ కుడివైపున తీవ్ర\nగాయం అయింది. కళాశాల సిబ్బంది లావణ్యను యశోదా ఆస్పత్రికి తరలించారు.\nపోలసులు కేసు నమోదు చేసుకొని దర్యాప్తు చేస్తున్నారు.</font>', '2009-07-02 15:21:08', 1, 0),
(11, 6, '<font class="UnicodeHeadline">న్యూజెర్సీలో ఎబి స్పీడ్ వే</font>', '', '<font class="UnicodeContent">న్యూజెర్సీ : ఎడిసన్ నగరంలో ''ఆంధ్రా బ్యాంకు\nస్పీడ్ వే'' సేవలను ప్రారంభించింది. జూన్ 29న జరిగిన ఒక కార్యక్రమంలో\nఆంధ్రా బ్యాంకు మేనేజింగ్ డైరెక్టర్ ఆర్.ఎస్</font>', '<font class="UnicodeContent">రెడ్డి ఈ విభాగాన్ని లాంఛనంగా\nప్రారంభించారు. కార్యక్రమానికి హాజరైన అతిథులను సత్యనారాయణమూర్తి వేమూరు\nఆహ్వానించగా, బ్యాంకు జనరల్ మేనేజర్ త్రివేది సమావేశానికి అధ్యక్షత\nవహించారు. ఇటీవలి కాలంలో ఆంధ్రా బ్యాంకు సాధించిన విజయాలను, ఖాతాదారులకు\nఅందించిన సేవల గురించి జి.ఎం. త్రివేది వివరించారు. లక్ష కోట్ల రూపాయల\nవ్యాపారం చేయడం బ్యాంకు చరిత్రలో ఒక మైలురాయిగా నిలుస్తుందని ఆయన\nవెల్లడించారు. అంతే కాకుండా ఆంధ్రా బ్యాంకు అన్ని శాఖల్లోనూ కోర్\nబ్యాంకింగ్ సేవలను నూటికి నూరు శాతం అందించే దిశగా సాగిపోతున్నదని\nతెలిపారు.<br>\n<br>\nన్యూజెర్సీలో ఆంధ్రా బ్యాంకు ఏర్పాటు చేసిన స్పీడ్ వే పథకం ముఖ్య\nఉద్దేశాలు, అందించే సేవల గురించి బ్యాంకు జనరల్ మేనేజర్ రాకేష్ సేథీ\nవిపులంగా వివరించారు. మహేశ్వరబాబు వందన సమర్పణ చేశారు.</font>', '2009-07-02 15:23:15', 0, 0),
(12, 6, '<font class="UnicodeHeadline">మరో 80 `మోర్'' స్టోర్స్ </font>', '', '<font class="UnicodeContent">ముంబయి : గడచిన ఆర్థిక సంవత్సరంలో 110 శాతం\nవృద్ధిని సాధించి మంచి ఊపులో ఉన్న ఆదిత్య బిర్లా రిటైల్ చెయిన్ ఈ ఏడాది\nకొత్తగా 80 `మోర్...'' స్టోర్స్ ను ప్రారంభించేందుకు ప్రణాళికలు\nరూపొందించింది. ఇదే సమయంలో 10-20 ఔవుట్ లెట్లను క్లీనప్ కార్యకలాపాల్లో\nభాగంగా మూసివేసే అవకాశం ఉంది. `మా అవులెట్ల సంఖ్యను 720-230 వరకు పెంచాలని\nఅనుకుంటున్నాం. ఇందులో భాగంగా కొత్తగా 80 స్టోర్స్ </font>', '<font class="UnicodeContent">ప్రారంభించాలని అనుకుంటున్నాం. పాత వాటిలో\n10 నుంచి 20 స్టోర్స్ మూసివేస్తాం. అందువల్ల మొత్తం మీద ఈ ఏడాది అదనంగా\n60-70 అవుట్ లెట్లు కలుస్తాయని ఆదిత్య బిర్లా రిటైల్ ఛీఫ్ ఎగ్జిక్యూటివ్\nఆఫీసర్ థామస్ వర్గీస్ తెలిపారు. <br>\n<br>\nప్రస్తుతం మైసూరు, బరోడాలలో కంపెనీ రెండు హైపర్ మార్కెట్లను\nనిర్వహిస్తోంది. అదే తరహాలో మార్చి నాటికి ఆరు నుంచి ఎనిమిది హైపర్\nస్టోర్స్ ఏర్పాటు చేయాలని కంపెనీ ప్రతిపాదించింది. `ఈ ఆర్థిక సంవత్సరంలో\nహైపర్ మార్కెట్లపై దృష్టిని కేంద్రీకరిస్తామని, ఆరు నుంచి ఎనిమిది హైపర్\nమార్కెట్లు ప్రారంభించాలని అనుకుంటున్నామని'' వర్గీస్ తెలిపారు. ఈ ఏడాది\n1600-1700 కోట్ల రూపాయల అమ్మకం టర్నోవర్ సాధించాలని అనుకుంటున్నామని, ఇది\nక్రితం సంవత్సరం కన్నా 45 శాతం ఎక్కువ అని తెలిపారు. గత సంవత్సరం 110 శాతం\nవృద్ధిని సాధించాము. ఈ ఏడాది అంత సాధ్యం కాకపోవచ్చు. అయితే 40-45 శాతం\nవృద్ధిని సాధించవచ్చు అని ఆయన అన్నారు.</font>', '2009-07-02 15:24:25', 0, 0),
(13, 6, '<font class="UnicodeContent">నారా వారి ''బాణం''</font>', '', '<font class="UnicodeContent">సినీ రంగానికి వారసుల ప్రవేశం కొత్త కాదు.\nనాగార్జున తనయుడు నాగచైతన్య ''జోష్'' తోనూ, డి.సురేష్ బాబు తనయుడు రానా\n(రామానాయుడు) శేఖర్ కమ్ముల దర్శకత్వంలో రూపొందుతున్న ''లీడర్'' </font>', '<font class="UnicodeContent">చిత్రంతోనూ హీరోలుగా ఈ ఏడాదే ప్రేక్షకుల\nముందుకు రాబోతున్నారు. తాజాగా రాజకీయ వారసత్వం ఉన్న నారా రోహిత్ సైతం\nహీరోగా పరిచయం కాబోతున్నారు. తెలుగుదేశం అధినేత నారా చంద్రనాయుడు సోదరుడైన\nనారా రామ్మూర్తినాయుడి కుమారుడే రోహిత్. మహేష్ ను ''రాజకుమారుడు'', అల్లు\nఅర్జున్ ను ''గంగోత్రి'' చిత్రాల ద్వారా పరిచయం చేసిన ప్రముఖ నిర్మాత\nసి.అశ్వనీదత్ తన వైజయంతీ మూవీస్ పతాకంపై నారా రోహిత్ తొలి చిత్రాన్ని భారీ\nస్థాయిలో నిర్మించబోతున్నారు. ఈ చిత్రం ద్వారా దంతులూరి చైతన్య దర్శకుడిగా\nపరిచయం కానున్నారు. ఈ చిత్రానికి ''బాణం'' అనే టైటిల్ పరిశీలనలో ఉందని\nతెలుస్తోంది.<br>\n<br>\nరోహితి సరసన ఓ కొత్తమ్మాయిని వెండితెరకు పరిచయం చేయనున్నారు. ప్రస్తుతం\nనటీనటులు, సాంకేతిక నిపుణుల ఎంపిక జరుగుతోంది. ఈ నెలలోనే నందమూరి\nహీరోలందరి సమక్షంలో గ్రాండ్ గా ఈ చిత్ర ప్రారంభోత్సావాన్ని ఇదే నెలలో\nజరిపేందుకు ఏర్పాట్లు జరుగుతున్నాయి. ఈ చిత్రంతో పాటు ఎన్టీఆర్\nకథానాయకుడిగా మెహర్ రమేష్ దర్శకత్వంలో ఓ కొత్త చిత్రానికి అశ్వనీదత్ ఇటీవల\nపూజా కార్యక్రమాలు జరిపారు. సెప్టెంబర్ నుంచి ఆ చిత్రం రెగ్యులర్ షూటింగ్\nజరుగుతుంది.</font>', '2009-07-02 15:32:00', 0, 0),
(14, 6, '<font class="UnicodeHeadline">100 డే ''హానీమూన్'' వద్దు!</font>', '', '<font class="UnicodeContent">న్యూఢిల్లీ: రెండోసారి అధికార పగ్గాలు\nచేపట్టిన ''ఉపా'' సంకీర్ణ సర్కార్ మంచి జోరుమీద కనిపిస్తోంది. కొత్త\nప్రభుత్వం కొలువుదీరిన వెంటనే 100 రోజుల్లో పరిపాలనను మెరిపిస్తామని\nప్రధానమంత్రి మన్మోహన్ సింగ్ జాతికి వాగ్దానం చేశారు. దీనికి అనుగుణంగా\nఆయన మంత్రివర్గ సహచరులు వారి వారి మంత్రిత్వ శాఖల</font>', '<font class="UnicodeContent">కింద చేపట్టబోయే అభివృద్ధి పథకాలు,\nసంస్కరణలను హడావిడిగా ప్రకటించేశారు. అయితే వినూత్నమైన, వినసొంపైన ఈ\nఆలోచనలపై విస్తృతంగా చర్చ జరగకుండా అమలు చేస్తే అవి ప్రతికూల పరిణామాలకు\nదారితీసే ప్రమాదం ఉందని ప్రజా విధాన నిపుణులు హెచ్చరిస్తున్నారు. విద్యా\nరంగంలో పరీక్షల విధానాన్ని ఆసాంతంగా సంస్కరించడం, ఉన్నత న్యాయ వ్యవస్థ\nపనితీరులో కనీవినీ ఎరుగనంతటి పారదర్శకత తీసుకురావడం, ప్రాజెక్ట్ ల\nనిర్మాణంలో పర్యావరణ క్లియరెన్స్ లను వేగిరపరచడం వంటి అనేక వినూత్నమైన\nఆలోచనలను మన్మోహన్ సింగ్ సహచరులు దేశ ప్రజల ముందు ఆవిష్కరించారు.<br>\n<br>\nఅయితే ఈ ఆలోచనలు, ప్రణాళికలలో అంతుబట్టని, సమాధానం తెలియని అనేక విషయాలు\nఉన్నాయి. వీటిపై సమాజంలోని అన్ని వర్గాలలో క్షుణ్ణంగా చర్చ జరగకుండా 100\nరోజుల డెడ్ లైన్ అంటూ ఆచరణలోకి తీసుకువస్తే అది అటు ప్రభుత్వానికి, ఇటు\nదేశానికి కూడా చేటు తీసుకురాగలవని విధాన నిపుణులు హెచ్చరిస్తున్నారు. 100\nరోజుల ప్రణాళికలను ఆవిష్కరించడంలో కేంద్ర మానవ వనరుల అభివృద్ధి శాఖ మంత్రి\nకపిల్ సిబాల్, న్యాయ శాఖ మంత్రి వీరప్ప మొయిలీ, పట్టణ అభివృద్ధి శాఖ\nమంత్రి జైపాల్ రెడ్డి పోటీ పడి మరీ ప్రెస్ కాన్ఫరెన్స్ లు నిర్వహించారు.\nపర్యావరణ శాఖ మంత్రి జైరామ్ రమేష్ కూడా మొదట్లో ఈ రేసులో చేరినా తర్వాత\nపక్కకు తప్పుకుని తమ మంత్రిత్వ శాఖ చేస్తున్న ప్రతిపాదనలు 100 రోజుల డెడ్\nలైన్ తో చేస్తున్నవి కాదని వివరణ ఇచ్చుకున్నారు.<br>\n<br>\n''నిజమే. కేంద్ర మంత్రులు కొందరు ప్రకటించిన ప్రతిపాదనలలో కొన్ని\nవిప్లవాత్మకమైనవి. మరికొన్ని ఆసక్తికరమైనవి. అయితే వాటిలో కొన్ని సవివరంగా\nలేవు. అలాంటి వాటిని 100 రోజుల లక్ష్యంగా పెట్టుకుని అమలు చేయడానికి\nప్రయత్నించ కూడదు. ప్రభుత్వం దీనికి తగినంత సమయం తీసుకుని ముందుకెళ్ళాలి''\nఅన్నారు ఢిల్లీలోని సెంటర్ ఫర్ పాలసీ రీసెర్చి సంస్థ అధ్యక్షుడు ప్రతాప్\nభాను మెహతా.</font>', '2009-07-02 15:33:07', 0, 0),
(15, 6, '<font class="UnicodeHeadline">టొరంటో ''సూపర్ సింగర్''</font>', '', '<font class="UnicodeContent">టొరంటో : గ్రేటర్ టొరంటో తెలుగు సంఘం\nఆధ్వర్యంలో తానా - మా టీవీ సూపర్ సింగర్ పోటీలను శనివారం మిస్సిసాగాలో\nఘనంగా నిర్వహించారు. తొమ్మిది మంది పాల్గొన్న ఈ</font>', '<font class="UnicodeContent">పోటీల్లో విజేతలుగా ఎంపికైన ఇద్దరు షికాగోలో\nజరిగే తానా 17వ మహాసభల్లో నిర్వహించే ఫైనల్ పోటీల్లో పాల్గొంటారు. ఈ\nపోటీలకు న్యాయ నిర్ణేతగా ప్రముఖ కర్ణాటక సంగీత గాయని మంజూ శంకరనారాయణ్\nవ్యవహరించారు.<br>\n<br>\nచివరి వరకూ ఉత్కంఠగా జరిగిన ఈ పోటీల్లో విజేతలుగా సురేష్ నిట్టల, బార్ల\nధీరజ్ ఎంపికయ్యారు. ఈ కార్యక్రమంలో గ్రేటర్ టొరంటో తెలుగు సంఘం అధ్యక్షుడు\nచారి సామాంతపూడి, తానా ఉపాధ్యక్షుడు సూరపనేని లక్ష్మీనారాయణ, అబ్దుల్\nమునాఫ్, సుఖవాసి గంగాధర్, అరుణ్ కుమార్, వారణాసి రవి, జాహా అబ్దుల్,\nలక్ష్మీ వెల్లంకి, జ్యోతి సామాంతపూడి, వింధ్యా వారణాసి, మూల్పూరి మీనా,\nసూరపనేని హారిక తదితరులు పాల్గొన్నారు.</font><br>', '2009-07-02 15:34:34', 0, 0);
INSERT INTO `cinema` (`id`, `type`, `heading`, `eng_heading`, `summary`, `description`, `insert_date`, `active`, `views`) VALUES
(16, 6, '<font class="UnicodeHeadline">జోరుగా కార్ల అమ్మకాలు</font>', '', '<font class="UnicodeContent">న్యూఢిల్లీ : దేశంలో కారు, దిచక్ర వాహన\nవిక్రయాలు ఊపందుకున్నాయి. వరుసగా నాలుగవ నెలలో స్వదేశీ కారు అమ్మకాల్లో\nవృద్ధిని సాధించింది. మే నెలలో 2.48 శాతం విక్రయాలు పెరిగాయి. కానీ\nప్రభుత్వం నుంచి ఆటో రంగానికి సహకారం అంతగా కనిపించడం లేదు. సొసైటీ ఆఫ్‌\nఇండియన్‌ ఆటో</font>', '<font class="UnicodeContent">మొబైల్‌ మ్యానుఫ్యాక్చర్స్‌(ఎస్‌ఐఎఎమ్‌)\nప్రకారం, మే నెలలో స్వదేశీ కారు అమ్మకాలు 1,10,745 యూనిట్ల నుంచి 1,13,490\nయూనిట్లకు పెరిగాయి. మే నెలలో మొత్తం ద్విచక్ర వాహన విక్రయాలు కూడా\n7,27,937 యూనిట్లతో 12.45 శాతం వృద్ధిని సాధించాయి. గత ఏడాది ఇదే సమయానికి\nద్విచక్ర వాహన విక్రయాలు 6,47,358 యూనిట్లు నమోదయ్యాయి. ద్విచక్ర వాహన\nఅమ్మకాలు గత ఏడాది ఇదే సమయానికి 5,13,209 యూనిట్ల నుంచి 5,76,541\nయూనిట్లతో 12.34 శాతం వృద్ధిని సాధించాయి. <br>\n<br>\nవృద్ధి బాటన నడుస్తున్నప్పటికీ ప్రభుత్వం సహకారం లేకపోవడం ఆటో పరిశ్రమలను\nనిరాశపరుస్తుందని ఎస్‌ఐఎఎమ్‌ తెలిపింది. గత మూడు, నాలుగు నెలల్లో వృద్ధిని\nపరిశీలించిన చూసినట్లయితే, ఉద్దీపన ప్యాకేజీల ప్రభావం ఉన్నట్లు\nకనిపిస్తోంది. ఈ వృద్ధి ఇలాగే కొనసాగాలంటే మరిన్ని ఉద్దీపన ప్యాకేజీల\nఅవసరం ఎంతైనా ఉందని ఎస్‌ఐఎఎమ్‌ సీనియర్‌ డైరెక్టర్‌ సుగాటో సేన్‌\nతెలిపారు. జూన్‌ నెలలో చూసినట్లయితే ప్రయాణికుల వాహనాల పరిస్థితి\nఅధ్వాన్నంగానే కనిపిస్తుందని ఆయన అన్నారు. ఈ ఏడాది మే నెలలో మొత్తం మొత్తం\nవాహన విక్రయాలు 8,53, 969 యూనిట్ల నుంచి రూ.9,29,596 యూనిట్లకు పెరిగి\n8.86 శాతం వృద్ధిని సాధించాయని ఎస్‌ఐఎఎమ్‌ వెల్లడించింది.<br>\n<br>\nమారుతీ సుజుకీ 57,315 యూనిట్ల నుంచి 62,878 యూనిట్లతో 9.71 శాతం వృద్ధిని\nసాధించింది. అలాగే ఇతర కంపెనీలను చూసినట్లయితే, హ్యుందాయ్‌ మోటార్‌ 24,506\nయూనిట్ల నుంచి 23,501 యూనిట్లతో 4.10 శాతం క్షీణించాయి. టాటా మోటార్స్‌\nవిక్రయాలు 14,228 యూనిట్ల నుంచి 12,838 యూనిట్లతో 9.77 శాతం తగ్గాయి.\nఆసక్తికరమైన విషయమేమిటంటే అమెరికాలో జనరల్‌ మోటార్స్‌ దివాళాను\nప్రకటించినప్పటికీ మే నెలల్లో విక్రయాలు 3,847 యూనిట్ల నుంచి 3,890\nయూనిట్లతో 1.18 శాతం వృద్ధిని సాధించాయి. మే నెలలో కారు ఎగుమతులు 42 శాతం\nవృద్ధిని సాధించాయి. స్వదేశీ విక్రయాలను చూసినట్లయితే 2.48 శాతం వృద్ధి\nనమోదు చేశాయి. </font>', '2009-07-02 15:37:10', 0, 0),
(17, 6, '<font class="UnicodeHeadline">ఫ్లైటుకు మసాలా ఘాటు!</font>', '', '<font class="UnicodeContent">ముంబాయి : ఆహార పదార్థాల్లో మసాలా ఘాటు\nఅధికమైతే మన ముక్కుపుటాలు అదిరిపోతాయి. కళ్ళు గిర్రున తిరుగుతాయి. ఘాటు\nమరికాస్త ఎక్కువైతే దబ్బున కళ్ళు తిరిగి కింద పడతాం. అదే ఫ్లైటుకైతే ఫైర్\nఅలారం మోగించి అరిచి అల్లరి చేసేస్తుంది. ఆనక తనను గాల్లోంచి కిందికి\nదించి ఘాటును తొలగించేలా </font>', '<font class="UnicodeContent">చేస్తుంది. శనివారం నాడు సరిగ్గా ఇదే జరిగింది.<br>\n<br>\nఫ్రాంక్ ఫర్ట్ కు చెందిన విమానం శుక్రవారంనాడు ముంబాయి ఎయిర్ పోర్ట్ నుంచి\nటేకాఫ్ అవుతున్న సమయంలో ఒక్కసారిగా ఫైర్ అలారం గణగణమంటూ మోగింది. అలారం\nమోగడంతో ప్రయాణికులు ఒక్కసారిగా ఉలిక్కిపడ్డారు. భయాందోళనలకు గురయ్యారు.\nఅలారం హెచ్చరికలతో పైలట్ అప్పుడప్పుడే గాల్లోకి ఎగురుతున్న విమానాన్ని\nమళ్ళీ కిందికి దించాడు. అప్పుడు ఆ విమానంలో మొత్తం 235 మంది\nప్రయాణికులున్నారు.<br>\n<br>\nఇంతకీ అసలు విషయం ఏమంటే అదే విమానంలో ప్రయాణిస్తున్న వ్యక్తి\nతీసుకువెళుతున్న ఓ పొట్లంలో నుంచి ఘాటైన మసాలా వాసన వచ్చింది. ఆ వాసనను\nపసిగట్టిన విమానం ఒక్కసారిగా ఫైర్ అలారం మోగించింది. వెంటనే విమానాన్ని\nకిందికి దింపి తనిఖీలు నిర్వహించినప్పుడు మసాలా విషయం బయటపడింది. దీనితో\nప్రయాణికులంతా ఒక్కసారిగా ''హమ్మయ్య'' అని ఊపిరిపీల్చుకున్నారు.</font>', '2009-07-02 15:44:29', 0, 0),
(18, 6, '<font class="UnicodeHeadline">చెత్తగా ఆడారు : అజర్‌</font>', '', '<font class="UnicodeContent">హైదరాబాద్‌: టి-20 వరల్డ్‌కప్‌ నుంచి భారత\r\nజట్టు వైదొలగడానికి చెత్త ఆటే కారణమని భారత క్రికెట్‌ మాజీ కెప్టెన్‌,\r\nలోక్‌సభ సభ్యుడు మహ్మద్‌ అజారుద్దీన్‌ అన్నారు. ట్రోఫీని నిలబెట్టుకునే\r\n </font>', '<font class="UnicodeContent">అర్ధంతరంగా నిష్ర్కమించడం అభిమానులను\nనిరాశపరిచిందన్నారు. సమష్టి వైఫల్యం వల్లే ధోనీ సేన పరాజయం పాలైందన్నారు.\nవరుస విజయాలతో అభిమానుల్లో కొత్త ఆశలు చిగురింప చేసిన టీమిండియా కనీసం\nసెమీస్‌కు కూడా చేరకపోవడం బాధించే విషయమాన్నారు. ఇంగ్లాండ్‌,\nవెస్టిండీస్‌లతో జరిగిన మ్యాచుల్లో భారత ఫీల్డింగ్‌ ఘోరంగా ఉందన్నారు.\nఇప్పటికైనా క్రికెట్‌ బోర్డు జట్టు వైఫల్యాలపై దృష్టి సారించాలని అజర్‌\nసూచించారు.</font>', '2009-07-02 15:45:44', 0, 0),
(19, 1, '<font class="UnicodeContent">''అడవి'' రివ్యూ</font>', '', '<font class="UnicodeContent">ఇండియన్ సినిమా నడక మార్చిన దర్శకుడిగా రామ్\nగోపాల్ వర్మ నుంచి ఓ సినిమా వస్తోందంటే ఎదురుచూసే ప్రేక్షకులకు కొదవ లేదు.\nడిఫరెంట్ జనర్ సినిమాలు తీయడంలో స్పెషలిస్టుగా ఆయనకు పేరుంది. <br></font>', '<font class="UnicodeContent"> సైకలాజికల్ థ్రిల్లర్లు, అండవరల్డ్ గ్యాంగ్\nవార్ ఫేర్, రాజకీయాలు-నేరస్థుల సంబంధాలు..ఇలా ఎప్పటికప్పుడు వైవిధ్యమైన\nఇతివృత్తాలతో జనం ముందుకు వస్తుంటారు. అయితే ఇటీవల కాలంలో ఆయనకు సైతం\nబాక్సాఫీస్ వైఫల్యాలు తప్పడం లేదు. నలుగురూ నడిచిన బాటలోనే వర్మ నడిస్తే\nచూడాలని ఎవరనుకుంటారు? వర్మ అంటేనే క్రియేటివిటీకి మారుపేరు అని కదా..మరి\nఎక్కడ లోపం జరుగుతోంది? ఇంత తీరుబడిగా ఆలోచించేందుకు వర్మ సిద్దంగా\nఉన్నట్టు కనిపించదు. ఫ్యాక్టరీ బ్యానర్ నుంచి రోజుకో ప్రోడక్ట్ (సినిమా)\nఅందించాలనే లక్ష్యం మంచిదే కానీ...అందుకు అస్త్రశస్త్రాలు కావాలి కదా.\n''అనగనగా ఓ రాజు..ఆయనకు ఏడుగురు కొడుకులు...వేటకు వెళ్లి ఏడు చేపలు\nపట్టారు'' అనే కథనే వర్మ కూడా చెప్పదలిస్తే తెలివిమీరిన (తెలివిగల)\nప్రేక్షకుల చెవికెక్కుతుందా? అడవిలోకి ఉద్దేశపూర్వకంగానో, యాదృచ్ఛికంగానే\nవెళ్లిన కొందరు అనుమానాస్పద స్థితిలో ఒక్కొక్కరూ మృత్యువాత పడుతూ,\nదీనివెనుక ఓ మిస్టరీ ఉందని చూపించే ఫార్ములాకు హిమాలయాలంత పాత చరిత్ర\nఉందని వర్మకు చెప్పాలా? చెప్పినా చెప్పకపోయినా వర్మ సంధించిన ''అడవి'' కూడా\nఈ కోవలోనిదే. వర్మ సినిమా అంటే ఏదో ఒక ప్రత్యేకత ఉండాలి కదా అంటారా? ఉంది.\nఫారెస్ట్ లోని మర్టర్స్ మిస్టరీకి కారకులెవరనేది ఎవరికి తోచింది వారు\nఊహించుకోమని తెరదించేశారు. సీక్వెల్ ఆలోచన ఉందనే ఫీలర్లూ వదిలారు. రేపటి\nముచ్చటెందుకు కానీ నేటి ముచ్చట్లోకి ఓ సారి చూద్దాం...<br>\n<br>\nఫారెస్ట్ బ్యాక్ డ్రాప్ లో సినిమా షూటింగ్ కోసం ఓ చిత్రయూనిట్ దట్టమైన\nఅడువుల్లోకి అడుగుపెడుతుంది. ఆ టీమ్ లో పది మంది ఉంటారు. టాలీవుడ్ స్టార్\nహీరో శర్మన్ బాబు (గౌతమ్ రూడ్), క్రేజీ హీరోయిన్ ఆషా (ప్రియాంక కొఠారి),\nఅసిస్టెంట్ డైరెక్టర్ సుజన్ (నితిన్), అతని సన్నిహితురాలు సమీరా (రసిక),\nనిర్మాత మూర్తి (ఇష్రత్ అలి), దర్శకుడు జె.జె. (హార్వే), స్పాట్ బాయ్\n(ఇస్తియాక్), యాక్షన్ డైరెక్టర్ రాఖా (రవికాలే), కెమెరామన్ శేఖర్ ఈ టీమ్\nలో ఉంటారు. అడవిలో గైడ్ గా సేతు (జాయ్) అనే వ్యక్తి వీరితో కలుస్తాడు.\nశర్మన్ బాబు తానో పెద్ద హీరో అనే గర్వంతో టీమ్ సభ్యులతో దురుసుగా\nప్రవర్తిస్తుంటాడు. మరోవైపు ఆషాను సుజన్ ప్రేమిస్తుంటాడు. ఒకరోజు అందరూ\nసేతుతో కలిసి డీప్ ఫారెస్ట్ లోకి వెళ్తారు. ఆ రోజు రాత్రి ఆకాశం నుంచి ఏదో\nవస్తువు అడవుల్లోకి జారిపడుతుంది. అది తోకచుక్క కావచ్చని అంతా అనుకుంటారు.\nఏదో కొత్త అరుపు వినిపించడంతో ఆ వివరం కనుక్కునేందుకు వెళ్లిన సేతు శవమై\nతేలుతాడు. దీంతో అందరూ భయంతో వణికి పోతారు. ఆ హత్య చేసింది మనిషా? మృగమా?\nమానవాతీత శక్తా? అనేది మిస్టరీ అవుతోంది. ఆ తర్వాత క్రమంలో నిర్మాత,\nదర్శకుడు, స్పాట్ బాయ్ ఇలా...ఒక్కొక్కరుగా ఆ అజ్ఞాత శక్తి చేతిలో\nహతమవుతారు. చివరకు ఇద్దరే మిగులుతారు. ఆ హత్యలు చేసిన అజ్ఞాత శ(వ్య)క్తి\nఎవరనే మిస్టరీ మాత్రం ఎవరికి తోచింది వారు ఊహించుకోవాల్సిందే. ఎందుకంటే\nవర్మ ముగింపు ఇవ్వలేదు కాబట్టి.</font>', '2009-08-10 13:18:10', 0, 0),
(21, 1, 'వైవిధ్యం కోసం శర్వానంద్ ''ప్రస్థానం''', '', 'వి.ఆర్.సి.మీడియా &amp; ఎంటర్టైన్మెంట్స్ పతాకం పై రూపొందుతున్న చిత్రం\n''ప్రస్థానం''. వెన్నెల చిత్రం ద్వారా పరిచయమైన దర్శకుడు దేవా కట్టా\nరూపొందిస్తున్న ఈ చిత్రం మూడో', 'షెడ్యూల్ ఆగష్టు 16 నుండీ మొదలు కాబోతోంది. గమ్యం చిత్రంతో మంచి విజయాన్ని\nఅందుకొని, రాజు మహారాజు చిత్రంతో ఫ్యామిలీ ఆడియెన్స్ కు కూడూ చేరువైన\nశర్వానంద్ కథానాయకుడుగా నటిస్తున్నారు. వెన్నెల చిత్రంలో శర్వానంద్ ను\nభిన్నమైన కోణంలో చూపించిన దేవా ఈ చిత్రంలో ఎలా చూపించబోతున్నాడన్నది\nఆశక్తికరాంశం. ఇందులో ''డైలాగ్ కింగ్'' సాయి కుమార్ మునుపెన్నడూ చేయనటువంటి\nవైవిధ్యమైన పాత్రను పోషిస్తన్నట్టు తెలిసింది.<br><br> ఈ మధ్యే విడుదల\nచేసిన చిత్రాలకు మంచి స్పందన లభిస్తోంది. ఇందులో శర్వానంద్ డిఫరెంట్ గెటప్\nతో కనిపిస్తున్నారు. యాంగ్రీ యంగ్ మ్యాన్ తరహా పాత్రలో నటిస్తున్నట్టు\nతెలిసింది. ''గాయం'' చిత్రంలో జగపతిబాబు పాత్ర తరహాలో వుంటుందన్న వార్తలు\nవినిపిస్తున్నాయి. ఇందులో శర్వానంద్ కు జోడీగా ఢీల్లీ భామ రూబీ పరిహార్\nకథానాయికగా నటిస్తోంది. త్వరలో విడుదల కాబోతున్న స్నేహగీతం చిత్రంలో\nనటించిన సందీప్ కిషన్ ఓ ముఖ్యభూమికను పోషిస్తున్నారు. ''వెన్నెల'' కిషోర్,\nరవిప్రకాష్, సురేఖా వాణి, జయప్రకాష్ రెడ్డి, జీవా లు ప్రధాన పాక్రలు\nపోషిస్తున్నారు. ''వెన్నెల'' ఫేం మహేష్ శంకర్ చిత్రానికి సంగీతాన్ని\nఅందిస్తున్నారు.', '2009-08-10 16:18:40', 0, 0),
(23, 1, 'ఎన్టీఆర్ మందు కొట్టే..?', '', 'హైదరాబాద్: జూనియర్ ఎన్టీఆర్ కీ ఏక్సిడెంట్ కావటానికి గంటముందు మందు\nపార్టీలో పాల్గొన్నాడంటూ అన్ని ఛానెల్స్ వారు వార్తలు ప్రసారం\nచేస్తున్నారు. ఆ వార్తకు బలం', 'చేకూర్చటానికి ఓ వీడియో క్లింప్పింగ్ ని సైతం ప్రసారం చేస్తున్నారు. దాంతో\nఎన్టీఆర్ ఏక్సిడెంట్ కి కారణం ఫుల్ గా త్రాగి డ్రైవ్ చేయటమేనని మరో వివాదం\nమొదలైంది.తాజాగా ఇంటర్నెట్లో దొరికిన ఓ వీడియో క్లిప్పింగ్ ఆధారంగా టీవీ\nఛానెల్స్ వారు ఈ విధమైన నిర్ధారణకొచ్చారు. సెల్ ఫోన్ లో దొరికిన ఈ\nక్లిప్పింగ్స్ లో ఎన్టీఆర్ రాలిపోయే పువ్వా నీకు రాగాలెందుకే అంటూ జోరుగా\nపాట అందుకున్నారు. అతనితో పాటు రాజీవ్ కనకాల,బబ్లు,రాజా వంటి అతని\nసన్నిహితులు ఉన్నారు. ఈ మందుపార్టీని ఉగాదికి తమ ఇంటికి వెళ్తున్న\nసందర్భంగా ఉషారుగా చేసుకున్నట్లు చెప్తున్నారు.<br><br> అయితే పోలీసులు ఈ\nదిసగా కేసు నమేదు చేయకపోవటం వల్లే దర్యాప్తు జరపలేదని అంటున్నారు. ఇక ఈ\nవీడియో క్లిప్పింగ్ ని కరెక్టే అనేందుకు అంతకుముందు ఏక్సిడెంట్ రోజు చూపిన\nక్లిప్పింగ్స్ చూపుతూ అందులో ఎన్టీఆర్ వేసుకున్న డ్రస్ ని ఈ కొత్త క్లిప్\nలో ఎన్టీఆర్ డ్రస్ తో పోల్చుతున్నారు. రెండు ఒకటే అని నిర్ధారణ చేసి\nఎన్టీఆర్ త్రాగే డ్రైవ్ చేసాడని నిర్ధారణ చేసారు. అంతేగాకుండా సూర్యాపేట\nఎస్సై వివరణ తీసుకుని మరీ ఈ విషయాన్ని ధృవీకరించే ప్రయత్నం చేసారు. అయితే\nఆ వీడియో క్లిప్పింగ్ సెల్ ఫోన్ తో తీసినది కావటం విశేషం. అంతేగాక ఆ\nక్లిప్ లో కనపడుపతున్న పార్టీ ఆ రోజుది కాదని అతని స్నేహితులు\nఖండిస్తున్నారు. ఇక ఇవన్నీ ఇలా ఉంటే రీసెంట్ గా అతని వద్ద గొడవపడి మానేసిన\nమేనేజర్ సుకుమార్ ఈ క్లిప్స్ ని నెట్ లో పెట్టాడని అంతటా వినపడటం విశేషం.', '2009-08-10 16:27:09', 0, 0),
(25, 1, 'అక్టోబర్ 9న తెరపైకి వస్తోన్న "మహాత్మ"', '', 'శ్రీకాంత్, భావన హీరోహీరోయిన్లుగా నటించిన "మహాత్మ" చిత్రాన్ని అక్టోబర్ 9న ', 'శ్రీకాంత్, భావన హీరోహీరోయిన్లుగా నటించిన "మహాత్మ" చిత్రాన్ని అక్టోబర్ 9న విడుదల చేయనున్నారు.<br><br>ఈ సినిమా లోగో ఆవిష్కరణలో చిత్ర దర్శకుడు కృష్ణవంశీ మాట్లాడుతూ.. అక్టోబర్ 2న "మహాత్మ"ను విడుదల చేయాలనుకుంటున్నామని, కానీ ఇంకా ఖరారు కాలేదన్నారు.<br><br>నిర్మాత మనోహర్ మాట్లాడుతూ.. ఇటీవలే మహాత్మ సెన్సార్‌ను పూర్తి చేసుకుంది. కానీ సెన్సార్‌ కొన్ని కట్స్ చెప్పడంతో దాన్ని సరిచేయడం కాస్త టైమ్ పడుతుందని, అందుకే 9న ఈ సినిమాను విడుదలచేయనున్నట్లు వెల్లడించారు.<br><br>ఏది ఏమైనా శ్రీకాంత్ వందో చిత్రం సెన్సేషనల్ హిట్ చేయాలని కృష్ణవంశీ తీవ్రంగా కృషి చేస్తున్నట్లు ఫిలిం నగర్ వర్గాలు చెవులు కొరుక్కుంటున్నాయి.<br><br>ఇంకా ఈ చిత్రంలో మంత్ర, మనోరమ వంటి లేడిఓరియెంటెడ్ చిత్రాల్లో నటించిన ఛార్మి శ్రీకాంత్ సరసన ఓ పాటకు డ్యాన్స్ చేయనుంది. ఈ పాటలో ఛార్మి తన అందచందాలను ఆరబోస్తుందని ఫిలిమ్ నగర్ వర్గాల్లో టాక్.', '2009-10-02 11:18:25', 1, 0),
(26, 1, 'ఆ సెంటిమెంట్ కలిసొస్తుందేమో చూడాలి: నితిన్', '', 'నైజాం డిస్ట్రిబ్యూటర్ సుధాకర్ రెడ్డి కుమారుడిగా "జయం"లో పరిచయం అయిన హీరో', 'నైజాం డిస్ట్రిబ్యూటర్ సుధాకర్ రెడ్డి కుమారుడిగా "జయం"లో పరిచయం అయిన హీరో నితిన్.. తర్వాత కొన్ని చిత్రాల్లో నటించినా పెద్దగా ఫలితంలేకపోయింది. వరుసగా చేసుకుంటూపోతే ఏదోనాడు విజయం దక్కుతుందనే ఆశతో నితిన్ ఉన్నాడు. తాజాగా "రెచ్చిపో" అంటూ ముందుకు వచ్చాడు. ఈ చిత్రం శుక్రవారం విడుదలైంది. ఈ సందర్భంగా నితిన్‌తో కాసేపు..<br><br>ప్రశ్న: విజయాలు రావట్లేదు. "రెచ్చిపో"లో జాగ్రత్తలు తీసుకున్నారా?<br>జ: ఇంతకుముందు వచ్చిన సినిమాల్లో కాస్త కామెడీ, ప్రేమ సన్నివేశాలు తక్కువగా ఉండేవి. ''రెచ్చిపో''లో అన్ని సమపాళ్ళలో ఉంటాయి. పైగా నాతో తొలిసినిమా తీసిన నిర్మాతలంతా బాగున్నారు. ఆ సెంటిమెంట్ కలిసివస్తుందేమో చూడాలి.<br><br>ప్రశ్న: ఇలియానాతో నటించడం ఎలా అనిపించింది?<br>జ: నిజం చెప్పాలంటే.. ''దేవదాసు''కు ముందే ఆమెతో నటించాల్సింది. కానీ అది కొన్ని అనివార్య కారణాల వల్ల చేజారిపోయింది. ఇప్పుడు ఆ ఛాన్సు వచ్చింది.<br><br>ప్రశ్న: ఎందుకోసం రెచ్చిపోతుంటారు?<br>జ: ప్రేమకోసమే. ఇందులో నేను దొంగగా నటిస్తున్నాను. రొటీన్‌కు భిన్నంగా అమ్మాయి మనసు దొంగలిస్తాను. అక్కడనుంచి ఓ పోరాటం మొదలవుతుంది. అదే సినిమా. ఎంటర్‌టైన్‌మెంట్‌గా ఉంటుంది.<br><br>ప్రశ్న: బాడీలాంగ్వేజ్ రీత్యా ఏదో ప్రత్యేకత చూపిస్తారు. ఎందుకని?<br>జ: ఏదైనా కొత్తదనం కావాలి. అందుకే అలా చేస్తున్నాను. 8ప్యాక్ బాడీ వరకు పెంచాను. తర్వాత మామూలుగానే ఉన్నాను. అడవిలో సాదాసీదాగా చేశాను.<br><br>ప్రశ్న: "అడవి" చిత్రం తర్వాత హిందీలో ఆఫర్లు వచ్చాయంటున్నారు. నిజమేనా?<br>జ: అవును. కానీ అడవి-2 కాదు. రంగీలా తరహాలో ఉంటుంది. తర్వాత వెల్ఫేర్ క్రియేషన్‌లో ఓ చిత్రం చేస్తున్నాను.', '2009-10-02 11:22:25', 1, 0),
(27, 1, '<span id="tAH">అన్నమయ్య సకలదేవతార్చన" పాటల ఆల్బమ్ విడుదల</span> <!--@@ArticleSearchStart@@-->       ', '', 'సుప్రసిద్ధ తెలుగు సినిమా పాటల రచయిత కొసరాజు రాఘవయ్య మునిమనుమరాలు', 'సుప్రసిద్ధ తెలుగు సినిమా పాటల రచయిత కొసరాజు రాఘవయ్య మునిమనుమరాలు కొసరాజు నయనతార ఆలపించిన "అన్నమయ్య సకలదేవతార్చన" పాటల ఆల్బమ్ లాంఛనంగా విడుదలైంది. దర్శకుడు కె. రాఘవేంద్రరావు ఆల్బమ్‌ను విడుదలచేసి రామానాయుడుకు అందజేశారు.<br><br>ఈ సందర్భంగా రామానాయుడు మాట్లాడుతూ.. కొసరాజు రాఘవయ్య తనకు మామయ్య అవుతారు. తాను సినిమా తీస్తుంటే దానికి అన్ని విధాల సహాయం చేస్తారని చెప్పారు. మా సినిమాలకు ఆయన రాసిన పాటలు పెద్ద విజయం సంపాదించిపెట్టాయన్నారు. ఆయన మునిమనుమరాలు నయనతారకు గాయనిగా మంచి భవిష్యత్ ఉందని దీవించారు.<br><br>విక్టరీ వెంకటేష్ మాట్లాడుతూ.. ఈ కార్యక్రమంలో పాల్గొనడం ఎంతో ఆనందంగా ఉందన్నారు. దీన్ని తన బిడ్డ కార్యక్రమంగా భావిస్తున్నానని.. ఆ అమ్మాయి పాడుతుంటే దేవుని సన్నిధానంలోనికి తీసుకుని వెళ్ళే విధంగా ఉందన్నారు.', '2009-10-02 11:24:27', 1, 0),
(28, 1, 'అమాయకుడు"గా వస్తోన్న వినాయకుడు <br>', '', 'వినాయకుడు ఫేమ్ కృష్ణుడు హీరోగా భారతీ గణేష్ దర్శకత్వంలో రూపొందుతోన్న ', 'వినాయకుడు ఫేమ్ కృష్ణుడు హీరోగా భారతీ గణేష్ దర్శకత్వంలో రూపొందుతోన్న "అమాయకుడు" చిత్రం క్లైమాక్స్‌తో పాటు ఆరు పాటల చిత్రీకరణ పూర్తయిందని నిర్మాతలు బాలమురుగన్, అనిల్, సుదర్శన్‌లు చెప్పారు.<br><br>ప్రస్తుతం మణికంఠ ఖిద్రి దర్శకత్వంలో వనమాలితో ఆరుపాటల రికార్డింగ్ ప్రారంభించామన్నారు. వచ్చేనెలలో షూటింగ్‌లో పూర్తి చేస్తామని నిర్మాతలు వెల్లడించారు. ఇందులో తమిళసూపర్‌హిట్ "నాడోడిగళ్" ఫేమ్ అనన్య హీరోయిన్‌గా నటిస్తోందని వారు తెలిపారు.<br><br>దర్శకుడు మాట్లాడుతూ.. కృష్ణుడు క్యారెక్టర్‌కు తగిన కథ ఇదని, గత చిత్రాలకంటే ఎంటర్‌టైన్‌మెంట్, సెంటిమెంట్ వంటి అన్ని అంశాలు ఇందులో ఉన్నాయని చెప్పారు. ఇంకా చరణ్, రావురమేష్, గీతాసింగ్ తదితరులు ఇందులో నటిస్తున్నారు.', '2009-10-02 11:27:15', 1, 0),
(29, 2, 'gfhcgh', 'cvcv', 'cvncvbncvbn', 'cvbncvbnbn', '2009-10-29 17:25:58', 0, 0),
(30, 1, 'గుర్తుకొచ్చి వినాయిక్ బాధపడతాడు..ఎన్టీఆర్', '', 'జూ ఎన్టీఆర్, వివి వినాయిక్ కాంబినేషన్లో రెడీ అవుతున్న అదుర్స్ చిత్రం\nఆడియో ', 'జూ ఎన్టీఆర్, వివి వినాయిక్ కాంబినేషన్లో రెడీ అవుతున్న అదుర్స్ చిత్రం\nఆడియో వేడుక ఇటీవలే హైదరాబాద్ లో జరిగింది. ఈ సందర్భంగా ఎన్టీఆర్‌\nమాట్లాడుతూ "ఈ రోజు ఇలా అందరి ముందు నిలబడ్డానంటే కారణం అభిమానుల ఆదరణే. ఏ\nరక్తసంబంధం లేకున్నా గుండెల్లో దాచుకుని అభిమానిస్తున్నారు. అందరికీ\nరుణపడి ఉంటాను. అదుర్స్‌ మొదలై ఏడాదిన్నర అయింది. ఈ విషయం\nగుర్తొచ్చినప్పుడల్లా వినాయక్‌ బాధపడుతుంటాడు. ఎన్నో జాగ్రత్తలు తీసుకుని\nఈ చిత్రాన్ని మలిచారాయన. కోరిక, కసితో మేమిద్దరం చేసిన చిత్రమిది.\nసినిమాకొచ్చిన ప్రతి ఒక్కరినీ రెండున్నర గంటలు రంజింపజేస్తాం. దేవిశ్రీ\nచక్కటి సంగీతం అందించాడు. నాతో ఒక పాట కూడా పాడించాడు. వంశీ, నాని, బుజ్జి\nసహకారం మరవలేనిది. అందరూ అన్నట్టు నాకు రికార్డులు కాదు ముఖ్యం. మీ అందరి\nఅభిమానమే ముఖ్యం" అన్నారు.<br><br> వైష్ణవి ఆర్ట్స్‌ ప్రై.లి. పతాకంపై\nవల్లభనేని వంశీమోహన్‌ ఈ చిత్రాన్ని నిర్మిస్తున్నారు. కొడాలి\nశ్రీవెంకటేశ్వరరావు (నాని) సమర్పకులు. నయనతార, షీలా నాయికలు. దేవిశ్రీ\nప్రసాద్‌ సంగీతం సమకూర్చారు. ''ఆది'' ''సాంబ'' చిత్రాల తర్వాత\nవినాయక్‌-ఎన్టీఆర్‌ కలిసి చేస్తున్న చిత్రమిది. ఈ కార్యక్రమంలో మాగంటి\nబాబు, శ్రీను వైట్ల, బ్రహ్మానందం, అశ్వనీదత్‌, నల్లమలుపు\nశ్రీనివాస్‌(బుజ్జి), దిల్‌ రాజు, మెహర్‌ రమేష్‌, ఛోటా కె.నాయుడు,\nకె.ఎల్‌.నారాయణ, గుణ్ణం గంగరాజు తదితరులు పాల్గొన్నారు. ఆదిత్య మ్యూజిక్‌\nద్వారా పాటలు విడుదలయ్యాయి.', '2009-12-07 13:34:31', 0, 0),
(31, 2, 'విష్ణుకి మనోజ్ కాంపిటీటర్ అవుతాడా?', '', 'మంచు విష్ణు హీరోగా రూపొందిన ‘సలీమ్’ ఈ నెల 11వ తారీఖున ప్రేక్షకుల\nముందుకు ', 'మంచు విష్ణు హీరోగా రూపొందిన ‘సలీమ్’ ఈ నెల 11వ తారీఖున ప్రేక్షకుల\nముందుకు వస్తోంది. అలాగే మంచు మనోజ్ హీరోగా రూపొందిన ‘బిందాస్’ కూడా ఈ\nనెలలోనే ప్రేక్షకుల ముందుకు వస్తోంది. మీ తమ్ముడు మీకు కాంపిటీటర్\nఅవుతాడనుకుంటున్నారా అని విష్ణు దగ్గర అడిగితే - ‘ మా ఇద్దరి మధ్య పోటీ\nలేదు. నేను, మనోజ్ మంచి స్నేహితుల్లా ఉంటాం. అంతే కానీ పోటీ పడే మనస్తత్వం\nమా ఇద్దరికి లేదు. కానీ నటుడిగా నాకంటే మనోజ్ బాగా చేస్తాడనీ నా ఫీలింగ్.\nసో నటన విషయంలో మా ఇద్దరి మధ్య సోటి ఉంటుంది. ఈ విషయంలో నా కాంపిటీటర్\nమనోజ్నే అని చెప్పాడు', '2009-12-08 10:16:51', 0, 0),
(32, 3, 'ఆర్య 2 ', '', 'అల్లు అర్జున్, సుకుమార్ కాంబినేషన్లో వచ్చిన ఆర్య-2 చిత్రం ఫస్ట్ వీక్\nకలెక్షన్స్ ', 'అల్లు అర్జున్, సుకుమార్ కాంబినేషన్లో వచ్చిన ఆర్య-2 చిత్రం ఫస్ట్ వీక్\nకలెక్షన్స్ పదహారు కోట్లు అని వినపడుతోంది. నైజాంలో 4.10 కోట్లు, వైజాగ్\nలో 1 కోటి, గుంటూరులో ఎనభై లక్షలు..ఇలా లెక్కలు చెప్తున్నారు. తెలంగాణ\nబంద్ వల్ల ఈ రెండు రోజుల్లో నైజాం ఏరియాలో బాగా నష్టపోయనట్లేనని\nఅంటున్నారు. అప్పటికీ బన్నీకి నైజాంలో మంచి పట్టు ఉండటంతో ప్లస్ అయిందని\nఅంటున్నారు. నైజాం ఏరియాకి ఈ చిత్రం పంపిణీదారుడు దిల్ రాజు. ఇక ఈ లెక్కలు\nకరెక్టు కాదని, కావాలనే వీటిని ప్రచారంలోకి తీసుకువస్తున్నారని మరో వర్గం\nవాదిస్తోంది. సినిమా హిట్,ఫ్లాఫ్ లకు సంభందం లేకుండా ఈ చిత్రం మంచి\nఓపినింగ్స్ మాత్రం తెచ్చుకుందనేది మాత్రం నిజం. సిటీల్లో ఈ చిత్రం హవా\nపూర్తిగా తగ్గినా బి,సి సెంటర్లలో ఫరవాలేదనిపించుకుంటోందని ట్రేడ్\nవిశ్లేషకులు చెప్తున్నారు. అల్లు అర్జున్,సుకుమార్ కాంబినేషన్లో వచ్చిన\nఆర్య కి సీక్వెల్ కావటం ఈ చిత్రానికి కొంతలో కొంత ప్లస్ అయింది. ఇక ఈ\nచిత్రానికి ప్రమేషన్ మాత్రం అల్లు అర్జున్ భారీ ఎత్తున చేపడుతున్నాడు.\nటీవీ ఛానెల్స్ కు తరుచూ వెళ్ళి ఈ చిత్రాన్ని ప్రమోట్ చేస్తున్నాడు.', '2009-12-08 10:20:40', 0, 0),
(42, 3, 'వాడే కావాలి', '', 'ఆపరేషన్ సక్సెస్..పేషెంట్ డెడ్ అన్న పరిస్ధితి వాడే కావాలి ఎదుర్కొంటోంది.\nఎప్పుడో ', '-జోశ్యుల సూర్య ప్రకాష్<br> బ్యానర్: సద్గురు సినిమా<br> నటీనటులు: సాయిరామ్ శంకర్, సుహాని, హేమ, వేణుమాధవ్,<br> రఘుబాబు, నరేష్, రవి ప్రకాష్, తదితరులు..<br> కెమెరా: కళ్యాణ సామి<br> ఎడిటింగ్: కె.వి.కృష్ణారెడ్డి<br> నిర్మాత: రఘునాధ్ సోగి, కాసాని వీరేష్ బాబు<br> కథ,మాటలు: ప్రకాష్.టి<br> స్క్రీన్ ప్లే,దర్శకత్వం: రాజేంద్ర దర్శన్<br> రిలీజ్ తేది: డిసెంబర్ 11,2009<br><br>\nఆపరేషన్ సక్సెస్..పేషెంట్ డెడ్ అన్న పరిస్ధితి వాడే కావాలి ఎదుర్కొంటోంది.\nఎప్పుడో రెండున్నర ఏళ్ళ క్రిందట పూర్తయిన ఈ చిత్రం ఇన్నాళ్ళకు రిలీజ్ అవటం\nఆనందపరిచే విషయం అయితే రిలీజైన మార్నింగ్ షో కే ఫెయిల్యూర్ టాక్\nతెచ్చుకోవటం విచారకరం. అలాగే అప్పట్లో రిలీజైన\nఉల్లాసంగా..ఉత్సాహంగా(కరుణాకరన్) చిత్రం కథను పూర్తి స్ధాయిలో పోలివుండటం\nమరో మైనస్. అలా తెలిసున్న కథకు, నీరసమైన స్క్రీన్ ప్లే జతచేసి అంతకన్నా\nదారుణమైన దర్శకత్వం చేసి వదిలిన ఈ చిత్రం ఏం ఆశించి తీసారో రూపకర్తలుకే\nతెలియాలి.', '2009-12-15 17:50:51', 0, 2),
(33, 3, 'ప్రవరాఖ్యుడు', '', '<font class="UnicodeContent">''ప్రవరాఖ్యుడు'' గురించి తెలియని టీనేజర్స్\nఉండకపోవచ్చు. ఈ పదాన్ని పలకడం </font>', '<font class="UnicodeContent">''ప్రవరాఖ్యుడు'' గురించి తెలియని టీనేజర్స్\nఉండకపోవచ్చు. ఈ పదాన్ని పలకడం ఇబ్బందిగా అనిపించిన వాళ్లు ''ప్రవరాక్షసుడు''\nకూడా అంటుంటారు. అమ్మాయిల పేరు చెబితేనే ఆమడదూరం పారిపోయే కుర్రాళ్లను\n''ప్రవరాఖ్యుడు'' అనే నిక్ నేమ్ తో అమ్మాయిలు టీజ్ చేస్తుంటారు. ఓరకంగా\nచెప్పాలంటే తాను ప్రేమించకుండానే అమ్మాయిలను ఆకర్షించే వ్యక్తని కూడా\nచెప్పుకోవచ్చు. అలాంటి ఆధునిక ప్రవరాఖ్యుడు, స్వతంత్ర భావాలున్న వరూధిని\nక్యారెక్టర్లతో దర్శకుడు మదన్ ''ప్రవరాఖ్యుడు'' చిత్రాన్ని ప్రేక్షకుల\nముందుకు తెచ్చారు. ఫ్యామిలీ ఆడియెన్స్ లో, ముఖ్యంగా గృహిణులు, పెళ్లైన\nవర్కింగ్ లేడీస్ లో జగపతిబాబుకు ఉన్న ఫాలోయింగ్...ప్రియమణితో ఆయన\nకాంబినేషన్ కు ''పెళ్లైన కొత్తలో'' చిత్రంతో వచ్చిన క్రేజ్ ను దృష్టిలో\nపెట్టుకుని మదన్ చేసిన మరో ప్రయత్నమిది. జగపతిబాబు ఛార్మ్ ఇప్పుడు కాలేజీ\nగాళ్స్ కు కూడా విస్తరిస్తుందా అనేది టైటిల్ అనౌన్స్ మెంట్ నుంచి అందర్నీ\nఆసక్తిగా ఎదురుచూసేలా చేసింది. మదన్ తీసిన ''పెళ్లైన కొత్తలో'' చిత్రానికి\nఅమెరికా డిస్ట్రిబ్యూటర్లుగా వ్యవహరించిన ''టాలీ 2 హాలీ'' సంస్థ\nజగపతి-ప్రియమణి-మదన్ త్రయంతోనే సొంతంగా ''ప్రవరాఖ్యుడు'' చిత్రాన్ని\nనిర్మించడం కూడా క్యూరియాసిటీని పెంచింది. ఫ్యామిలీ అడియెన్స్ థియేటర్లకు\nరావడం మానేశారని అలిగి పక్కా మాస్ చిత్రాల వైపు మళ్లిన జగపతిబాబు మళ్లీ తన\nఫేవరెట్ ఫ్యామిలీ ఆడియెన్స్ కు, కొత్తగా టీనేజ్ గాళ్స్ కు చేరువయ్యేందుకు\nచేసిన ఈ ప్రయత్నం ఎలా సాగిందో చూద్దాం...</font>', '2009-12-08 10:26:56', 0, 8);
INSERT INTO `cinema` (`id`, `type`, `heading`, `eng_heading`, `summary`, `description`, `insert_date`, `active`, `views`) VALUES
(34, 5, 'నా భర్తతో విడిపోలేదుః ఆర్తి', '', '<font class="UnicodeContent">''నీలవేణి'' చిత్రంతో సెకెండ్ ఇన్నింగ్స్\nప్రారంభించిన అందాల నటి ఆర్తి అగర్వాల్ లో </font>', '<font class="UnicodeContent">''నీలవేణి'' చిత్రంతో సెకెండ్ ఇన్నింగ్స్\nప్రారంభించిన అందాల నటి ఆర్తి అగర్వాల్ లో ఇప్పుడు మునుపటి కంటే\nఆత్మవిశ్వాసం తొణికిసలాడుతోంది. తనపై గతంలో వచ్చిన వదంతులతో పాటు తాజా\nవదంతులకు సైతం ఆర్తి ఓ ఇంటర్వ్యూలో వివరణ ఇచ్చింది. ఉజ్వల్ తో తన వైవిహిక\nసంబంధంలో విభేదాలు వచ్చిన విషయంలో ఎంత మాత్రం నిజం లేదనీ, హీరో తరుణ్ ను\nఆయన పబ్ లో ఇటీవల కలుసుకున్నానంటూ వచ్చిన వార్తలు కూడా నిరాధారమనీ, ఆ\nమాటకొస్తే తరుణ్ పబ్ ఎక్కడుందో కూడా తనకు తెలియదనీ స్పష్టం చేసింది.<br>\n<br>\n''నా కెరీర్ మొదట్నించీ ఎన్నో పుకార్లు చూశాను. ఒకరోజు ఫుడ్ పాయిజన్ అయితే\nనేను గర్భవతినంటూ ప్రచారం చేశారు. నా సోదరుడితో కలిసి వెళ్తే కొత్త బాయ్\nఫ్రెండ్ అంటూ పుకార్లు పుట్టించారు. కాలుజారి పడితే ఆత్మహత్యాయత్నం\nచేసినట్టు ప్రచారం జరిగింది. ఇలాంటి పుకార్లు అప్పట్లో కొంత మేర బాధించిన\nమాట నిజమే. ఇక నుంచి వాటిని ఖాతర చేసేది లేదు. ఇప్పుడు వృత్తికి, కుటుంబ\nసభ్యులకే నేను పరిమితం'' అంటూ ఆర్తి చెప్పుకొచ్చింది. తనకు ప్రమాదం\nజరిగినప్పటి నుంచి ఈరోజు వరకూ తరుణ్ తో తాను టచ్ లో లేననీ, అతని పబ్\nఎక్కడుందో కూడా తనకు తెలియదనీ పేర్కొంది. ఉజ్వల్ తో తన వైవాహిక బంధం\nచిక్కులో పడినట్టు వస్తున్న వదంతుల్లోనూ నిజం లేదని తేల్చిచెప్పింది. ''నటన\nఅంటే నాకు చాలా ఇష్టం. జీవితంలో ఒడిదుడుకులు ఎదుర్కొంటున్న తరుణంలో నేనూ,\nఉజ్వల్ నెట్ ద్వారా కలిసాం. వెంటనే వివాహం చేసుకోవాలని నిశ్చయించుకున్నాం.\nనిజం చెప్పాల్సి వస్తే మేమిద్దరం ఇంకా ఒకర్ని ఒకరు పూర్తిగా అర్ధం\nచేసుకోలేదనే చెప్పాలి. సినిమాలకు స్వస్వి చెప్పాలని ఉజ్వల్ కోరుతున్నాడు.\nఅందుకు నేను సిద్ధంగా లేను. దాంతో ప్రస్తుతం కెరీర్ మీదే దృష్టి పెట్టాలని\nఎవరికి వారు నిశ్చయించుకున్నాం. ఇద్దరం ఒకరి అభిమతాన్ని మరొకరు అర్థం\nచేసుకోవడానికి మరి కొంత కాలం పట్టొచ్చు. అప్పుడు కలిసే ఉంటాం. అలా కాని\nపక్షంలో దూరంగా ఉంటాం. ప్రస్తుతానికైతే మేమిద్దరం మంచి మిత్రులం'' అంటూ\nఆర్తి వివరణ ఇచ్చింది. ప్రస్తుతం ''నీలవేణి''చిత్రంతో పాటు పోసాని\nకృష్ణమురళితో మరో చిత్రంలో ఆర్తి నటిస్తోంది. ఒక చిత్రంలో ఆర్తికి తండ్రి\nపాత్రలో శశాంక్ అగర్వాల్ (ఆర్తి తండ్రి) నటిస్తుండటం విశేషం.</font><br>', '2009-12-08 10:29:42', 0, 0),
(35, 6, 'వంశీ కొత్త సినిమా టైటిల్ ఏమిటంటే...', '', 'గోపి..గోపిక..గోదావరి చిత్రంతో మళ్ళీ తానేంటో ప్రూవ్ చేసుకున్న వంశీ\nత్వరలో తీయబోయే ', 'గోపి..గోపిక..గోదావరి చిత్రంతో మళ్ళీ తానేంటో ప్రూవ్ చేసుకున్న వంశీ\nత్వరలో తీయబోయే చిత్రానికి ఆయ్..మాది రాజమండ్రి అనే టైటిల్ ని పెట్టినట్లు\nసమాచారం. ఈ చిత్రం కథా చర్చలు ప్రస్తుతం తీవ్ర స్ధాయిలో జరుగుతున్నాయి.\nపూర్తి తూర్పు గోదావరి శ్లాంగ్ తో ఈ చిత్రం డైలాగులు రాయిస్తున్నారని\nతెలుస్తోంది. ఇక ఈ చిత్రంలో హీరో ఎవరన్నదీ తేలలదు. అల్లరి నరేష్ తో ఆయన\nరూపొందించనున్న లేడీస్ టైలర్ సీక్వెల్ బదులుగా ఈ చిత్రాన్ని తెరకెక్కించే\nఅవకాశం ఉందని అంటున్నారు. అలాగే మహర్షి బ్యానర్ పై వల్లూరి పల్లి రమేష్ ఈ\nచిత్రాన్ని తీయనున్నారు. గోపీ..గోపిక..గోదావరి టైటిల్ తో జనాల్ని\nఆకట్టుకుని హిట్ చేసుకున్న ఉత్సాహంతో ఈ చిత్రంపై దృష్టి పెట్టారని\nచెప్తున్నారు. అలాగే పశలపూడి కధలు(వంశీ రాసినవి) కొన్ని తీసుకుని ఇందులో\nసీన్స్ క్రింద మారుస్తున్నారని సమాచారం.', '2009-12-08 10:31:59', 0, 0),
(36, 1, 'అజయ్ ..సారాయి వీర్రాజు చిత్రం ఏమైంది?', '', 'అజయ్ హీరోగా డి.యన్.కన్నన్ రూపొందించిన ''సారాయి వీర్రాజు'' ఫెయిల్యూర్ టాక్', 'అజయ్ హీరోగా డి.యన్.కన్నన్ రూపొందించిన ''సారాయి వీర్రాజు'' ఫెయిల్యూర్ టాక్\nతెచ్చుకుంది. తమిళ వాసనలు బాగా ఉండటం, సరైన స్క్రీన్ ప్లే రాసుకోలేకపోవటం\nఈ చిత్రానికి మైనస్ లుగా చెప్తున్నారు. కథలో సారాయి వీర్రాజు(అజయ్)\nఅమాయికత్వంలో ఓ నలుగురు (విలన్స్)చెప్పిన మాటలు నమ్మి ఊరందరి చేతా వారి\nనెట్ వర్క్ బిజినెస్ లో డబ్బులు కట్టిస్తాడు. ఆ తర్వాత వారు ఆ డబ్బులు\nపట్టుకుని గ్రామ ప్రజలను మోసం చేసి జంప్ అయ్యే ప్రయత్నాల్లో ఉంటారు. అది\nగమనించిన వీర్రాజు ప్రేయసి ధనలక్ష్మి(రమ్య)నిలదీస్తుంది. దాంతో వారు ఆమెను\nగ్యాంగ్ రేప్ చేస్తారు. అయితే ఆ సమయంలో అజయ్ త్రాగి పడిపోయి ఉంటాడు. లేచి\nజరిగిన ఘోరం తెలుసుకుని వారిపై పగ తీర్చుకోవటానికి ప్రయత్నాలు\nప్రారంభిస్తాడు. ఈలోగా వారు దుబాయ్ పారిపోతారు. వారిని పట్టుకుని ఎలా తన\nపగ తీర్చుకున్నాడనేదే మిగతా కథ. ఇక ఈ చిత్రం కథ ప్లాష్ బ్యాక్ లో\nవస్తుంది. అప్పటి వరకూ సారాయి వీర్రాజు గా అజయ్ చేష్టలు ఫస్టాఫ్ లో\nవస్తాయి. ఇక చిత్రం కథాంశంలో మన నేటివిటీ తక్కువ అవటం సన్నివేశాలు మరీ\nమోటుగా అల్లటం ప్రేక్షకులుకు సహన పరీక్ష పెడుతోందంటున్నారు.', '2009-12-08 10:36:19', 0, 0),
(37, 4, 'వరుణ్ సందేశ్ మరో చరిత్ర లేటెస్ట్ ఇన్ఫో', '', 'కమల్ హాసన్ మరో చరిత్ర చిత్రాన్ని దిల్ రాజు రీమేక్ చేస్తున్న సంగతి\nతెలిసిందే. ', 'కమల్ హాసన్ మరో చరిత్ర చిత్రాన్ని దిల్ రాజు రీమేక్ చేస్తున్న సంగతి\nతెలిసిందే. వరుణ్ సందేశ్ లీడ్ రోల్ లో చేస్తున్న ఈ చిత్రం ఆడియో డిసెంబర్\nపదవ తేదీన రిలీజ్ చేస్తున్నారు. అమెరికాలోని వివిధ లొకేషన్స్ లో ఈ\nచిత్రాన్ని షూట్ చేస్తున్నారు. రవి యాదవ్ డైరక్ట్ చేస్తున్న ఈ చిత్రంలో\nహీరోయిన్ ఇంగ్లీష్,తెలుగు కలిపి మాట్లాడుతూంటుంది. మిక్కీ.జె.మేయర్\nసంగీతాన్నీ అందిస్తున్నారు. వరుణ్ సందేశ్ హీరోగా చేసిన కుర్రాడు చిత్రం\n(పొల్లదవాన్ రీమేక్) భాక్సాఫీస్ వద్ద ఫెయిల్యూర్ అయింది. అలాగే దిల్ రాజు\nనిర్మించిన జోష్ కూడా డిజాస్టర్ అయింది. దాంతో ఈ చిత్రాన్ని ఎలా అయినా\nహిట్ కొట్టాలనే పట్టుదలతో వర్క్ చేస్తున్నట్లు చెప్తున్నారు. ఇక\nదర్శకుడుగా పరిచయమవుతున్న రవి గతంలో పలు బాలీవుడ్ చిత్రాలకు కెమెరా\nఅందించారు. వాటిలో ముఖ్యంగా ఐత్ రాజ్,సోఛాలతా, నఖీభ్, 36 చైనా టౌన్, రేస్\nచిత్రాలు మంచి పేరు తెచ్చిపెట్టాయి. దాంతో ఈ చిత్రం కూడా విజువల్ గా మంచి\nస్టాండర్డ్స్ తో ఉంటుందని ఆశిస్తున్నారు.', '2009-12-08 10:38:25', 0, 7),
(38, 1, 'కోలీవుడ్‌లో బొమ్మాళీకి ఛాన్సులే.. ఛాన్సులు..', '', 'టాలీవుడ్\nప్రేక్షకులను తన అందచందాలతో కట్టిపడేసి అగ్రహీరోయిన్‌గా ', 'టాలీవుడ్\nప్రేక్షకులను తన అందచందాలతో కట్టిపడేసి అగ్రహీరోయిన్‌గా ముద్రవేసుకున్న\nయోగా టీచర్, బొమ్మాళీ అనుష్కకు కోలీవుడ్‌లో మంచి ఛాన్సులు వస్తున్నాయట.\n"ఇరండు" (తెలుగులో రెండు) చిత్రం ద్వారా కోలీవుడ్ రంగ ప్రవేశం చేసిన\nఅనుష్కకు.. "అరుంధతి" (తమిళ డబ్బింగ్) ద్వారా మంచి గుర్తింపు లభించింది. <br><br>ఈ\nనేపథ్యంలో కోలీవుడ్‌లో అగ్రహీరోయిన్లు మేమేనని విర్రవీగుతోన్న నయనతార,\nత్రిష, శ్రేయలకు అనుష్క కోలీవుడ్ ప్రవేశం షాక్ ఇచ్చిందని సినీ జనం\nగుసగుసలాడుకుంటున్నారు. తమిళంలో పెద్ద హీరో నుంచి యంగ్ హీరో వరకు నటించే\nఅవకాశాలు ఎక్కువ శాతం నయనతారకే వస్తుండేవి. ఈమెకు తర్వాత తెల్లపిల్ల\nహ్యాపీడేస్ ఫేమ్ తమన్నా ఆ ఛాన్సులను కొట్టేసింది.<br><br>అయితే\nఈ తెల్లపిల్లకు కూడా ఈ మధ్య ఛాన్సులు అంతగా రావట్లేదని తెలిసింది. అసలు\nకారణమేమిటని ఆరాతీస్తే..? అనుష్క వెంట కోలీవుడ్ నిర్మాతలు కాల్షీట్ కోసం\nపడిగాపులు కాస్తున్నారని సమాచారం. ప్రస్తుతం కోలీవుడ్ హీరో విజయ్ సరసన\n"వేట్టైక్కారన్" అనే చిత్రంలో నటించిన అనుష్క.. ఇందులో డాక్టర్ పాత్రను\nపోషిస్తోంది. <br><br>అంతేగాకుండా..\nఎక్స్‌పోజింగ్, గ్లామర్‌కు పెద్దపీట వేసి కోలీవుడ్ ప్రేక్షకులను కూడా\nఆకట్టుకుంటోంది. ఈ సినిమా ఈ వారంలోనే తెరపైకి రానుంది. అరుంధతితోనే\nబొమ్మాళీకి కోలీవుడ్ మహిళా అభిమానులు ఎక్కువైన నేపథ్యంలో.. వేట్టైక్కారన్\nచిత్రం ద్వారా మాస్ ప్రేక్షకులను కూడా ఆకట్టుకుంటోంది. <br><br>ఈ\nసినిమా పాటలకే మాస్ ప్రేక్షకుల నుంచి మంచి క్రేజ్ వచ్చిందని, తప్పకుండా\nఅనుష్క నటించే ఈ సినిమా కూడా సూపర్ హిట్ అవుతుందని కోలీవుడ్ సినీ పండితులు\nజోస్యం చెబుతున్నారు. <br><br>ఇంకా..\nఅనుష్కకు కోలీవుడ్ ప్రేక్షకులు, సినీ వాతావరణం ఎంతో నచ్చేసిందని\nసన్నిహితులతో కూడా చెప్పిందట. ఇంకేముంది..? కోలీవుడ్‌లోనూ అనుష్క తన హవాను\nకొనసాగించడం ఖాయమన్నమాట..!', '2009-12-14 12:42:53', 1, 0),
(39, 1, '"మల్లీశ్వరి" కత్రినా ఆరోగ్యంపై ఆందోళన', '', 'ఆమధ్య పసికర్ల\nవ్యాధితో కత్రినా బాధపడుతున్నట్లు వార్తలు వచ్చాయి. ఆ తర్వాత', 'ఆమధ్య పసికర్ల\nవ్యాధితో కత్రినా బాధపడుతున్నట్లు వార్తలు వచ్చాయి. ఆ తర్వాత వ్యాధి\nతగ్గిపోయిందని వైద్యులు చెప్పారు. కానీ ఆదివారం కత్రినాకైఫ్ ఉన్నట్లుండి\nకళ్లు తిరిగి కిందపడిపోయిందట. దాంతో మరోసారి ఆమెను ముంబయిలోని సబర్బన్\nఆసుపత్రికి తీసుక వెళ్లారు.<br><br>అక్కడ\nఆమెకు ఆదివారం అంతా చేయాల్సిన పరీక్షలన్నిటినీ చేశారు వైద్యులు. ఆ\nపరీక్షల్లో కత్రినా హిమోగ్లోబిన్ కౌంట్ గణనీయంగా తగ్గుతున్నట్లు వైద్యులు\nకనుగొన్నారు. అయితే హిమోగ్లోబిన్ ఇలా తగ్గిపోవడానికి కారణమేమిటన్నది\nమాత్రం వారు వెల్లడించలేదు. <br><br>రక్తంలో\nఅసాధారణ మార్పుల వెనుక ఉన్న అసలు కారణాలను కనుగొనేందుకు తమకు సమయం కావాలని\nవారు చెపుతున్నారు. అప్పటివరకూ కత్రినా పూర్తి విశ్రాంతి తీసుకోవాలని\nసూచించారు. దీంతో కత్రినా కైఫ్‌కు అనేక ప్రాంతాల నుంచి ఫోన్లు చేసి ఆమె\nఆరోగ్యంపై వాకబు చేస్తున్నారు. కత్రినా మాత్రం తనకు కాస్త నీరసంగా ఉందనీ,\nఅంతకుమించి మరేమీ లేదని చెపుతోందట.', '2009-12-14 17:24:07', 0, 0),
(40, 1, 'నాగార్జునని సత్కరించిన గ్రీకు ప్రభుత్వం', '', 'గ్రీకువీరుడు\nనాగార్జున కామాక్షి కళామూవీస్ పతాకంపై అగ్రనిర్మాత డి.శివప్రసాదరెడ్డి', 'గ్రీకువీరుడు\nనాగార్జున కామాక్షి కళామూవీస్ పతాకంపై అగ్రనిర్మాత డి.శివప్రసాదరెడ్డి\nకిరణ్ దర్శకత్వంలో నిర్మిస్తున్న భారీ చిత్రం "కేడి" షూటింగ్ కోసం గ్రీస్\nవెళ్లారు. గ్రీస్‌కు వచ్చిన గ్రీకువీరుడు నాగార్జునకు గ్రీక్ ప్రభుత్వం,\nమిలోస్ ఐలాండ్ ప్రతినిధులు, ప్రెస్ మీడియా గ్రాండ్ వెల్‌కమ్ చెప్పి ఘనంగా\nసత్కరించింది. <br><br>ఈ\nసందర్భంగా మిలోస్ ఐలాండ్‌లో జరిగిన సత్కార సభలో గ్రీక్ ప్రభుత్వ\nప్రతినిధులు మాట్లాడుతూ.. నాగార్జునగారి రాక గ్రీక్ టూరిజం\nడిపార్ట్‌మెంట్‌కి గ్రేట్ డే‌గా భావిస్తున్నాం. నాగార్జునగారిని\nసత్కరించుకోవడం మా అదృష్టం. ఈ అవకాశాన్ని మాకిచ్చిన కామాక్షి కళా మూవీస్,\nఅన్నపూర్ణ స్టూడియోస్ టీమ్‌కి మా ధన్యవాదాలు తెలుపుతున్నాం. మళ్లీ మళ్లీ\nగ్రీకువీరుడు నాగార్జున మా గ్రీస్‌కు రావాలని కోరుకుంటున్నాం అన్నారు.<br><br>నాగార్జున\nమాట్లాడుతూ... గ్రీస్‌లో షూటింగ్ చెయ్యడం హ్యాపీగా ఉంది. అన్నివిధాలా\nసహకారాన్ని అందిస్తున్న గ్రీస్ ప్రభుత్వానికి, గ్రీక్ టూరిజం\nడిపార్ట్‌మెంట్‌కు థ్యాంక్స్ అన్నారు. కాగా కింగ్ నాగార్జున, మమతా మోహన్\nదాస్‌లపై కేడి కోసం గ్రీస్‌లో పాట చిత్రీకరిస్తున్నారు. డిసెంబరు 11 వరకూ\nగ్రీస్‌లో ఈ షూటింగ్ కొనసాగుతుందని నిర్మాత తెలిపారు. ', '2009-12-14 17:38:09', 0, 1),
(41, 3, 'సలీం రివ్యూ', '', 'హీరో ఒకమ్మాయిని ప్రేమిస్తాడు..కానీ ఆ అమ్మాయి వేరే కుర్రాడుని\nప్రేమిస్తుంది.', '-జోశ్యుల సూర్య ప్రకాష్<br> సంస్థ: శ్రీలక్ష్మీప్రసన్న పిక్చర్స్‌-రిలయన్స్‌ బిగ్‌ పిక్చర్స్‌<br> నటీనటులు: విష్ణువర్ధన్‌ బాబు, ఇలియానా, మోహన్‌ బాబు, కావేరీ ఝా, వెంకట్‌,<br> నెపోలియన్‌, గిరిబాబు, అలీ, జయప్రకాష్‌ రెడ్డి, ప్రగతి, హేమ తదితరులు.<br> డైలాగులు: చింతపల్లి రమణ<br> స్టోరీ డవలప్ మెంట్: గోపీ మోహన్, బివియస్ రవి<br> ఆర్ట్: ఆనంద సాయి<br> కెమెరా: సి.రామ్ ప్రసాద్<br> ఎడిటింగ్: కోటగిరి వెంకటేశ్వరరావు<br> సంగీతం: సందీప్‌ చౌతా<br> నిర్మాత: మోహన్‌బాబు<br> కథ, స్క్రీన్ ప్లే, దర్శకత్వం: వైవీఎస్‌ చౌదరి<br> రిలీజ్ డేట్: డిసెంబర్ 12,2009<br><br>\nహీరో ఒకమ్మాయిని ప్రేమిస్తాడు..కానీ ఆ అమ్మాయి వేరే కుర్రాడుని\nప్రేమిస్తుంది..అయినా మన హీరో డ్రాప్ అవక నా ప్రేమ గొడవ నాదే..నీది నీదే\nఅని ఆమె వెంటబడి తిరిగి చివరకి ఆమె ప్రేమించిన వాడు సరైన వాడు కాదని\nడిసైడ్ అయ్యి తిరిగి వచ్చే దాకా కధ నడుపుతాడు. ఆర్య నుంచి ఆర్య-2 దాకా\nఇంకా గట్టిగా చెప్పాలంటే నిన్న రిలీజైన వాడే కావాలి వరకూ ఇలాంటి కథలు\nకోకొల్లలు. తాజాగా అదే ఫార్మేట్ లో వచ్చిన మరో చిత్రం సలీం. అయితే కథ\nతెలిసున్నదే కదా కథనంలో ట్విస్టులు పెడదామనే ఉత్సాహం కొద్దీ పూర్తి\nస్ధాయిలో గ్రిప్ కోల్పోయి బోల్తా పడ్డారు. వైవియస్ చౌదరి గత చిత్రం ఒక్క\nమగాడుకు పోటీగా తయారై రిలీజైంది. ఇక కొద్దోగొప్పో చివరి వరకూ జనం\nభరించారంటే ఆ క్రెడిట్ ఇలియానాదే అని చెప్పాలి. ఆమె అందచందాలు చూపటమే\nలక్ష్యమన్నట్లు చాలా చోట్ల సాగింది.', '2009-12-15 10:39:36', 0, 0),
(43, 3, 'అమరావతి', '', '<font style="padding: 2px;"><span style="font-weight: bold; color: #990066;">క్రియేటివ్</span>\nడైరెక్టర్ అనే పదం తరచు వినిపిస్తుంటుంది. నిజానికి కొత్త ప్రక్రియ\nగురించి </font>', '<font style="padding: 2px;"><span style="font-weight: bold; color: #990066;">క్రియేటివ్</span>\nడైరెక్టర్ అనే పదం తరచు వినిపిస్తుంటుంది. నిజానికి కొత్త ప్రక్రియ\nగురించి చెప్పినప్పుడో, అడ్వాన్స్ థాట్స్ తో సినిమాలు తీయగలిగినప్పుడో ఆ\nపదాన్ని వర్తింపజేయాలి. ఇలాంటి అడ్వాన్స్ థాట్స్ తో సినిమాలు తీసినప్పుడు\nఆ చిత్రాలు ప్రేక్షకాదరణ పొందిన సందర్భాలు కూడా ఎక్కువే. దర్శకుడు అల్లరి\nరవిబాబు ఆ దిశగా ఇప్పటికే కొన్ని అడుగులు వేశారు. ప్రేణాధికంగా ప్రేమించిన\nఅమ్మాయి చనిపోతే ఆమె అంతకుముందే ''డొనేట్'' చేసిన శరీర భాగాలు ఆ తర్వాత\nఎవరెవరికి అమర్చారో వారందర్నీ చంపి వాటిని కలెక్ట్ చేసే ఓ సైకో లవర్\nకథాంశంతో తీసిన ''అనసూయ'' ప్రేక్షకులను థ్రిల్ చేసింది. ఇంతవరకూ ఎవరూ టచ్\nచేయని సబ్జెక్ట్ కావడం ఇందుకు ఓ కారణం. రవిబాబు ఇప్పుడు కూడా ఈ తరహా\nలైన్స్ లోనే ఇంతవరకూ తెలుగులో ఎవరూ టచ్ చేయని థ్రిల్లర్ జనర్ సబ్జెక్ట్ తో\n''అమరావతి'' చిత్రాన్ని తెరకెక్కించారు. గర్భాశయం అద్దెకు ఇచ్చే తల్లులు\n(సర్రొగేట్ ఉమన్) గురించి అందరికీ అంత పరిజ్ఞానం ఉండకపోవచ్చు.\nహిప్నోసిస్...గురించి కొంత పరిజ్ఞానం ఉన్నవాళ్లలో కూడా ఏవో అనుమానాలు\nసహజం. ఈ రెండు అంశాలను కీలకంగా తీసుకుని కథను అల్లుకోవడంలోనే రవిబాబు\nచతురత కనిపిస్తుంది. ఏదో కొత్త సబ్జెక్ట్ డీల్ చేశాడనే క్యూరియాసిటీని\nప్రేక్షకులలో కలిగిస్తుంది. అయితే షరామామూలుగా రవిబాబు మార్క్\n''రక్తపాతాల''కూ సినిమాలో కొదవలేదు. ముందు జాగ్రత్తగా సెన్సార్ ''ఎ''\nసర్టిఫికెట్ ఇవ్వడంతో ''గర్భణీ స్త్రీలు, హార్ట్ ట్రబుల్ ఉన్న వాళ్లు ఈ\nసినిమా చూడొద్దు'' అనే టైటిల్ కార్డు, పాత్రలన్నీ కల్పితాలేనంటూ మరో కార్డు\nవేసి కథాగ్రమంలోకి వెళ్లారు. ఆ ముచ్చట్లలోకి వెళితే...</font>', '2009-12-15 17:58:18', 0, 5),
(44, 2, 'రాబోయే కాలానికి కాబోయే మెగస్టార్ ‘నితిన్’..?', '', 'రాష్ట్ర విభజన గొడవలు ముదిరి పాకాన పడ్డ తరుణంలో ఆంధ్ర ప్రాంతానికి చెందిన\nహీరోల సినిమాలు తెలంగాణ లో ఆడనివ్వమని తెలంగాణా వాదులు అల్టిమేటం జారీ\nచేశారు. చిరంజీవి ఫ్యామిలీ, నందమూరి కుటుంబం, అక్కినేని, ఘట్టమనేని', 'రాష్ట్ర విభజన గొడవలు ముదిరి పాకాన పడ్డ తరుణంలో ఆంధ్ర ప్రాంతానికి చెందిన హీరోల సినిమాలు తెలంగాణ లో ఆడనివ్వమని తెలంగాణా వాదులు అల్టిమేటం జారీ చేశారు. చిరంజీవి ఫ్యామిలీ, నందమూరి కుటుంబం, అక్కినేని, ఘట్టమనేని కుటుంబాలన్నీ ఆంధ్ర\nప్రాంతానికి చెందినవే. ప్రభాస్, రవితేజ, గోపిచంద్ సహా యువ హీరోలంతా అటు\nనుంచి వచ్చినవారే. ఇక నైజాంలో వీళ్ల సినిమాలు జామ్ అని ఇక్కడి వారు\nగట్టిగా అంటోంటే మరి వీరు ఎవరి సినిమాలు చూస్తారట? అనే ప్రశ్న పుట్టక\nమానదు.<br><br> వెంటనే ఎవరికైనా ఠక్కున గుర్తొచ్చే తెలంగాణా హీరో నితిన్&nbsp;\nఒక్కడే! ఒక వేళ నిజంగానే నైజాం జనం సీడెడ్, ఆంధ్ర ప్రాంత హీరోలని బ్యాన్\nచేశారే అనుకుందాం. అప్పుడిక నైజాంకి నితిన్ ఏక్ నిరంజన్ అయిపోతాడేమో?\nఅయినా పిచ్చి కాకపోతే అరవోడు నటించిన సినిమాల్ని కూడా గుడ్డలు చించుకుని\nచూసేసే వెర్రి జనానికి, సాటి తెలుగోడు పగవాడైపోయాడా? కలిసుందాం బాబూ అని\nమంచి మాటలు చెబుతుంటే పిచ్చేక్కుతోందా? పిచ్చితనానికి పరాకాష్ట అంటే సినీ\nపరిశ్రమని టార్గెట్ చేయడం కాదూ!!', '2009-12-22 10:47:42', 1, 2),
(45, 1, 'జూ ఎన్టీఆర్ కి అటు చూస్తే గొయ్య..ఇటు చూస్తే..', '', 'తెలంగాణ, సమైఖ్యాంద్ర ఉద్యమాల ఎఫెక్టుతో జూ ఎన్టీఆర్&nbsp;\nకి కొత్త చిక్కు వచ్చి పడింది. మొదట ఆయన లేటెస్టు చిత్రం అదుర్స్ ని ఈ\nరాజకీయ అస్ధిమిత పరిస్ధితుల్లో రిలీజ్ చేయకుండా ఆపుదామనుకున్నారు. కానీ\nఅలా ఆపుచేస్తే..జనవరి నెల వచ్చేస్తుంది. జనవరి నెల మొదటి నుంచీ ఎన్టీఆర్\nకు సెంటిమెంట్ గా వర్కవుట్ కావటం లేదు. ', 'తెలంగాణ, సమైఖ్యాంద్ర ఉద్యమాల ఎఫెక్టుతో జూ ఎన్టీఆర్&nbsp;\nకి కొత్త చిక్కు వచ్చి పడింది. మొదట ఆయన లేటెస్టు చిత్రం అదుర్స్ ని ఈ\nరాజకీయ అస్ధిమిత పరిస్ధితుల్లో రిలీజ్ చేయకుండా ఆపుదామనుకున్నారు. కానీ\nఅలా ఆపుచేస్తే..జనవరి నెల వచ్చేస్తుంది. జనవరి నెల మొదటి నుంచీ ఎన్టీఆర్\nకు సెంటిమెంట్ గా వర్కవుట్ కావటం లేదు. నాగ,నా అల్లుడు, ఆంద్రావాలా\nచిత్రాలు సంక్రాంతికి రిలీజ్ చేసి దెబ్బతినటంతో ఎన్టీఆర్ శ్రేయాభిలాషులు,\nఅభిమానులు అప్పుడు వద్దంటున్నారు. పోనీ డిసెంబర్ లో రిలీజ్ చేద్దామా అంటే\nతెలంగాణాలో రిలీజ్ చెయ్యటానికి వీలు లేదు.దాంతో కొంత మంది డిసెంబర్ 31 న\nరిలీజ్ చేస్తే ఈ లోగా ఈ తెలంగాణ వేడీ తగ్గచ్చు..జనవరి నెల సెంటిమెంటు\nతప్పుతుందని సలహా ఇస్తున్నారు. అయితే ఇప్పటివరకూ జూ.ఎన్టీఆర్ గానీ,\nవివివినాయిక్ గానీ, నిర్మాతలు వల్లభనేని వంశీ, నానిలు గానీ ఎవరూ ఈ తదుపరి\nరిలీజ్ డేట్ పై స్పష్టమైన ప్రకటన చెయ్యలేదు.<br><br> అయితే అదుర్స్ చిత్రం\nగురించి ఎన్టీఆర్ మాత్రం చాలా ధీమాగా ఉన్నట్లు సమాచారం. అందులోనూ ఆది వంటి\nసూపర్ హిట్ ఇచ్చిన వినాయిక్ దర్శకత్వంలో వస్తున్న చిత్రం కావటంతో బయిటా\nమంచి అంచనాలే ఉన్నాయి. దేవీ ప్రసాద్ సంగీతం అందించిన ఈ చిత్రానికి\nకోనవెంకట్ కథ-మాటలు అందించారు. నయనతార ,\nషీలా హీరోయిన్స్ గా చేస్తున్నారు. అలాగే మహేష్ ముంజ్రేకర్ విలన్ గా\nచేసారు. ఈ చిత్రంలోని ఇతర పాత్రల్లో సాయాజీ షిండే, నాజర్, ఆశిష్\nవిద్యార్థి, బ్రహ్మానందం, ఎమ్మెస్ నారాయణ, రఘుబాబు తదితరులు\nనటిస్తున్నారు. ఛోటా కె.నాయుడు సినిమాటోగ్రఫీ, ఆనంద సాయి కళాదర్శకత్వం\nవహిస్తున్నారు. కొడాలి నాని చిత్ర సమర్పకులుగా వ్యవహరిస్తున్నారు.', '2009-12-22 11:05:05', 1, 0),
(46, 2, 'నయనతార వేస్ట్...షీలా ‘అదుర్స్’: జూ ఎన్టీఆర్', '', 'యంగ్ టైగర్ ఎన్టీఆర్&nbsp;\nహీరోగా వస్తున్న చిత్రం ‘అదుర్స్’. షూటింగ్ పూర్తి చేసుకుని విడుదలకు\nసిద్దమవుతున్న ఈ చిత్రంలో ఎన్టీఆర్ డబుల్ రోల్ పోషిస్తున్నారు. హీరోయిన్\nలుగా నయనతార ,\nషీలా నటిస్తున్నారు. గతంలో ఎన్టీఆర్ సరసన నటించిన శ్రీదేవితో ఈ జూనియర్\nనటించాలని వుందంటూ అన్న తన కోరికను శ్రీదేవి పోలికలతో', 'యంగ్ టైగర్ ఎన్టీఆర్&nbsp;\nహీరోగా వస్తున్న చిత్రం ‘అదుర్స్’. షూటింగ్ పూర్తి చేసుకుని విడుదలకు\nసిద్దమవుతున్న ఈ చిత్రంలో ఎన్టీఆర్ డబుల్ రోల్ పోషిస్తున్నారు. హీరోయిన్\nలుగా నయనతార ,\nషీలా నటిస్తున్నారు. గతంలో ఎన్టీఆర్ సరసన నటించిన శ్రీదేవితో ఈ జూనియర్\nనటించాలని వుందంటూ అన్న తన కోరికను శ్రీదేవి పోలికలతో ఉండే షీలాతో నటించి\nకోరికను యాబై శాతం పూర్తి చేసుకున్నాడట.<br><br> మరి తనతో ఈ సినిమాలో\nనర్తించిన రెండు పాటల్లో కూడా శ్రీదేవితో డాన్స్ చేస్తున్నట్టుగా ఫీలింగ్\nవచ్చిందట. మన ఎన్టీఆర్ కు అందుకే ఈ చిత్రంలో షీలా ‘అదుర్స్’ అంటున్నాడు. ఈ\nచిత్రం స్టిల్స్ చూసిన ప్రేక్షకులు కూడా నయనతారను ప్రక్కన బెట్టి షీలాకు\nమంచి మార్కులు వేస్తున్నారు. పోస్టర్స్ లో కూడా నయనతార కన్నా షీలానే\nఅందంగా వుందంటూ కుర్రకారు షీలాకు ఓట్లు వేస్తున్నారు. ఇది తెలుసుకున్న\nనయనతార మాత్రం సినిమా విడుదల తర్వాత తనకు మంచి పేరు వస్తుందంటూ\nఫోజులిస్తుందని సమాచారం.<br><br> ఇదిలా వుంటే అసలే పరిస్థితులు కొత్త\nసినిమాల విడుదలకి అనుకూలంగా లేవు. సమైక్యాంధ్ర కే సై అన్న హరికృష్ణ మాటలు\nఅగ్నికి ఆజ్యం పోశాయి. దీంతో ఎన్టీఆర్ సినిమా వస్తే ఖబడ్దార్ అని తెలంగాణా\nవాదులు హుకుం జారీ చేశారు. మరి భారీ బడ్జెట్ సినిమా ..భారీగా విడుదల ఇలా\nసర్వం భారీగా వున్న ‘అదుర్స్’ డిసెంబర్ 25న రావాల్సి వుంది కానీ ఇలాంటి\nటైమ్ లో రిలీజ్ చేయడమంటే దుస్సాహసమే. అందుకే ‘అదుర్స్’ రిలీజ్ ని ఆలస్యం\nచేయాలని నిర్మాతలు ఆలోచిస్తున్నారు.', '2009-12-22 11:08:36', 1, 3),
(47, 1, 'అల్లు అర్జున్ ఆర్య-2 రిలీజ్ డేట్ కన్ఫర్మ్', '', 'అల్లు అర్జున్, సుకుమార్ కాంబినేషన్లో రెడీ అవుతున్న ఆర్య-2 చిత్రం రిలీజ్\nడేట్ ఇప్పటి వరకూ ప్రకటించలేదు. కానీ..నవంబర్ ఇవయై ఐదవ తేదీన రిలీజు\nచేయటానికి సన్నాహాలు చేస్తున్నారని సమాచారం. రీసెంట్ గా పోస్ట్ ప్రొడక్షన్\nవర్క్ ఫినిష్', 'అల్లు అర్జున్, సుకుమార్ కాంబినేషన్లో రెడీ అవుతున్న ఆర్య-2 చిత్రం రిలీజ్\nడేట్ ఇప్పటి వరకూ ప్రకటించలేదు. కానీ..నవంబర్ ఇవయై ఐదవ తేదీన రిలీజు\nచేయటానికి సన్నాహాలు చేస్తున్నారని సమాచారం. రీసెంట్ గా పోస్ట్ ప్రొడక్షన్\nవర్క్ ఫినిష్ అయింది.ఇక ఈ చిత్రం అఫీషయల్ రిలీజ్ డేట్ ప్రకటన కోసం\nమరికొందరు దర్శక,నిర్మాతలు వెయిట్ చేస్తున్నారు. ఎందుకంటే ఈ చిత్రం రిలీజ్\nసమయంలో తమ చిత్రాలు విడుదల చేసి నష్టాన్ని మూటకట్టుకోకూడదనేది వారి ఆలోచన.\nఇక ఈ చిత్రంలో అల్లు అర్జున్,నవతేజ,కాజల్ చేస్తున్నారు. ఆర్య లాగానే\nక్యాట్ అండ్ గేమ్ లా ఈ చిత్రం టెన్షన్, వినోదం కలిసి నడుస్తుందని\nతెలుస్తోంది.<br><br> అలాగే ఈ రెండు నెలలో మరో ఏడు పెద్ద చిత్రాలు రిలీజ్\nకానున్నాయి. జగపతి బాబు, ప్రియమణి కాంబినేషన్లో వచ్చే ప్రవరాఖ్యుడు\nడిసెంబర్ నాలుగున రిలీజ్ అవుతోంది. డిసెంబర్ రెండో వారంలో విష్ణు,ఇలియానా\nకాంబినేషన్ సలీం వస్తోంది. ఎన్టీఆర్, వినాయిక్ కాంబినేషన్ అదుర్స్ డిసంబర్\n18న వస్తోంది. శేఖర్ కమ్ముల లీడర్ చిత్రం డిసెంబర్ 24 న రిలీచ్ అవుతుంది.\nనాగార్జున రమ్మీ చిత్రం కూడా డిసెంబర్ లోనే రిలీజ్ అవుతుంది.', '2009-12-22 11:11:01', 1, 4),
(48, 7, 'భాగస్వామిలో సెక్స్ అలజడి కలిగించడమెలా...?', '', 'కొంతమంది దంపతులు\nతమకు తగినంత లైంగిక ఆనందం కలుగడం లేదనీ, అసలు తన భాగస్వామి', 'కొంతమంది దంపతులు\nతమకు తగినంత లైంగిక ఆనందం కలుగడం లేదనీ, అసలు తన భాగస్వామిని ఎంత\nప్రేరేపించినా సెక్స్ స్పందనలు కలుగడం లేదని వాపోతుంటారు. నిజానికి ఇది\nలైంగిక పరమైన సమస్య కాదు. దానికి కారణం ఏవో సమస్యలు అయి ఉంటాయి. ఒకరు\nసెక్స్‌కి సిద్ధపడి రెండోవారు అది ఇప్పుడు ఇష్టం లేదు అని అంటున్నారంటే...\nదాని వెనుక మరేదో సమస్య ఉందని అర్థం చేసుకోవాలి.<br>\n<br> పడక\nగదికి చేరిన తర్వాత మనసులో సెక్స్ కోరికలు తప్ప మరే కోరికలకు చోటు\nకల్పించకూడదు. అలా ఉండటానికి ఇద్దరూ ప్రయత్నించాలి. ఏవైనా సమస్యలుంటే పడక\nగది బయటే చర్చించుకుని వాటికి అక్కడే ఫుల్‌స్టాప్ పెట్టేయాలి. ఆ సమస్యలను\nచర్చించేందుకు సెక్స్ సమయాన్ని వాడుకోకూడదు. ఆనందకరమైన, సంతృప్తికరమైన\nసెక్స్ అన్ని సమస్యలను పరిష్కరిస్తుంది.<br>\n<br> భాగస్వామిలో\nసెక్స్ అలజడులను రేపేందుకు ఎక్కడ స్పర్శిస్తే ఆమె/అతడిలో స్పందన వస్తుందో\nతెలుసుకుని సున్నితంగా స్పర్శిస్తూ ప్రారంభించండి. అలా నెమ్మదిగా వారిని\nసెక్స్‌కి సంసిద్ధులను చేసి పూర్తి స్థాయి సెక్స్‌కు తీసుకెళ్లవచ్చు.\nఅంతేకాదు లైంగిక కబుర్లను చెప్పడం కూడా సెక్స్ కోర్కెల ద్వారాలను\nతెరువవచ్చు. సెక్స్ తృప్తి అనుభవించిన జంటల్లో మానసిక ఆందోళనలు కానరావు.\nఅంతేకాదు పూర్తి ఆరోగ్యానికి కూడా సెక్స్ మంచి మందు అంటున్నారు\nసెక్సాలజిస్టులు.<br>\n', '2010-01-01 12:25:17', 1, 10);
