INSERT INTO `greetings` (`id`, `type`, `name`, `summery`, `insert_date`, `active`, `views`) VALUES
(1, 1, 'జన్మదిన శుభాకాంక్షలు ... ', ' చుక్కల్లో చంద్రుదివ్  నువ్వు . చుట్టూ  చుక్కలున్న  రాలిపోయే  ఈ  చుక్కకోసం  ఎందుకురా  పరుగు  తీస్తావు ....', '2009-08-14 12:41:32', 1, 0),
(2, 2, 'ఐ లవ్ యు', '&nbsp;ఐయామ్&nbsp; సార్చింగ్&nbsp; అండ్&nbsp; వెయిటింగ్&nbsp; ఫర్&nbsp; యు', '2009-08-14 13:14:49', 0, 0),
(3, 1, 'పుట్టిన రోజు శుభాకాంక్షలు <br>', 'పుట్టిన రోజు వేడుకను మల్లి మల్లి జరుపుకోవాలని కోరుకుంటూ .... ఈ చిన్ని కార్డ్', '2009-08-14 16:43:39', 0, 0),
(4, 1, 'ఐ మిస్ యు <br>', 'ఇన్&nbsp; ది&nbsp; ఫ్లవర్&nbsp; మై&nbsp; రోజ్&nbsp; ఇస్&nbsp; యు ,<br>ఇన్&nbsp; డైమెండ్&nbsp; మై&nbsp; కోహినూర్&nbsp; ఇస్&nbsp; యు ,<br>ఇన్&nbsp; ది&nbsp; స్కి&nbsp; మై&nbsp; మూన్&nbsp; ఇస్&nbsp; యు', '2009-08-15 12:44:13', 0, 0),
(5, 12, 'ఐ మిస్ యు <br>', 'ఇన్ ది ఫ్లవర్ మై&nbsp; రోజ్&nbsp; ఇస్ యు ,<br>ఇన్ ది&nbsp; డైమెండ్&nbsp; మై&nbsp; కోహినూర్&nbsp; ఇస్&nbsp; యు<br>ఇన్&nbsp; ది&nbsp; స్కి&nbsp; మై&nbsp; మూన్&nbsp; ఇస్ యు ,<br>ఐ యాం&nbsp; ఓన్లీ బాడీ&nbsp; మై&nbsp; హార్ట్ ఇస్&nbsp; యు ,', '2009-08-15 12:52:19', 0, 0),
(6, 12, '  I మిస్&nbsp; యు&nbsp; సో&nbsp; ముచ్ ', 'డు యు&nbsp; క్నౌ, వాట్&nbsp; ఐ&nbsp; సే, వాట్&nbsp; ఐ&nbsp; థింక్ , వాట్&nbsp; ఐ&nbsp; ఫీల్ , వాట్&nbsp; ఐ&nbsp; థింక్ , వాట్&nbsp; ఐ&nbsp; విష్ , యు&nbsp; వాంట్&nbsp; తో&nbsp; క్నౌ ? I మిస్&nbsp; యు&nbsp; సో&nbsp; ముచ్ <br>', '2009-08-15 13:29:01', 0, 0),
(7, 10, 'ఉగాది శుభాకాంక్షలు', 'విష్ యు అ హ్యాపీ ఉగాది ', '2009-08-15 15:07:01', 0, 0),
