(32, '2', '''ఈల'' వేసిన లోక్ సత్తా aaa', '', '<font class="UnicodeContent">హైదరాబాద్ : ఈల గుర్తును లోక్ సత్తా\nపార్టీకి కేటాయిస్తున్నట్లు రాష్ట్ర ఎన్నికల సంఘం ఆ పార్టీకి\nలిఖితపూర్వకంగా సమాచారం అందించింది. ఈల గుర్తుని ఫ్రీ సింబల్స్ జాబితాలో\nచేర్చాలని, తమ పార్టీకి దాన్ని కేటాయించాలంటూ లోక్ సత్తా పార్టీ చేసిన\nవిజ్ఞప్తి పట్ల ఈసీ సానుకూలంగా స్పందించినట్లైంది. </font>', '<font class="UnicodeContent">అయితే, ఈల గుర్తు కేటాయింపు తాత్కాలికమేనని,\nత్వరలో జరగనున్న గ్రేటర్ హైదరాబాద్ ఎన్నికల్లో ఈల గుర్తు మీది లోక్ సత్తా\nపోటీ చేయవచ్చని ఈసీ స్పష్టం చేసింది. లోక్ సత్తా పార్టీ ప్రధాన కార్యదర్శి\nవి. లక్ష్మణ్ బాలాజీకి రాష్ట్ర ఎన్నికల సంఘం కార్యదర్శి జి.ఎం. రమేష్\nకుమార్ రాసిన లేఖలో ఈ విషయం స్పష్టం చేశారు. ఈ విషయాన్ని లోక్ సత్తా\nఅధికార ప్రతినిధులు వి.లక్ష్మణ్ బాలాజీ, మహ్మద్ ఇషాక్ ఖాన్ గురువారం\nమధ్యాహ్నం పార్టీ కేంద్ర కార్యాలయంలో నిర్వహించిన మీడియా సమావేశంలో\nవివరించారు</font>', '2009-06-26 10:19:17', 0, 1, 0),
(31, '1', 'మైకేల్ జాక్సన్ మృతి', 'mykale jankshon mruthi', '<font class="UnicodeContent">లాస్ ఏంజెలెస్ : ప్రపంచ సంగీత చక్రవర్తి,\nఆధునిక స్వర విన్యాస మూర్తి పాప్ స్టార్ మైకేల్ జాక్సన్ ఇక లేరు. విశ్వ\nసంగీత ప్రియులను రసధునిలో ఓలలాడించిన ఆ అద్భుత సంగీత స్రష్ట తనువు\nచాలించారు. నలభై వసంతాల పాటు కోట్లాది మంది</font>', '<font class="UnicodeContent">అభిమానులను తన స్వరంతో, బ్రేక్ డాన్స్ లతో\nమంత్ర ముగ్ధులను చేసిన మైకేల్ జోసఫ్ జాన్సన్ హృద్రోగంతో కన్నుమూశారు. తన\nనివాస గృహంలోనే గుండె పోటు రావడంతో అపస్మారక స్థితి(కోమా)లోకి వెళ్ళిపోయిన\nజాక్సన్ ఇక్కడి యుసిఎల్ ఏ మెడికల్ సెంటర్లో చికిత్స పొందుతూ శుక్రవారం\nతెల్లవారజూమున సుమారు రెండున్నర ప్రాంతంలో తుదిశ్వాస విడిచారు. జాక్సన్\nమృతి వార్త సంగీత ప్రపంచాన్ని విషాదంలో ముంచేసింది. జాక్సన్ మొదట లిజా\nమేరీ ప్రెస్లేను వివాహం చేసుకున్నారు. కానీ 1996లో విడాకులు తీసుకున్నారు.\nవీరికి ఒక సంతానం. ఆ తరువాత డెబ్బీ రోవ్ ను వివాహం చేసుకుని ఇద్దరు\nపిల్లలు కలిగిన తర్వాత విడిపోయారు. జాక్సన్ తన పిల్లలు మైకేల్ జోసఫ్\nజాక్సన్ జూనియర్, పారీస్ మైకేల్ కేథరైన్ జాక్సన్, ప్రిన్స్ బ్లాంకెట్\nమైకేల్ జాక్సన్ 1తో కలిసి ఉంటున్నారు. కాగా ఇటీవలే ఆయన మతం\nమార్చుకున్నారు. ఇస్లాం మతాన్ని స్వీకరించారు. <br>\n<br>\nఅయితే వివాదాలమయమైన ఆయన వ్యక్తిగత జీవితంలో చివరకు మరణం కూడా వివాదంగానే\nమిగిలింది. బుధవారం నుంచే జాక్సన్ అస్వస్థులుగా ఉన్నారని అతని సోదరుడు\nజర్మైన్ జాక్సన్ వివరించారు. అప్పుడే కుటుంబ వైద్యులను పిలిపించారు.\nతీవ్రమైన గుండెపోటుతో మైకేల్ జాక్సన్ కోమాలోకి వెళ్ళేసమయంలో వైద్యులు\nఅందుబాటులోనే ఉన్నారు. వెంటనే యూసీఎల్ ఏ మెడికిల్ సెంటర్ కు తరలించి\nవైద్యుల బృందం జాక్సన్ బతికించడానికి తీవ్ర ప్రయత్నాలు చేసినా ఫలితం\nదక్కలేదు. కోమాలోకి వెళ్ళే సరికే నాడి పడిపోయిందని వైద్యులు చెబుతున్నారు.\nకాగా చాలా కాలంగా వివిద రుగ్మతలతో బాధపడుతున్న జాక్సన్ కు వైద్యులు మందులు\nఇచ్చారని, వాటిని నియమం, పరిమితి లేకుండా వాడడం వల్లనే జాక్సన్ కు\nగుండెపోటు వచ్చి ఉంటుందని జాక్సన్ కుటుంబ అటార్నీ బ్రియాన్ ఆక్సమెన్\nచెబుతున్నారు. లాస్ ఏంజెలెస్ పోలీసులు జాక్సన్ మృతిపై దర్యాప్తును\nప్రారంభించారు. జాక్సన్ మృతిలో ఎలాంటి నేరపూరితమైన పరిణామాలూ\nచోటుచేసుకున్నట్టు ఆధారాలు లేకపోయినా పోలీసులు జాక్సన్ బంధువులను,\nస్నేహితులను, వైద్యులను ప్రశ్నిస్తున్నారు. అలానే జాక్సన్ పార్ధీవకాయనికి\nవైద్యపరమైన అటాప్సీ పరీక్షలు నిర్వహించనున్నారు. </font><br>', '2009-06-26 10:17:49', 1, 1, 3),
(30, '3', 'వై. ఎస్. వ్యూహాన్ని తిప్పి కొట్టి', '', '<span><span><p align="justify">జిల్లా నియోజక వర్గ స్థాయి&nbsp;&nbsp; ఇతర పార్టీల&nbsp;\nముఖ్యనేతలను&nbsp; కాంగ్రెస్ లోకి చేర్చుకోవాలని&nbsp; మంత్రులకు సి. ఎం.&nbsp;&nbsp;\nస్పష్టమైన ఆదేశాలు ఇవ్వడం తో విపక్షాలు ముఖ్యంగా టి. డి.&nbsp; పి. లో గుబులు\nమొదలైంది.&nbsp; విభజించి పాలించడం లో వై.ఎస్. చాలా నిష్ణాతులు.&nbsp; వై. ఎస్.\nవ్యూహానికి ఇప్పుడే అడ్డుకట్ట వేయకపోతే రానున్న ఐదేళ్ల కాలంలో జిల్లాల్లో\nఉనికి లేకుండా పోతుందన్న ఆందోళన విపక్ష పార్టీలో మొదలైంది. </p>\n</span></span>', '<span><span><p align="justify">జిల్లా నియోజక వర్గ స్థాయి&nbsp;&nbsp; ఇతర పార్టీల&nbsp;\nముఖ్యనేతలను&nbsp; కాంగ్రెస్ లోకి చేర్చుకోవాలని&nbsp; మంత్రులకు సి. ఎం.&nbsp;&nbsp;\nస్పష్టమైన ఆదేశాలు ఇవ్వడం తో విపక్షాలు ముఖ్యంగా టి. డి.&nbsp; పి. లో గుబులు\nమొదలైంది.&nbsp; విభజించి పాలించడం లో వై.ఎస్. చాలా నిష్ణాతులు.&nbsp; వై. ఎస్.\nవ్యూహానికి ఇప్పుడే అడ్డుకట్ట వేయకపోతే రానున్న ఐదేళ్ల కాలంలో జిల్లాల్లో\nఉనికి లేకుండా పోతుందన్న ఆందోళన విపక్ష పార్టీలో మొదలైంది. </p>\n<p align="justify">వై. ఎస్. వ్యూహాన్ని తిప్పి కొట్టి&nbsp; పార్టీ క్యా\nడర్‌ను కాపాడుకునే పనిలో విపక్ష పార్టీలు&nbsp; తల మునకలు అవుతున్నాయి. మిగిలిన\nపార్టీలెమో కానీ తెలుగుదేశం పార్టీ కి&nbsp; మాత్రం ఈ సారి గట్టి దెబ్బ తగలడం\nఖాయం అని తెలిసింది.</p></span></span>', '2009-06-25 13:22:22', 0, 1, 2),
(35, '5', '<span class="kreative">మళ్ళీ పెరిగిన పెట్రోలు ధరలు                </span>', '', '<font style="font-size: 11pt; color: #000000;">దేశంలో మరోమారు\nపెట్రోలు ధరలు భగ్గుమన్నాయి. పెట్రోలు, డీజిల్‌ ధరలను పెంచుతూ నిర్ణయం\nతీసుకున్నట్లు పెట్రోలియం శాఖ మంత్రి మురళీదేవరా ప్రకటించారు. </font>', '<font style="font-size: 11pt; color: #000000;">పెట్రోలు లీటర్‌కి\nరూ.4, డీజిల్‌పై రూ.2 పెంచినట్లు ఆయన పేర్కొన్నారు. పెంచిన ధరలు బుధవారం\nఅర్థరాత్రినుంచే అమలులోకి వస్తాయని ఆయన తెలిపారు. </font><br><br><font style="font-size: 11pt; color: #000000;">అంతకు\nముందు దేవరా, ప్రధాన మంత్రితో భేటీ అయ్యారు. అనంతరం మీడియా ప్రతినిధుల\nసమావేశంలో పెట్రో ధరలు పెంచుతున్నట్లు తెలిపారు. అయితే వంటగ్యాస్‌,\nకిరోసిన్‌ ధరలు మాత్రం పెంచేది లేదని ఆయన స్పష్టం చేశారు. </font><br><br><font style="font-size: 11pt; color: #000000;">అంతర్జాతీయంగా పెరిగిన ముడి చమురు ధరల కారణంగా లోటును పూర్తి చేసుకునేందుకే తాము ధరలను పెంచాల్సివచ్చిందని ఆయన వివరించారు</font>', '2009-07-02 16:25:00', 0, 1, 0),
(33, '3', 'గుజరాత్ అల్లర్ల కేసుపై స్టే తొలగించిన సుప్రీం కోర్టు ', '', 'న్యూఢిల్లీ; హైదరాబాదీ బాడ్మింటన్‌ స్టార్‌\r\nసైనా నెహ్వాల్‌ సంచలనం సృష్టించింది. జకార్తాలో జరుగుతున్న ఇండోనేషియన్‌\r\n\r\n', '<font class="UnicodeContent">క్రీడాకారిణిల చేతిలో పరాజయం చవిచూసే సైనా ఈ\nసారి దాన్ని అధిగమించి సెమీస్‌, ఫైనల్లో చైనా ప్లేయర్స్‌పైనే విజయం\nసాధించింది. గత వారం సింగపూర్‌ సూపర్‌సిరీస్‌లో వాంగ్‌ చేతిలో ఓడిన సైనా\nఇప్పుడు 48 నిమిషాల పాటు పోరాడి విజయంతో ప్రతీకారం తీర్చుకుంది. <br>\n<br>\nసూపర్‌ సిరీస్‌ చరిత్రలో ఇప్పటి వరకు పుల్లెల గోపీచంద్‌,\nప్రకాశ్‌పదుకొనేలు మాత్రమే ఆల్‌ ఇంగ్లాండ్‌ బ్యాడ్మింటన్‌ టైటిల్స్‌\nసాధించారు. ఆట ప్రారంభం నుంచే సైనాపై వాంగ్‌ ఆధిక్యం ప్రదర్శించింది. ఏడు\nస్మాష్‌ పాయింట్లతో 3-9కు వాంగ్‌ దూసుకుపోయింది. దీంతో సైనా వెనుకంజ\nవేయడంతో 12-21తో వాంగ్‌ తొలిగేమ్‌ను సొంతం చేసుకుంది. అయితే రెండోగేమ్‌\nహోరాహోరిగా సాగింది. 5-5, 12-12, 16-16 ఇలా స్కోరు సమంగా సాగాయి. అయితే\nవరుసగా సైనా నాలుగు పాయింట్లు సాధించి 21-18తో గేమ్‌ను గెలిచింది. ఇక\nకీలకమైన మూడోగేమ్‌లో ఆరంభంలో 7-7తో ఇరువురు సమవుజ్జీలుగా ఉన్నారు. సైనా\nవరుసగా ఏడు పాయింట్లతో 15-9 ఆధిక్యానికి దూసుకుపోయింది. <br>\n<br>\nఆ తర్వాత వరుసగా ఆరు పాయింట్లు గెలవడంతో గేమ్‌ను మ్యాచ్‌తో పాటు తొలి\nసూపర్‌సిరీస్‌ను సొంతం చేసుకుంది. మొత్తం మ్యాచ్‌లో సైనా స్మాస్‌ల ద్వారా\n7, నెట్‌వద్ద 29 పాయింట్లు గెల్చుకోవడంతో పాటు 102 ర్యాలీల్లో 54సార్లు\nపైచేయి సాధించింది. ఈ విజయంతో సైనాకు దాదాపు రూ.8.5 లక్షల ప్రైజ్‌మనీ\nదక్కింది. <br>\n<br>\nవరల్డ్‌ ఛాంపియన్‌షిప్‌కు లాభిస్తుంది: గోపీచంద్‌<br>\n<br>\nఈ విజయం సైనాకు వచ్చే ఆగష్టు హైదరాబాద్‌లో జరగనున్న ప్రపంచ బ్యాడ్మింటన్‌\nచాంపియన్‌షిప్‌కు ఎంతో ఉపయోగపడుతుందని జాతీయ కోచ్‌ పుల్లెల గోపీచంద్‌\nఅన్నారు.స్వదేశంలో జరగనున్న వరల్డ్‌ చాంపియన్‌షిప్‌కు పూర్తి\nఆత్మవిశ్వాసంతో బరిలోకి దిగుతుందని ఆయన చెప్పారు.<br>\n<br>\nగర్వపడుతున్నా: హర్విర్‌సింగ్‌<br>\n<br>\nతన కూతురి విజయాన్ని చూసి గర్వపడుతున్నానని సైనా తండ్రి హర్విర్‌సింగ్‌\nఅన్నారు. తానొక్కడినే కాకా దేశం మొత్తం సైనా గెలుపు గర్వకారణమని చెప్పారు.\nదేశంలో ఎంతో మంది యువక్రీడాకారులకు ఆదర్శం అవుతుందని ఆయన తెలిపారు. <br>\n<br>\nవైఎస్‌, బాబు అభినందనలు<br>\n<br>\nతొలి సారిగా సూపర్‌ సిరీస్‌ గెలుపొందినందుకు సైనానెహ్వాల్‌ ముఖ్యమంత్రి\nవైఎస్‌ రాజశేఖరరెడ్డి, ప్రతిపక్ష నాయకుడు టీడీపీ అధినేత చంద్రబాబు\nఅభినందించారు. సైనా విజయం దేశానికే గర్వకారణమని కొనియాడారు. మరోవైపు\nసైనాకు భారత బ్యాడ్మింటన్‌ సంఘం (బాయ్‌) అధ్యక్షుడు వీకే వర్మ రూ.రెండు\nలక్షల నగదును ప్రకటించారు.</font><br>', '2009-06-26 10:20:45', 0, 1, 0),
(34, '4', 'ట్వంటీ చాంపియన్ పాక్', '', '<font class="UnicodeContent">లండన్‌: శిఖరానికి చివరి మెట్టు ఎక్కుతూ\r\nశ్రీలంక జారిపడిపోయింది. ఫలితంగా పాకిస్థాన్‌ ట్వంటీ-20 ప్రపంచకప్‌\r\nసాధించింది. క్రితం సారి భారత్‌ చేతిలో ఛాంపియన్‌షిప్‌ \r\n</font>', '<font class="UnicodeContent">గెలిపించాడు. అజేయ మైన అర్ధసెంచరీ(54)తో\nజట్టును విజయం శిఖరానికి చేర్చాడు. ‘మ్యాన్‌ ఆఫ్‌ ది మ్యాచ్‌’\nఅందుకున్నాడు. పరుగుల స్టార్‌ దిల్షాన్‌కు మ్యాన్‌ అఫ్‌ ది సిరీస్‌\nలభించింది. తొలుత బ్యాటింగ్‌ చేసిన శ్రీలంక నిర్ణీత 20 ఓవర్లలో 6 వికెట్లు\nకోల్పో యి 138 పరుగులు చేయగా, దీన్ని పాకిస్థాన్‌ కేవలం 2 వికెట్లు\nకోల్పోయి 18.4 ఓవర్లలోనే అధిగమించింది. <br>\n<br>\nప్రపంచకప్‌ లక్ష్యానికి కమ్రన్‌ అక్మల్‌(37), హసన్‌(19)లు 48 పరుగులతో\nశుభారంభమిచ్చారు. వీరిద్దరి నిష్ర్కమణతో క్రీజ్‌లోకి వచ్చిన అఫ్రిది,\nషోయబ్‌ మాలిక్‌ జాగ్రత్తగా ఆడారు. అనవసర షాట్లకు తావివ్వకుండా అడపా దడపా\nమెరుపులతో లక్ష్యానికి ఒక్కో పరుగును జోడించారు. చివరి వరకూ అజేయంగా\nనిలిచారు. అఫ్రిది 54(2్ఠ2,2్ఠ6) ఫిఫ్టీ చేసుకోగా, షోయబ్‌ మాలి్‌ 24\nపరుగులు చేశాడు.<br>\n<br>\nఅంతకుముందు టాస్‌ నెగ్గిన శ్రీలంక కెప్టెన్‌ సంగక్కర తొలుత\nపరుగుపెట్టేందుకే మొగ్గుచూ పాడు. కానీ తానొకటి తలస్తే... దైవం మరోలా\nతలచిందన్నట్లు... లంక పరిస్థితి ఆదిలోనే అధో గతి పాలైంది. దిల్షాన్‌,\nవన్‌డౌన్‌ బ్యాట్స్‌మన్‌ ముబా రక్‌ డకౌట్లతో శ్రీలంక 2కే 2 వికెట్లను\nకోల్పోయింది. దిల్షాన్‌ ను అమిర్‌, ముబారక్‌ను రజాక్‌ ఔట్‌ చేశారు. దీనికి\nకాసేపటికే దూకుడుగా ఆడుతున్న జయసూర్య (17)ను రజాక్‌ బౌల్డ్‌ చేశాడు.\nమరికాసేపటికే జయవర్ధనె కూడా రజాక్‌ బౌలింగ్‌లోనే నిష్ర్కమించాడు. రజాక్‌\nదెబ్బకు లంక 32/4. తర్వా త సంగక్కర ఒంటరిపోరాటం చేశాడు. అజేయంగా నిలిచి 64\nపరుగులు చేశాడు. 139 పరుగుల పోరాడే లక్ష్యాన్ని ప్రత్యర్థి ముందుంచాడు.<br>\n<br>\nస్కోరుబోర్డు: <br>\n<br>\nశ్రీలంక: దిల్షాన్‌ (సి)హసన్‌ (బి)అమిర్‌ 0, జయసూర్య (బి)రజాక్‌ 17,\nముబారక్‌ (సి)హసన్‌ (బి)రజాక్‌ 0, సంగక్కర నాటౌట్‌ 64, జయవర్ధనె\n(సి)మిస్బా (బి)రజాక్‌ 1, చమరసిల్వ(సి)అజ్మల్‌ (బి)గుల్‌ 14, ఉదన\n(బి)అఫ్రిది 1, మ్యాథ్యూస్‌ నాటౌట్‌ 35, ఎక్స్‌ట్రాలు 6, మొత్తం (20\nఓవర్లలో) 138/6<br>\n<br>\nవికెట్ల పతనం: 1-0, 2-2, 3-26, 4-32, 5-67, 6-70<br>\n<br>\nబౌలింగ్‌: అమిర్‌ 4-1-30-1, రజాక్‌ 3-0-20-3, అఫ్రిది 4-0-20-1, అజ్మల్‌ 4-0-28-0, షోయబ్‌ 1-0-8-1, ఉమర్‌గుల్‌ 4-0-29-1<br>\n<br>\nపాకిస్థాన్‌: అక్మల్‌ (స్టంప్డ్‌)సంగక్కర (బి)జయసూర్య , హసన్‌ (సి)జయసూర్య\n(బి)మురళీ 19, అఫ్రిది నాటౌట్‌ 54, మాలిక్‌ నాటౌట్‌ 24, ఎక్స్‌ట్రాలు 5,\nమొత్తం(18.4 ఓవర్లలో) 139/2<br>\n<br>\nవికెట్ల పతనం: 1-48, 2-63<br>\n<br>\nబౌలింగ్‌: మ్యాథ్యూస్‌ 2-0-17-0, ఉదన 4-0-44-0, మలింగ 3.4-0-14-0, మురళీధరన్‌ 3-0-20-1, మెండీస్‌ 4-0-34-0, జయసూర్య 2-0-8-1</font>', '2009-06-26 10:22:19', 0, 1, 0),
(47, '4', '<font class="UnicodeHeadline">భయంతో ఇంగ్లాండ్ వెనక్కి</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : తీవ్రవాదుల దాడి భయంతో\nఇంగ్లాండ్ బ్యాడ్ మింటన్ బృందం తిరిగి వెళ్ళిపోయింది. సోమవారం నుంచి ఇక్కడ\nజిఎంసి బాలయోగి స్టేడియంలో జరిగే 75వ ప్రపంచ బ్యాడ్ మింటన్ ఛాంపియన్</font>', '<font class="UnicodeContent">షిప్ పోటీల నుంచి వైదొలగిపోయింది.\nపాకిస్తాన్ తీవ్రవాదసంస్థ లష్కరే తొయిబా నుంచి ఈ పోటీలకు ముప్పు ఉందన్న\nసమాచారంతో తామను వెనుతిరిగి రమ్మని ఇంగ్లాండ్ ప్రభుత్వం అదేశించిందని టీమ్\nచీఫ్ ఎగ్జిక్యూటీవ్ ఎడ్రియన్ క్రీష్టీ చెప్పారు. పోటీలపై చాలా ఆసక్తితో\nఇక్కడకు వచ్చామని, తమ క్రీడాకారులు కూడా చాలా సన్నద్ధమై ఉన్నారని ఆయన\nవివరించారు. కాని దాడు ముప్పు ఉన్న కారణంగా తాము క్రీడాకారుల, కోచ్ ల, ఇతర\nసిబ్బంది వ్యక్తిగత భద్రతకు ప్రాధాన్యం ఇచ్చామని ఆయన పేర్కోన్నారు. కాగా ఈ\nపోటీల్లో పాల్గొనాలనే ఆసక్తిని ఇంగ్లాండ్ క్రీడాకారులు కనబరిచారని పోటీ\nనిర్వాహక కార్యదర్శి పున్నయ్య చౌదరి చెప్పారు. ప్రభుత్వ ఆదేశాలతో వారు\nతిరిగి ప్రయాణమై వెళ్ళారని అన్నారు. అయితే ఇంగ్లాండ్ భయపడుతున్న\nపరిస్థితులు ఇక్కడ లేవని, పోటీలకు కట్టుదిట్టమైన భద్రతను ఏర్పాటుచేశామని\nఆయన వివరించారు.</font>', '2009-08-10 13:09:50', 0, 0, 0),
(36, '6', '<span class="kreative">హమ్మయ్య..! సెన్సెక్స్ కోలుకుంది                </span> ', '', 'హైదరాబాద్: రైతులకు ప్రయోజనం చేకూర్చేందుకే తాము సహకార వ్యవసాయాన్ని\nప్రోత్సహిస్తున్నామని ముఖ్యమంత్రి డాక్టర్ వైయస్ రాజశేఖర రెడ్డి చెప్పారు', 'రంగారెడ్డి జిల్లా చేవెళ్లలో జరిగిన సభలో ఆయన శనివారం ప్రసంగించారు. సహకార\nవ్యవసాయంపై ప్రతిపక్షాలు చేస్తున్న విమర్శలను ఆయన తప్పు పట్టారు. సహకార\nసేద్యం వల్ల రైతులకు ప్రయోజనం చేకూరుతుందని, వ్యవసాయం అభివృద్ధి\nచెందుతుందని ఆయన చెప్పారు.<br><br> వ్యవసాయం వ్యవసాయం మాదిరిగా కాకుండా\nవ్యాపారంలా చేయాలని, అప్పుడే రైతులకు లాభాలు వస్తాయని, సహకార వ్యవసాయం\nఅందుకు తోడ్పడుతుందని ఆయన అన్నారు. సహకార వ్యవసాయం వల్ల రెట్టింపు ఆదాయం\nసమకూరుతుందని ఆయన చెప్పారు. ప్రాణహిత - చేవెళ్ల సాగునీటి ప్రాజెక్టు వల్ల\nభూములు కోల్పోయే వారికి తగిన న్యాయం చేస్తామని, వారికి ఎక్కువ ధర\nచెల్లిస్తామని, అందువల్ల ప్రజలు భయపడాల్సిన అవసరం లేదని ఆయన అన్నారు.<font style="font-size: 11pt; color: #000000;"></font>', '2009-07-02 16:26:25', 0, 1, 0),
(37, '5', '<span class="kreative">ఉద్యోగాలు కోల్పోయిన 4 లక్షల మంది                </span>               ', '', '<font style="font-size: 11pt; color: #000000;">ప్రపంచవ్యాప్తంగా నెలకొన్న ఆర్థికమాంద్యంకారణంగా వివిధ కంపెనీలలో ఉద్యోగులు తమ ఉద్యోగాలను కోల్పోయారు. ఇది గడచిన ఆగష్టు నెల 2007వ </font>', '<font style="font-size: 11pt; color: #000000;">సంవత్సరంనుంచి ఇప్పటివరకు ఉద్యోగాలు కోల్పోయిన వారి సంఖ్య దాదాపు నాలుగు లక్షలమంది వరకు ఉంటుందని సర్వేలు తెలుపుతున్నాయి. </font><br><br><font style="font-size: 11pt; color: #000000;">పలు కంపెనీలు, బ్యాంకులు తమ ఉద్యోగులను తొలగించిన సంస్థల వివరాలిలా ఉన్నాయి. </font><br><br><font style="font-size: 11pt; color: #000000;">** టీ గ్రూప్ సంస్థలో 75 వేలమంది.</font><br><font style="font-size: 11pt; color: #000000;">** బ్యాంక్ ఆఫ్ అమెరికాలో 45 వేలమంది.</font><br><font style="font-size: 11pt; color: #000000;">** జేపీ మార్గన్ సంస్థలో 23వేల ఏడు వందలమంది.</font><br><font style="font-size: 11pt; color: #000000;">** యూబీఎస్‌లో 19వేల ఏడు వందలమంది</font><br><font style="font-size: 11pt; color: #000000;">** హెచ్ఎస్‌బీసీలో 16వేల 350మంది</font><br><font style="font-size: 11pt; color: #000000;">** ఆర్‌బీఎస్‌లో 15వేల 250మంది</font><br><font style="font-size: 11pt; color: #000000;">** లేహ్మన్ బ్రదర్స్ సంస్థలో 12 570మంది</font><br><font style="font-size: 11pt; color: #000000;">** అమెరికన్ ఎక్స్‌ప్రెస్ సంస్థలో దాదాపు పదకొండువేలమంది.</font><br><font style="font-size: 11pt; color: #000000;">** కామర్స్ బ్యాంక్‌లో 9,500మంది.</font><br><font style="font-size: 11pt; color: #000000;">** బార్క్లేస్ సంస్థలో 9వేల యాభైమంది.</font><br><font style="font-size: 11pt; color: #000000;">** యూనిక్రెడిట్ సంస్థలో 9వేలమంది.</font><br><font style="font-size: 11pt; color: #000000;">** మార్గన్ స్టాన్లీ సంస్థలో 8, 680మంది.</font><br><font style="font-size: 11pt; color: #000000;">** నేషనల్ సిటీ కార్ప్ సంస్థలో 7 4వందలమంది. </font><br><font style="font-size: 11pt; color: #000000;">** క్రెడిట్ సుయీస్ సంస్థలో 7320మంది, </font><br><font style="font-size: 11pt; color: #000000;">** ఐఎన్‌జీలో ఏడువేలమంది,</font><br><font style="font-size: 11pt; color: #000000;">**ఫస్ట్ అమెరికన్‌లో దాదాపు 5460మంది,</font><br><font style="font-size: 11pt; color: #000000;">** గోల్డ్ మేన్ సెక్స్ సంస్థలో 4800మంది,</font><br><font style="font-size: 11pt; color: #000000;">** ఫిడిలిటీ నేషనల్ ఫైనాన్షియల్ ఇంక్ సంస్థలో 4100మంది,</font><br><font style="font-size: 11pt; color: #000000;">** ఫిడిలిటీ ఇన్వెస్ట్‌మెంట్ సంస్థలో నాలుగువేలమంది,</font><br><font style="font-size: 11pt; color: #000000;">** ల్యోడ్స్ సంస్థలో 3595మంది, </font><br><font style="font-size: 11pt; color: #000000;">** మెరిల్ లించ్ సంస్థలో దాదాపు 3300మంది,</font><br><font style="font-size: 11pt; color: #000000;">** సాంతన్డర్ సంస్థలో దాదాపు రెండువేల ఆరువందలమంది,</font><br><font style="font-size: 11pt; color: #000000;">** స్టేట్ స్ట్రీట్‌లో పద్దెనిమిది వందలు, </font><br><font style="font-size: 11pt; color: #000000;">** నోమురా సంస్థలో 1530మంది, </font><br><font style="font-size: 11pt; color: #000000;">**\nడ్యూక్ బ్యాంక్‌లో 1380మంది తమ ఉద్యోగాలను కోల్పోయారని సర్వేలు\nచెపుతున్నాయి. ఈ లెక్కన వివిధ సంస్థల్లో పనిచేస్తున్న ఉద్యుగులు తమ\nఉద్యోగాలు కోల్పోయారు. </font>', '2009-07-02 16:39:25', 0, 1, 0),
(40, '7', '<font class="UnicodeHeadline">తెరాస ''శాంతి'' వ్రతం</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : తెలంగాణ రాష్ట్ర సమితి సెక్రటరీ\r\nజనరల్, మెదక్ లోక్ సభ సభ్యురాలు విజయశాంతి విషయంలో </font>', '<font class="UnicodeContent">ఢిల్లీలో ఉన్న తెరాస అధినేత కేసీఆర్ పార్టీ\nనాయకులు, శ్రేణులకు ఈ మేరకు స్పష్టమైన ఆదేశాలు జారీచేసినట్లు తెలుస్తోంది.\nతెలంగాణ రాష్ట్ర సమితి నుంచి తనను బయటికి పంపించేందుకు పార్టీలో కుట్ర\nజరుగుతోందంటూ విజయశాంతి శనివారంనాడు మీడియా ప్రతినిధుల వద్ద అసంతృప్తి\nవ్యక్తం చేసిన నేపథ్యంలో పార్టీ ఈ విధమైన నిర్ణయం తీసుకుంది. పార్టీలో\nతనను మానసిక క్షోభకు గురిచేస్తున్నారని, అటు పార్లమెంటు సమావేశాల్లో\nపాల్గొననివ్వకుండా, నియోజకవర్గంలో సరిగా తిరగనివ్వకుండా రకరకాల కారణాలతో\nవేధిస్తున్నట్లు ఆమె ఆవేదన వ్యక్తం చేశారు. అయితే విజయశాంతి వ్యాఖ్యలపై\nఎవ్వరూ నోరు మెదపవద్దని కేసీఆర్ ఆదేశించడం గమనార్హం.<br>\n<br>\nముఖ్యమంత్రి వైఎస్ ను విజయశాంతి కలిసిన తరువాత ఆమెపై పార్టీలో కొందరు\nనాయకులు తీవ్రస్థాయిలో ఆరోపణలు చేస్తున్నారు. ఆమె తెరాస తరఫున ఎం.పి.\nఅయినందున లోక్ సభ సభ్యత్వానికి రాజీనామా చేయాలన్న డిమాండ్ ను కొందరు తెరాస\nనాయకులు ముందుకు తీసుకువచ్చారు. విజయశాంతి కాంగ్రెస్ పార్టీలో చేరుతారన్న\nఊహాగానాలు చెలరేగడంతో తెరాస నాయకులు ఆమె పట్ల తీవ్ర గుర్రుగా ఉన్నారు.\nకాగా, పార్టీలో జరుగుతున్న పరిణామాలు తనకు తీవ్ర ఆవేదన కలిగిస్తున్నాయని\nఆమె వాపోయారు. అత్యవసర సమావేశం ఉందని పనిగట్టుకొని తనను ఢిల్లీ నుంచి\nహైదరాబాద్ పిలిపించిన తెరాస నాయకులు తీరా వచ్చాక సంప్రతించలేదని, ఆ\nసమావేశం ఉందో లేదో కూడా తనకు చెప్పకుండా అవమానించారని ఆమె ఆరోపించారు.\nవిజయశాంతి బహిరంగంగా పార్టీ వైఖరిని ఎండగట్టేందుకు సిద్ధపడడంతో నాయకులు\nకూడా ఆమె వ్యాఖ్యలపై ప్రతి వ్యాఖ్యలు చేస్తే రాద్దాంతం అవుతుందన్న ఆలోచనతో\nకేసీఆర్ ఇలా వారిని శాంతి వ్రతం చేయమని ఆదేశించినట్లు తెలుస్తోంది.</font><br>', '2009-08-10 11:56:42', 0, 0, 0),
(39, '7', 'రైతు సహకారానికే: వైయస్', '', 'హైదరాబాద్: రైతులకు ప్రయోజనం చేకూర్చేందుకే తాము సహకార వ్యవసాయాన్ని\r\n', 'రంగారెడ్డి జిల్లా చేవెళ్లలో జరిగిన సభలో ఆయన శనివారం ప్రసంగించారు. సహకార\nవ్యవసాయంపై ప్రతిపక్షాలు చేస్తున్న విమర్శలను ఆయన తప్పు పట్టారు. సహకార\nసేద్యం వల్ల రైతులకు ప్రయోజనం చేకూరుతుందని, వ్యవసాయం అభివృద్ధి\nచెందుతుందని ఆయన చెప్పారు.<br><br> వ్యవసాయం వ్యవసాయం మాదిరిగా కాకుండా\nవ్యాపారంలా చేయాలని, అప్పుడే రైతులకు లాభాలు వస్తాయని, సహకార వ్యవసాయం\nఅందుకు తోడ్పడుతుందని ఆయన అన్నారు. సహకార వ్యవసాయం వల్ల రెట్టింపు ఆదాయం\nసమకూరుతుందని ఆయన చెప్పారు. ప్రాణహిత - చేవెళ్ల సాగునీటి ప్రాజెక్టు వల్ల\nభూములు కోల్పోయే వారికి తగిన న్యాయం చేస్తామని, వారికి ఎక్కువ ధర\nచెల్లిస్తామని, అందువల్ల ప్రజలు భయపడాల్సిన అవసరం లేదని ఆయన అన్నారు.', '2009-08-08 18:50:57', 0, 0, 0),
(48, '4', 'ఏపీ ట్రిపుల్ ఐటి అడ్మిషన్ లిస్ట్ రద్దు', '', '<font style="font-size: 11pt; color: #000000;">మూడు ఏపీ ట్రిపుల్\nఐటీలకు సంబంధించిన అడ్మిషన్ ప్రక్రియలో ప్రోగ్రామింగ్ తప్పిదాలు దొర్లడంతో\nలిస్ట్‌ను రద్దు చేశారు. మూడు ట్రిపుల్ ఐటీలకు విద్యార్థులను ఎంపిక చేస్తూ\nఈ నెల ఒకటో తేదీన విడుదలైన జాబితాను రద్దు</font>', '<font style="font-size: 11pt; color: #000000;">చేస్తున్నట్లు మంగళవారం రాజీవ్ గాంధీ  విద్యా వైజ్ఞానిక విశ్వవిద్యాలయం (ఆర్‌జీయూకేటీ) చాన్సలర్ డాక్టర్ రాజిరెడ్డి తెలిపారు.</font><br><br><font style="font-size: 11pt; color: #000000;">ట్రిపుల్\nఐటీకి ఎంపికైన విద్యార్థుల జాబితాలో కొన్ని పారపాట్లు, అవకతవకలు జరిగాయని\nతెలియడంతో ఈ జాబితాను రద్దు చేశామన్నారు. రిజర్వేషన్ల అమలు, మండలాలకు\nసీట్ల కేటాయింపుల్లో తప్పిదాలు జరిగినట్లు తమ దృష్టికి వచ్చిందన్నారు.\nఆర్‌కె వ్యాలీ, బాసర, న్యూజివీడు ట్రిపుల్ ఐటీల్లోని మొత్తం ఆరు వేల\nసీట్లకు 5100 మంది విద్యార్థులను ఎంపిక చేస్తామన్నారు.</font><br><br><font style="font-size: 11pt; color: #000000;">రాష్ట్రస్థాయిలో\nమెరిట్ సాధించిన విద్యార్థులకు మిగిలిన 900 సీట్లను అందిస్తారు.\nసెప్టెంబరు 6 నుంచి ట్రిపుల్ ఐటీ తరగతులు ప్రారంభం కానున్నాయి. కొత్త\nజాబితాను మరో పది రోజుల్లో సిద్ధం చేయనున్నట్లు తెలిపారు. ఎంపికయిన\nవిద్యార్థులకు కాల్‌లెటర్లు పంపుతామన్నారు. ప్రోగ్రామింగ్‌లో లోపాల\nకారణంగా ఈ పరిస్థితి తలెత్తిందని రాజిరెడ్డి వివరించారు.</font>', '2009-08-10 14:40:51', 0, 0, 0),
(41, '7', '<font class="UnicodeHeadline">చిరు నోరెందుకు విప్పలేదు?</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : ప్రజారాజ్యం పార్టీ మహిళా\nవిభాగం అధ్యక్షురాలి పరువును దెబ్బతీసే విధంగా మీడియా వార్తలు రావడం, ఆమె\nఫోటోను మార్ఫింగ్ చేసి ఇంటర్నెట్ లో ప్రదర్శించడంపై ఆ పార్టీ అధ్యక్షుడు </font>', '<font class="UnicodeContent">చిరంజీవి, నాయకులు స్పందించకపోవడం విచారకరం\nఅని ఎన్టీఆర్ తెలుగుదేశం పార్టీ అధ్యక్షురాలు నందమూరి లక్ష్మీపార్వతి\nప్రశ్నించారు. ఒక మహిళ అందులోనూ దళిత మహిళ కుటుంబ గౌరవాన్ని మంటగలిపే\nవిధంగా దుష్ప్రచారం జరగడాన్ని తాను ఒక మహిళగా తీవ్రంగా\nఖండిస్తున్నానన్నారు. నటుడు ప్రకాశ్ రాజ్ తో మహిళా రాజ్యం అధ్యక్షురాలు\nశోభారాణితో రహస్యంగా వివాహం జరిగిందంటూ గురువారంనాడు మీడియాలో వార్తలు\nగుప్పుమనడం, ఆ వెంటనే ఆమెను మీడియా లైవ్ కార్యక్రమంగా ఇంటర్వ్యూలు చేయడం\nపట్ల లక్ష్మీపార్వతి ఆవేదన వ్యక్తం చేశారు. ఒక మహిళగా తన సంపూర్ణ మద్దతు\nశోభారాణికి ఉంటుందని ఆమె అన్నారు. శుక్రవారంనాడు తనను కలిసిన మీడియా\nప్రతినిధులతో లక్ష్మీపార్వతి ఈ విషయమై స్పందించారు.</font>', '2009-08-10 12:02:04', 0, 0, 0);
INSERT INTO `news` (`id`, `type`, `heading`, `eng_heading`, `summary`, `description`, `insert_date`, `breking_news`, `active`, `views`) VALUES
(42, '7', '<font class="UnicodeContent">.</font><font class="UnicodeHeadline">వైఎస్ కు సిగ్గు లేదు: బాబు</font>', '', '<font class="UnicodeHeadline">వైఎస్ కు సిగ్గు లేదు: బాబు</font><font class="UnicodeContent">హైదరాబాద్ : ముఖ్యమంత్రి వైఎస్\nరాజశేఖరరెడ్డి నిస్సిగ్గుగా వ్యవహరిస్తున్నారని తెలుగుదేశం అధ్యక్షుడు\nచంద్రబాబు నాయుడు దుయ్యబట్టారు</font>', '<font class="UnicodeContent">తాను తలచుకుంటే బయటి పార్టీలన్నీ ఖాళీ\nఅయిపోయి, కాంగ్రెస్ పార్టీ ఫుల్ అయిపోతుందన్న భ్రమలతో ఆయన నిన్న ప్రకటన\nచేశారని ఆయన ఎద్దేవా చేశారు. కొందరు ఎమ్మెల్యేలు, నాయకులను ప్రలోభపెట్టి\nతెలుగుదేశంపై తప్పుడు ప్రచారం చేయించే నీచ సంస్కృతిని ముఖ్యమంత్రి వైఎస్\nపోషిస్తున్నారని నిప్పులు చెరిగారు. తెలుగుదేశం పార్టీలో చేరేందుకు వచ్చే\nవారంతా ప్రజాస్వామ్యాన్ని పరిరక్షించేందుకు, ప్రజా సమస్యలపై పోరాటం\nచేసేందుకే వస్తున్నారంటూ కితాబునిచ్చారు. అయితే, కాంగ్రెస్ పార్టీలోకి\nవెళ్ళేవారంతా పదవులు లేదా డబ్బుల ఆశతోనే వెళుతున్నారని విశ్లేషించారు.\nరెండు రోజుల క్రితం ప్రజారాజ్యంపార్టీకి రాజీనామా చేసిన టిడిపి మాజీ\nనాయకులు తూళ్ళ దేవేందర్ గౌడ్, ఇనుగాల పెద్దిరెడ్డి తదితర నాయకులు గురువారం\nసాయంత్రంలో మళ్ళీ టిడిపిలో చేరిన సందర్భంగా ఆయన మాట్లాడారు. టిడిపి ప్రధాన\nకార్యాలయం ఎన్టీఆర్ ట్రస్ట్ భవన్ కి తరలి వచ్చిన వేలాదిమంది గౌడ్\nఅభిమానులు, అనుచరులతో కిక్కిరిసిన సమావేశంలో ఆయన ప్రసంగించారు.<br>\n<br>\nసిగ్గులేని ముఖ్యమంత్రి రాష్ట్రంలో మరో రాజకీయ పార్టీ లేకుండా చేయాలని\nకంకణం కట్టుకున్నారని చంద్రబాబు ఆగ్రహం వ్యక్తం చేశారు. ఈ క్రమంలో ఈ\nముఖ్యమంత్రి నిన్న కాంగ్రెస్ పార్టీలో టిడిపి మహిళ అధ్యక్షురాలు రోజా\nచేరుతున్నారంటూ పుకార్లు పుట్టించారన్నారు. ఈ పుకారు వేయడం ద్వారా నిన్న\nబడ్జెట్ పై శాసనసభలో అత్యంత ముఖ్యమైన ప్రశ్నకు సమాధానం చెప్పకుండా\nదాటవేశారని ఆరోపించారు.<br>\n<br>\nరాష్ట్రంలో ఎన్టీఆర్ టిడిపిని స్థాపించే వరకూ కాంగ్రెస్ పార్టీకి\nప్రత్యామ్నాయమే లేకుండా పోయిన విషయాన్ని చంద్రబాబు గుర్తు చేశారు. అలా\nకాంగ్రెస్ పార్టీని గడగడలాడించిన టిడిపిని అణచివేయాలన్న కుట్రతోనే ఆగస్టు\nసంక్షోభాన్ని కాంగ్రెస్ పార్టీ సృష్టించిందని పేరు చెప్పకుండా నాదెండ్ల\nభాస్కరరావు ఉదంతాన్ని ఆయన ప్రస్తావించారు. కష్టకాలంలో టిడిపి తరఫున నిలబడి\nవీరోచితంగా పోరాడిన ప్రతి ఒక్కరికీ చంద్రబాబు ధన్యవాదాలు తెలిపారు.\nప్రతిపక్షాలను ప్రధానంగా టిడిపిని లేకుండా చేస్తే తనకిక ఎదురే ఉండదన్న\nదురుద్దేశంతోనే వైఎస్ రాజశేఖరరెడ్డి పలు కుట్రలు పన్నుతున్నారని\nఆరోపించారు. కొందరిని ప్రలోభపెట్టి తనపై లేఖలు రాయిస్తున్నారని\nఆరోపించారు. అసెంబ్లీలో ప్రజాసమస్యలు చర్చకు రాకుండా కాంగ్రెస్ పార్టీ,\nముఖ్యమంత్రి వైఎస్ శతవిధాలా ప్రయత్నిస్తున్నారని ఆరోపించారు.<br>\n<br>\nరాజకీయంగా జరిగిన కొన్ని పరిణామాల నేపథ్యంలో కొందరు సీనియర్ నాయకులు\nపార్టీ వదలివెళ్ళినా తిరిగి మళ్ళీ చేరడం ముదావహం అన్నారు. కాంగ్రెస్\nపార్టీకి గత ఎన్నికల్లో 34 శాతం ఓట్లు మాత్రమే వచ్చాయని, 66 శాతం మంది ఆ\nపార్టీని వ్యతిరేకించారన్నారు. ఒక్క శాతం ఓట్లు తెచ్చుకుని ఉంటే టిడిపియే\nరాష్ట్రంలో అధికారంలోకి వచ్చి ఉండేదని ఆయన అన్నారు. మనం ఓడి గెలిచామని,\nటిడిపిది సాంకేతిక విజయమని, నైతిక విజయమని చంద్రబాబు చెప్పుకున్నారు.</font>', '2009-08-10 12:03:36', 0, 0, 0),
(43, '7', '<font class="UnicodeHeadline">తప్పులెంచనులే ''తమ్మి''</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : అలిగి ప్రజారాజ్యంలోకి వెళ్ళిన\nశ్రీకాకుళం జిల్లా సీనియర్ నాయకుడు తమ్మినేని సీతారామ్ తిరిగి టిడిపిలో\nచేరితే తాను సాదరంగా ఆహ్వానిస్తానని ఆ పార్టీ సీనియర్ నాయకుడు, </font>', '<font class="UnicodeContent">పొలిట్ బ్యూరో సభ్యుడు కింజరాపు ఎర్రంనాయుడు\nస్పష్టం చేశారు. టిడిపిని వదిలేటప్పుడు తనపై సీతారామ్ చేసిన ఆరోపణలపై\nవివరణ కూడా అడగబోనని ఆయన అన్నారు. ఇప్పటికైనా ''తమ్మి''నేని తిరిగి పార్టీలో\nచేరాలని భావిస్తుండడం తనకు సంతోషం కలిగిస్తున్నదని కింజరాపు ఎర్రంనాయుడు\nతెలిపారు. ప్రజారాజ్యాన్ని వదిలిపెట్టి తెలుగుదేశం పార్టీలో చేరేందుకు\nతమ్మినేని సీతారామ్ సన్నాహాలు చేస్తున్నారన్న వార్తలు వెలువడుతున్న\nనేపథ్యంలో కింజరాపు పై విధంగా స్పందించారు. తమ్మినేని టిడిపిలో చేరేందుకు\nశ్రీకాకుళం జిల్లాకే చెందిన సీనియర్ నాయకుడు కింజరాపు ఎర్రంనాయుడు\nఅడ్డంకిగా ఉన్నారంటూ వస్తున్న ఊహాగానాలకు ఇంతటితో తెరపడింది. ఇక తమ్మినేని\nమాతృసంస్థలో పునరాగమనం మరింత సులువైనట్లైంది.<br>\n<br>\nకాగా, తాను తెలుగుదేశం పార్టీని వదిలిపెట్టడానికి ప్రధాన కారణం కింజరాపు\nఎర్రంనాయుడి పెత్తనమే అని తమ్మినేని సీతారామ్ గతంలో తీవ్రస్థాయిలో\nఆరోపించారు. జిల్లా మొత్తాన్ని ఆయన ఒక్కడే ఏకఛత్రాధిపత్యం వహించాలని\nచూస్తున్నాడని విమర్శించారు. తాను, తన కుటుంబ సభ్యులే జిల్లాలో ఎదగాలన్న\nధోరణిలో ఇతరులపై అణచివేత ధోరణి అనుసరించారని ఆరోపించారు. అధిష్టానం వద్ద\nప్రాపకం సంపాదించుకున్న కింజరాపు కేవలం తన కులంవారిని మాత్రమే జిల్లాలోని\nఅన్ని పదవుల్లో నియమించుకున్నారని ఆగ్రహం వ్యక్తం చేశారు. జిల్లా మరో\nనాయకుడు ఎదగకుండా కింజరాపు రాజకీయంగా కుట్రలు పన్నారని దుయ్యబట్టారు.</font>', '2009-08-10 12:28:25', 0, 0, 0),
(44, '1', '<font class="UnicodeHeadline">ఆయిల్ ఫాం రైతులకు అభయం</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : ఆయిల్ ఫాం సాగు చేస్తున్న\nరాష్ట్రంలోని రైతులకు వ్యవసాయ శాఖ మంత్రి ఎన్. రఘువీరారెడ్డి అభయం\nఇచ్చారు. ఆయిల్ ఫాం రైతుల ఇబ్బందులను ప్రభుత్వం సహృదయంతో అర్థం</font>', '<font class="UnicodeContent">చేసుకున్నదని వారిని ఆదుకునేందుకు అవసరమైన\nఅన్ని చర్యలూ తీసుకుంటున్నదని ఆయన వివరణ ఇచ్చారు. రాష్ట్ర శాసనసభ బడ్జెట్\nసమావేశాల సందర్భంగా ఆయిల్ ఫాం రైతులపై సభ్యులు అడిగిన ప్రశ్నకు మంత్రి\nరఘువీరా శుక్రవారంనాడు సమాధానం ఇచ్చారు. ఈ సంవత్సరం రికార్డు స్థాయిలో 97\nవేల హెక్టార్లలో పామాయిల్ దిగుబడి వచ్చిందన్నారు. మరో ఐదేళ్ళలో పది లక్షల\nహెక్టార్లలో ఆయిల్ ఫామ్ దిగుబడి చేయాలన్న లక్ష్యాన్ని ప్రభుత్వం\nనిర్దేశించిందన్నారు. రాబోయే ఏడెనిమిదేళ్ళలో 250 కోట్ల రూపాయల టర్నోవర్\nలక్ష్యంగా ఆయిల్ ఫాం ను అభివృద్ధి చేసేందుకు కార్యాచరణ రూపొందించామన్నారు.\n20 వేల హెక్టార్లలో బిందు సేద్యం విధానం అమలు చేస్తున్నట్లు మరో ప్రశ్నకు\nమంత్రి రఘువీరా వివరణ ఇచ్చారు.<br>\n<br>\nరాష్ట్ర రైతులకు ఆదుకునేందుకు ముఖ్యమంత్రి డాక్టర్ వైఎస్ రాజశేఖరరెడ్డి\nఇప్పటికే కేంద్ర వ్యవసాయ శాఖ మంత్రి శరద్ పవార్ తో సంప్రతింపులు జరిపారని\nమంత్రి రఘువీరా స్పష్టం చేశారు. ఆయిల్ ఫాం రైతులకు ప్రత్యేకంగా సదుపాయాలు\nకల్పించేందుకు కేంద్ర మంత్రి కూడా సుముఖత వ్యక్తం చేశారన్నారు</font>', '2009-08-10 12:32:39', 0, 0, 0),
(45, '7', '<font class="UnicodeHeadline">ఎమ్మెల్యేల గంజి నిరసన</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : నిత్యావసర వస్తువుల ధరల\nపెరుగుపై తెలుగుదేశం పార్టీ ఎమ్మెల్యేలు సోమవారం సరికొత్త నిరసన తెలిపారు.\nఅసెంబ్లీ ప్రాంగణం సమీపంలోని గన్ పార్క్ వద్ద టిడిపికి చెందిన మహిళా\nఎమ్మెల్యేలు</font>', '<font class="UnicodeContent">కట్టెలపొయ్యిపై మట్టి కుండల్లో గంజి కాచి,\nఅందరికీ పంచిపెట్టి, వారూ తాగి నిరసన వ్యక్తం చేశారు. ముఖ్యమంత్రి వైఎస్\nరాజశేఖరరెడ్డి హయాంలో ఈ రాష్ట్రంలో ఏమీ కొనేటట్టు లేదని, ఏమీ తినేటట్టు\nలేదని వారు ఆవేదన వ్యక్తం చేశారు. శాసనసభ ప్రశ్నోత్తరాల సమయంలో నిత్యావసర\nవస్తువుల ధరలపై టిడిపి సభ్యులు అడిగిన ప్రశ్నలకు ప్రభుత్వం నుంచి సరైన\nసమాధానం రాకపోవడంతో వారు ఈ విధమైన నిరసన వ్యక్తం చేశారు.<br>\n<br>\nరాష్ట్ర ప్రజలకు కాంగ్రెస్ పార్టీని నమ్మి ఓటేస్తే చివరికి వారికి\nపప్పన్నమైనా తినే పరిస్థితి లేకుండా చేసిందని ఈ సందర్భంగా టిడిపి\nఎమ్మెల్యేలు దుమ్మెత్తిపోశారు. ఈ సందర్భంగా ఎమ్మెల్యే అన్నపూర్ణమ్మ\nమీడియాతో మాట్లాడుతూ, ప్రస్తుతం ఒక పొట్లకాయ కొనాలన్నా పది రూపాయల కన్నా\nతక్కువకు దొరకని దుస్థితి దాపురించిందని దుయ్యబట్టారు. బియ్యం, పప్పులు,\nకూరగాయలు, పాలు ఇలా ఒక్కటని చెప్పాల్సిన పని లేకుండా ప్రతీ వస్తువూ\nసామాన్యులకు అందని ద్రాక్ష మాదిరిగా చేసిందని ఆరోపించారు. ఒక వైపున\nనిత్యావసర వస్తువుల ధరలు ఆకాశాన్నంటున్నప్పటికీ వైఎస్ సర్కార్ నిమ్మకు\nనీరెత్తనట్లు వ్యవహరిస్తోందని, అదేమని అడిగిన తమ నోళ్ళు మూయించేందుకు\nఎదురుదాడులు చేస్తోందని ఎమ్మెల్యేలు ఆవేదన వ్యక్తం చేశారు. అసెంబ్లీ ముందు\n''గంజి నిరసన'' చేస్తే అయినా ఈ సర్కార్ లో చలనం వస్తుందన్న ఆశాభావంతోనే తాము\nఈ చర్యకు దిగామని వారు తెలిపారు.<br>\n<br>\nనిత్యావసర వస్తువుల ధరలపై అసెంబ్లీలో తాము నిదీద్దామంటే ప్రతిపక్ష\nసభ్యులకు అవకాశం దక్కకుండా అధికారపక్షం దారుణంగా ప్రవర్తిస్తోందన టిడిపి\nఎమ్మెల్యేలు ఆవేదన వ్యక్తం చేశారు. రాష్ట్రంలో తాగడానికి మంచినీరు దొరకడం\nలేదని, పశువులకు గ్రాసం లేదని దీనంతటికీ కాంగ్రెస్ సర్కార్ వైఖరే కారణం\nఅని టిడిపి మహిళా ఎమ్మెల్యే ఎలిమినేటి ఉమా మాధవరెడ్డి ఆరోపించారు. ఈ నిరసన\nకార్యక్రమానికి టిడిపికి చెందిన పలువురు పురుష ఎమ్మెల్యేలు కూడా హాజరై\nగంజి తాగి నిరసన తెలిపారు.</font>', '2009-08-10 12:37:04', 0, 0, 0),
(46, '7', '<font class="UnicodeHeadline">హేమామాలిని ఇక రారు</font>', '', 'న్యూఢిల్లీ : అలనాటి అందాల తార, ప్రముఖ\r\nనర్తకి హేమామాలిని, దారాసింగ్, ప్రసిద్ధ న్యాయవాది రామ్ జెఠ్మలాని ', '<font class="UnicodeContent">ఆగస్టు 26 తేదీతో వీరి పదవీ కాలం\nముగిసిపోనుంది. బడ్జెట్ సమావేశాల చివరి రోజైన శుక్రవారం నాడు వీరు\nరాజ్యసభకు హజరయ్యారు. వీరితో పాటు పదవీ విరమణ చేస్తున్న బిమల్‌ జలాన్‌,\nచందన్‌ మిత్రా, నారాయణ్‌సింగ్‌ మనక్‌లావ్‌ నామినేటెడ్‌ సభ్యులకు రాజ్యసభ\nవీడ్కోలు చెప్పింది. కాగా ఢిల్లీ మాజీ మంత్రి పర్వేజ్‌ హష్మీ, ఒరిస్సా\nశాసనసభ మాజీ స్పీకర్‌ కిశోర్‌కుమార్‌ మొహంతి రాజ్యసభ సభ్యులుగా ప్రమాణ\nస్వీకారం చేశారు. ఢిల్లీకి ప్రాతినిధ్యం వహిస్తున్న కాంగ్రెస్‌కు చెందిన\nహష్మీ రాజ్యసభ ఛైర్మన్‌ హమీద్‌ అన్సారీ సమక్షంలో ప్రమాణం చేశారు. </font><br>', '2009-08-10 12:40:39', 0, 1, 0),
(65, '2', 'నిమ్స్ లో కెసిఆర్ కు చిరు పరామర్శ', '', 'హైదరాబాద్: హైదరాబాదులోని నిమ్స్ లో తెలంగాణ రాష్ట్ర సమితి (తెరాస) అధ్యక్షుడు', 'హైదరాబాద్: హైదరాబాదులోని నిమ్స్ లో తెలంగాణ రాష్ట్ర సమితి (తెరాస) అధ్యక్షుడు కె. చంద్రశేఖర రావును\nప్రజారాజ్యం పార్టీ అధినేత చిరంజీవి శనివారంనాడు పరామర్శించారు. ఆయన\nఆరోగ్యం గురించి వైద్యులను అడిగి తెలుసుకున్నారు. చిరంజీవి రావడంతో నిమ్స్\nవద్ద కలకలం బయలుదేరింది. తెరాస కార్యకర్తలు చిరంజీవిని చుట్టుముట్టి జై\nతెలంగాణ నినాదం చేయాలని పట్టుబట్టారు. ఆయన కాళ్లు పట్టుకున్నారు. పోలీసులు\nజోక్యం చేసుకుని చిరంజీవిని అక్కడి నుంచి తీసుకెళ్లారు.<br><br> రెండు\nరోజులపాటు తిరుపతిలో పర్యటించి వచ్చిన చిరంజీవి హైదరాబాదు వచ్చిన తర్వాత\nశనివారం కెసిఆర్ ను పరామర్శించారు. అంతకు ముందు ఆయన కెసిఆర్ తో ఫోన్ లో\nమాట్లాడారు. ఇప్పటి వరకు తెలుగుదేశం నాయకులెవరూ పరామర్శకు రాకపోవడం\nగమనార్హం. శాసనసభ మాజీ స్పీకర్ కెఆర్ సురేష్ రెడ్డి కూడా శనివారం ఉదయం\nకెసిఆర్ ను పరామర్శించారు.', '2009-12-05 15:05:40', 0, 0, 0),
(49, '4', '<span class="kreative">వీఎస్‌యూలో కొత్త పీజీ కోర్సు                </span>  ', '', '<font style="font-size: 11pt; color: #000000;">నేషనల్\nఇనిస్టిట్యూట్ ఆఫ్ మైక్రో, స్మాల్, మీడియం ఎంటర్‌ప్రైజెస్ (ఎన్ఐ-ఎంఎస్ఎంఈ)\nసహకారంతో విక్రమ సింహపురి విశ్వవిద్యాలయం (వీఎస్‌యూ)</font>', '<font style="font-size: 11pt; color: #000000;">విద్యార్థులకు కొత్త పీజీ డిప్లమో కోర్సును అందుబాటులోకి తీసుకురానుంది. ఈ కోర్సు నిడివి తొమ్మిది నెలలు.</font><br><br><font style="font-size: 11pt; color: #000000;">వచ్చే\nవిద్యా సంవత్సరం నుంచి ఈ కోర్సును అందించనున్నట్లు వీఎస్‌యూ ఉప కులపతి\nప్రొఫెసర్ సీఆర్ విశ్వేశ్వరరావు తెలిపారు. ఈ కోర్సులో గ్రాడ్యుయేట్లు,\nఇంజనీరింగ్, ఇతర విద్యార్థులు చేరవచ్చని చెప్పారు. చిన్న, మధ్యతరహా\nపరిశ్రమల అభివృద్ధికి సంబంధించిన మెళుకువలు నేర్చుకోవాలనుకునే\nవిద్యార్థులకు ఈ కోర్సు ప్రయోజనకరంగా ఉంటుందన్నారు.</font>', '2009-08-10 14:41:53', 0, 0, 0),
(50, '4', '<span class="kreative">ర్యాగింగ్‌కు దూరంగా ఉండాలని వీసీ సూచన                </span>', '', '<font style="font-size: 11pt; color: #000000;">జేఎన్‌టూయూ- కాకినాడ\nవిద్యార్థులకు విశ్వవిద్యాలయ ఉపకులపతి అల్లం అప్పారావు ర్యాగింగ్‌కు\nదూరంగా ఉండాలని సూచించారు. కొత్త విద్యార్థులను</font>', '<font style="font-size: 11pt; color: #000000;">ర్యాగింగ్ చేయడం వలన\nవారు భయంతో కూడిన మానసిక సమస్యల్లో చిక్కుకుంటారని, అంతేకాకుండా ర్యాగింగ్\nచేసే వారు కూడా భవిష్యత్‌ను నాశనం చేసుకోవాల్సి వస్తుందని హెచ్చరించారు.</font><br><br><font style="font-size: 11pt; color: #000000;">జూనియర్లను\nర్యాగింగ్ పేరుతో వేధింపులకు గురిచేసేవారిని కటకటాల వెనక్కు పంపేందుకు\nకూడా వెనుకాడబోమని చెప్పారు. విశ్వవిద్యాలయంలో, అనుబంధ కళాశాలల్లో\nక్రమశిక్షణ నెలకొల్పేందుకు ఇటువంటి కఠిన చర్యలు అవసరమని పేర్కొన్నారు.\nఅందువలన విద్యార్థులు ర్యాగింగ్ జోలికి వెళ్లకుండా ఉండటం ఉత్తమమని\nసూచించారు.</font>', '2009-08-10 14:42:42', 0, 0, 0),
(51, '4', '<span class="kreative">25 నుంచి ఎంసెట్ కౌన్సిలింగ్                </span> ', '', '<font style="font-size: 11pt; color: #000000;">ఇంజనీరింగ్, మెడిసన్‌ కోర్సుల ప్రవేశానికి నిర్వహించే ఎంసెట్ కౌన్సిలింగ్ ఈ నెల 25న ప్రారంభం కానుంది. ఈ మేరకు శుక్రవారం ఉన్నత</font>', '<font style="font-size: 11pt; color: #000000;">ప్రకటించింది. </font><br><br><font style="font-size: 11pt; color: #000000;">వాస్తవానికి\nగురువారమే ఈ నోటిఫికేషన్ విడుదల కావాల్సి ఉండగా, కొన్ని అనివార్య కారణాల\nరీత్యా శుక్రవారం విడుదలైందని విద్యాశాఖ ఓ ప్రకటనలో తెలిపింది.</font>', '2009-08-10 14:51:16', 0, 0, 0),
(52, '1', '<div class="articleheading">మగ''ధీర'' సరికొత్త రికార్డులు</div>', '', 'అందరూ ఊహించినట్టుగానే మగధీర చిత్రం ఘనవిజయం సాధించినా...ఎవరూ ఊహించని\nరీతిలో కలెక్షన్ల ప్రభంజనం సృష్టిస్తోంది. నిన్నమొన్నటి వరకూ మొదటి వారం\nకలెక్షన్లు 15', 'కోట్లు ఉంటుందని అంచనా వేసినవారు ముక్కునవేలేసుకొనేలా 22 కోట్లు వసూలు\nచేసినట్టు ట్రేడ్ వర్గాల వారు తెలిపారు. రామ్ చరణ్ ఛార్మింగ్\nపర్ఫార్మెన్స్, ''జక్కన్న'' రాజమౌళి దర్శకత్వ ప్రతిభ, అత్యాధునిక సాంకేతిక\nవిలువలతో వచ్చిన ఈ చిత్రాన్ని ఏక కాలం లో 1500 థియేటర్లలో విడుదలచేయడం\nబాగా కలసివచ్చిందని, దీనికి తోడు ఈ చిత్రానికి మొదటి ఆట నుండీ వస్తున్న\nపాజిటివ్ రెస్పాన్స్ సక్సెస్ రేంజ్ ని ఈ స్థాయికి పెంచడానికి బాగా\nఉపయోగపడాయి అనేది సినివిశ్లేషకులు అభిప్రాయం. ఈ చిత్రంతో రామ్ చరణ్ అన్ని\nఏరియాల్లోనూ మొదటి వారం కలెక్షన్లు కోటిపై గా వసూలు చేసిన హీరోగా చరిత్ర\nసృష్టించారు.<br><br> ఈ చిత్రం కలెక్షన్ల వివరాలు ఈ విధంగా వున్నాయి:<br><br> ఏరియా			కలెక్షన్లు<br><br> నిజాం &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			7 కోట్లు<br> సీడెడ్&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			3.5 కోట్లు<br> గుంటూరు &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.70 కోట్లు<br> పశ్చిమ గోదావరి&nbsp;		1.15 కోట్లు<br> తూర్పు గోదావరి&nbsp;		1.20 కోట్లు<br> వైజాగ్&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			1.70 కోట్లు<br> కృష్ణ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.20 కోట్లు<br> నెల్లూరు&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			1.0 కోట్లు<br> కర్ణాటక&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			1.0 కోట్లు<br> ఉత్తర భారతం&nbsp;&nbsp;&nbsp;&nbsp;		0.20 కోట్లు<br> ఓవర్ సీస్&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;			2 కోట్లు<br><br> మొత్తం&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 21.65 కోట్లు', '2009-08-10 16:32:11', 0, 1, 9),
(53, '1', '<font class="UnicodeHeadline">భయపెట్టిన భూకంపం</font>', '', '<font class="UnicodeContent">పోర్టుబ్లేయర్ : హిందూ మహాసముద్ర గర్భంలో\nఏర్పడిన తీవ్ర భూకంపం అండమాన్ దీవులను కుదిపేసింది. దీని ప్రభావం కోస్తా\nఆంధ్ర ప్రాంతంలో కూడా కనిపించింది. శ్రీకాకుళం, విశాఖపట్నం, </font>', '<font class="UnicodeContent">విజయనగరం, కృష్ణా, ఉభయగోదావరి జిల్లాల్లోని\nఅనేక ప్రాంతాలలో భూ ప్రకంపనలను ప్రజలు గుర్తించారు. విశాఖలోని అనేక\nప్రాంతాల్లో ప్రజలు అర్ధరాత్రి ఒంటిగంటన్నర సమయంలో ఇళ్ళను వదిలి బయటకు\nపరుగులు తీశారు. రిక్టర్ స్కేలుపై 7.6 గా నమోదైన ప్రకంపనలు చాలా\nతీవ్రమైనవని భూగర్భశాస్త్ర నిపుణులు తెలిపారు. సోమవారం తెల్లవారు జామున\nఒంటిగంటన్నరకు పోర్టు బ్లేయర్ మూడు వందల కిలోమీటర్ల దూరంలో ఉత్తర దిశగా\nహిందూ మహా సముద్రంలో సుమారు 33 కిలోమీటర్లు లోతులో భూకంపం ఏర్పడిందని,\nదీని వ్యాసార్ధం 260 కిలోమీటర్లుగా ఉందని నిపుణులు చెప్పారు. <br>\n<br>\nభూకంప తీవ్రతను దృష్టిలో పెట్టుకుని అమెరికా సునామీ హెచ్చరికల కేంద్రం తీర\nప్రాంత దేశాలకు సునామీ హెచ్చరికలు చేసింది. కాని సముద్ర జలాలు నిశ్చలంగా\nఉండటంతో వాటిని ఉపసంహరించారు. భారత్, ఇండోనేషియా, థాయ్ లాండ్, బంగ్లాదేశ్\nప్రభుత్వాలు సోమవారం చాలా అప్రమత్తంగా వ్యవహరించాయి. కానీ ఎలాంటి సునామీ\nలక్షణాలు కనిపించకపోవడంతో ఊపిరి పీల్చుకున్నాయి. కాగా మొత్తం భూమి అంతా\nకదిలిపోయిందని, తాము ఇళ్ళల్లోంచి సురక్షిత ప్రదేశాలకు పరుగులు తీశామని,\nవిపరీతంగా భయపడ్డామని ఉత్తర అండమాన్ దిగ్లీపూర్ దీవికి చెందిన సుభాసిస్\nపాల్ వివరించారు. కాగా రాజమండ్రి, తిరుపతి, విజయవాడ నగరాల్లో కూడా భూమి\nకంపించిందని ప్రజలు తెలిపారు. </font>', '2009-08-11 10:42:56', 0, 0, 0),
(54, '2', '<font class="UnicodeHeadline">భయపెట్టిన భూకంపం</font>', '', '<font class="UnicodeContent">పోర్టుబ్లేయర్ : హిందూ మహాసముద్ర గర్భంలో\nఏర్పడిన తీవ్ర భూకంపం అండమాన్ దీవులను కుదిపేసింది. దీని ప్రభావం కోస్తా\nఆంధ్ర ప్రాంతంలో కూడా కనిపించింది. శ్రీకాకుళం, విశాఖపట్నం</font>', '<font class="UnicodeContent">విజయనగరం, కృష్ణా, ఉభయగోదావరి జిల్లాల్లోని\nఅనేక ప్రాంతాలలో భూ ప్రకంపనలను ప్రజలు గుర్తించారు. విశాఖలోని అనేక\nప్రాంతాల్లో ప్రజలు అర్ధరాత్రి ఒంటిగంటన్నర సమయంలో ఇళ్ళను వదిలి బయటకు\nపరుగులు తీశారు. రిక్టర్ స్కేలుపై 7.6 గా నమోదైన ప్రకంపనలు చాలా\nతీవ్రమైనవని భూగర్భశాస్త్ర నిపుణులు తెలిపారు. సోమవారం తెల్లవారు జామున\nఒంటిగంటన్నరకు పోర్టు బ్లేయర్ మూడు వందల కిలోమీటర్ల దూరంలో ఉత్తర దిశగా\nహిందూ మహా సముద్రంలో సుమారు 33 కిలోమీటర్లు లోతులో భూకంపం ఏర్పడిందని,\nదీని వ్యాసార్ధం 260 కిలోమీటర్లుగా ఉందని నిపుణులు చెప్పారు. <br>\n<br>\nభూకంప తీవ్రతను దృష్టిలో పెట్టుకుని అమెరికా సునామీ హెచ్చరికల కేంద్రం తీర\nప్రాంత దేశాలకు సునామీ హెచ్చరికలు చేసింది. కాని సముద్ర జలాలు నిశ్చలంగా\nఉండటంతో వాటిని ఉపసంహరించారు. భారత్, ఇండోనేషియా, థాయ్ లాండ్, బంగ్లాదేశ్\nప్రభుత్వాలు సోమవారం చాలా అప్రమత్తంగా వ్యవహరించాయి. కానీ ఎలాంటి సునామీ\nలక్షణాలు కనిపించకపోవడంతో ఊపిరి పీల్చుకున్నాయి. కాగా మొత్తం భూమి అంతా\nకదిలిపోయిందని, తాము ఇళ్ళల్లోంచి సురక్షిత ప్రదేశాలకు పరుగులు తీశామని,\nవిపరీతంగా భయపడ్డామని ఉత్తర అండమాన్ దిగ్లీపూర్ దీవికి చెందిన సుభాసిస్\nపాల్ వివరించారు. కాగా రాజమండ్రి, తిరుపతి, విజయవాడ నగరాల్లో కూడా భూమి\nకంపించిందని ప్రజలు తెలిపారు. </font>', '2009-08-11 10:44:22', 0, 1, 2),
(55, '2', '<font class="UnicodeHeadline">పరిశ్రమల పునరుద్ధరణ కమిటీ</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : మూతపడిన పరిశ్రమలను మళ్ళీ\nతెరిపించేందుకు ప్రభుత్వం ప్రత్యేకంగా ఒక కమిటీని వేయనున్నదని రాష్ట్ర\nభారీ పరిశ్రమల శాఖ మంత్రి కన్నా లక్ష్మీనారాయణ వెల్లడించారు. శాసనసభ </font>', '<font class="UnicodeContent">ప్రశ్నోత్తరాల సమయంలో ఖాయిలా పరిశ్రమలపై\nప్రతిపక్షాల సభ్యులు వేసిన ప్రశ్నలకు మంత్రి కన్నా సమాధానం ఇచ్చారు.\nరాష్ట్రంలో ఏర్పాటు చేయనున్న ప్రత్యేక ఆర్థిక మండళ్ళ (సెజ్) ద్వారా 62 వేల\nమందికి ఉపాధి లభిస్తుందని ఆయన వివరించారు. సెజ్ ల ఏర్పాటు కోసం రైతుల\nనుంచి భూములను ప్రభుత్వం బలవంతంగా లాక్కున్నదంటూ విపక్షాలు చేస్తున్న\nఆరోపణలను మంత్రి తోసిపుచ్చారు.<br>\n<br>\nసేద్యానికి పనికిరాని 27,900 ఎకరాలను ఇప్పటివరకూ ప్రభుత్వం సేకరించిందని\nభారీ పరిశ్రమల శాఖ మంత్రి కన్నా వివరించారు. సెజ్ లకు భూములు ఇచ్చిన రైతుల\nకోసం ప్రత్యేక ప్యాకేజ్ సిద్ధం చేస్తున్నట్లు మంత్రి స్పష్టం చేశారు.\nప్రాంతీయ భేదాలు లేకుండా రాష్ట్రంలోని అన్ని ఖాయిలా పరిశ్రమలనూ\nపునరుద్ధరించేందుకు తమ ప్రభుత్వం కార్యాచరణకు పూనుకుంటున్నట్లు ఆయన\nతెలిపారు. తెలంగాణ ప్రాంతంలో మూతబడ్డ ఒక్క పరిశ్రమను కూడా ప్రభుత్వం\nపునరుద్ధరించే చర్యలు చేపట్టలేదంటూ తెరాస సభ్యుడు టి.హరీష్ రావు చేసిన\nఆరోపణపై మంత్రి పై విధంగా సమాధానం ఇచ్చారు. పైపెచ్చు రాయలసీమపై చూపినంత\nశ్రద్ధ వైఎస్ సర్కార్ చూపించడం లేదంటూ హరీష్ రావు విమర్శించారు. తెలంగాణ\nప్రాంతంపై సర్కార్ సవతి తల్లి పాత్ర పోషించడం శోచనీయం అంటూ హరీష్ రావు\nచేసిన అభ్యంతరాలపై మంత్రి తమకు ప్రాంతీయాభిమానాలు లేవని, రాష్ట్రం\nమొత్తాన్ని ఒకేలా చూస్తుందని సమాధానం ఇచ్చారు. తెలంగాణ ప్రాంతంపై సర్కార్\nసవతి తల్లి పాత్ర పోషించడం శోచనీయం అంటూ హరీష్ రావు చేసిన అభ్యంతరాలపై\nమంత్రి మాట్లాడుతూ, ప్రభుత్వానికి ప్రాంతీయాభిమానాలు లేవని, రాష్ట్రంలోని\nఅన్ని ప్రాంతాలకూ సమాన ప్రతిపత్తి కల్పిస్తుందని సమాధానం ఇచ్చారు.</font>', '2009-08-11 10:45:45', 0, 1, 3),
(56, '5', '<font class="UnicodeHeadline">మగధీర `షాక్''తో 5గురు మృతి</font>', '', '<font class="UnicodeContent">హైదరాబాద్ : మగధీర సినిమా కోసం యువకుల తహతహ\nమరో ఐదుగురిని బలి తీసుకుంది.విజయనగరం జిల్లా సాలూరులోని లక్ష్మీ థియేటర్\nలో టిక్కెట్ల క్యూ కోసం నిర్మించిన ఇనుప</font>', '<font class="UnicodeContent">రైలింగ్ పై కరెంటు తీగలు పడటంతో షార్ట్\nసర్క్యూట్ కావడంతో ఆదివారం సాయంత్రం ఈ ప్రమాదం జరిగింది. సాయంత్రం ఆరున్నర\nగంటలకు ప్రదర్శించే మొదటి ఆట కోసం ఐదున్నరకు కౌంటర్ ను తెరిచారని, క్యూలో\nఅధిక సంఖ్యలో ఉన్న యువకులు ముందుకు తోసుకుని పోయారని, దీనిని తట్టుకోలేని\nఓ వ్యక్తి పైన ఉన్న విద్యుత్ బల్బ్ వైరును పట్టుకుని వేలాడటంతో అది\nతెగిపోయి ఇనుప రైలింగ్ పై పడటంతో దానికి ఆనుకుని ఉన్న వందలాది మంది\nవిద్యుదాఘాతానికి గరైయ్యారని ప్రత్యక్ష సాక్షులు చెబుతున్నారు.\nప్రమాదాన్ని చూసి స్పందించిన గేట్ మేన్ వెంటనే విద్యుత్ సరఫరాను నిలిపి\nవేసినా అప్పటికే ఘోరం జరిగిపోయిందని, ఐదుగురు యువకులు అక్కడికక్కడే\nమరణించారని వివరించారు.<br>\n<br>\nచనిపోయినవారిలో ముగ్గరు సాలూరు పట్టణానికి చెందిన వారు. పిన్ని\nలింగరాజు(18), రెడ్డి దుర్గ(22), పి రమేష్(24) తోపాటు పాచిపెంట మండలం\nబొబ్బిలి వలస గ్రామానికి చెందిన కాడాపు లచ్చయ్య(26), సాలూరు మండలం\nమరుపల్లి గ్రామానికి చెందిన పోతినపల్లి అప్పన్న(20) మృత్యువాత పడ్డారు.\nగాయపడిన మరోయువకుడు వడ్డాది జగదీష్ పరిస్థితి ఆందోళనకరంగా ఉందని వైద్యులు\nచెబుతున్నారు. ఇంకా చాలా మంది విద్యుత్ షాక్ కు గురయ్యారని కానీ వారు\nఅక్కడి నుంచి వెళ్ళిపోయారని అంటున్నారు.</font>', '2009-08-11 16:28:25', 0, 0, 0);
