(57, '5', '<font class="UnicodeHeadline">స్టాక్ మార్కెట్ కుదేలు</font>', '', '<font class="UnicodeContent">ముంబాయి: ద్రవ్యలోటుకు ఖచ్చితమైన\nపరిష్కారాన్ని చూపించడంలో బడ్జెట్‌ విఫలమైందన్న సాకుతో భారత స్టాక్‌\nమార్కెట్లు కుదేలయ్యాయి. దాంతో స్టాక్‌ మార్కెట్‌ మదుపుదారులు ఒక్కరోజులో\n2.54 లక్షల</font>', '<font class="UnicodeContent">కోట్ల రూపాయలను నష్టపోయారు. స్టాక్‌\nమార్కెట్‌ లో నమోదైన కంపెనీల మార్కెట్‌ కేపిటలైజేషన్‌పై ఆధారపడి నష్టాన్ని\nఅంచనా వేస్తారు. శుక్రవారం ట్రేడింగ్‌ ముగిసేనాటికి 48,77,457.38 కోట్ల\nరూపాయలుగా ఉన్న మార్కెట్‌ క్యాపిటలైజేషన్‌ బడ్జెట్‌ దెబ్బకు సోమవారం\nట్రేడింగ్‌ ముగిసే సమయానికి 2,54,153 కోట్ల రూపాయలు నష్టపోయి,\n46,23,304.34 కోట్ల రూపాయల స్థాయికి చేరింది. <br>\n<br>\nగత ఏడాది జీడీపీలో 6.2 శాతంగా ఉన్న ద్రవ్య లోటు 2010 మే నాటికి జీడీపీలో\n6.8 శాతానికి పెరుగుతుందన్న బడ్జెట్‌ అంచనా దెబ్బకు స్టాక్‌ మార్కెట్లు\nకుప్పకూలాయి. 30 షేర్ల బాంబే స్టాక్‌ ఎక్చేంజ్‌కు చెందిన సెన్సెక్స్‌\n869.65 పాయింట్లకు క్షీణించింది. మొత్తం మార్కెట్‌ కేపిటలైజేషన్‌లో 30\nసెన్సెక్స్‌ కంపెనీల కేపిటలైజేషన్‌ విలువ 46 శాతంగా ఉంది. ఆ కంపెనీల\nమార్కెట్‌ కేపిటలైజేషన్‌ విలువలో 1.23 లక్షల కోట్ల రూపాయలు నష్ట వచ్చింది.\nరిలయన్స్‌ ఇన్‌ఫ్రాస్ట్రక్చర్‌ పెద్ద ఎత్తున 12.47 శాతం నష్టపోయింది.\nఐసీఐసీఐ బ్యాంకు 10.09 శాతం నష్టపోయింది. <br>\n<br>\nజేపీ అసోసియేట్స్‌, టాటా స్టీల్‌, హెచ్‌డీఎఫ్‌సీ, లార్సన్‌ అండ్‌ టూబ్రో\nలాంటి ప్రముఖ కంపెనీలు 9-10 శాతం మధ్య నష్టపోయాయి. రిలయన్స్‌ ఇండస్ట్రీస్‌\nసంస్థ 2,98,018 కోట్ల రూపాయల మార్కెట్‌ కేపిటలైజేషన్‌తో అగ్రస్థానంలో\nనిలవగా, ఆ తర్వాత వరుసగా ఓఎన్‌జీసీ 2,28,933.95 కోట్లు, ఎన్‌టీపీసీ\n1,59,961.92 కోట్లు, ఎమ్‌ఎమ్‌టీసీ 1,49,686.75 కోట్లు, భారతి ఎయిర్‌టెల్‌\n1,48,756.27 కోట్ల రూపాయల మార్కెట్‌ కేపిటలైజేషన్‌తో అగ్రశ్రేణిలో\nనిలిచాయి. <br>\n<br>\nఎన్నో ఆశలు పెంచుకున్న మార్కెట్‌ వర్గాలు బడ్జెట్‌తో తమకు అనుకూలమైన\nప్రతిపాద నలేమీ లేకపోవడంతో తీవ్రంగా నిరాశకు లోనయ్యాయి. దాదాపు 8 ఏళ్ల\nతర్వాత బడ్జెట్‌ రోజు పతనమే భారీ స్థాయిదిగా చెప్పు కోవచ్చు. గత నెల\nరోజులుగా ఎన్నో ఊహా గానాలు వచ్చిన నేపథ్యంలో గ్రామీణ భారత ావని, మౌళిక\nరంగాలకు భారీగా ప్రాధాన్యత కల్పించడం వంటి అంశాలతో కూడిన బడ్జెట్‌\nస్టాక్‌మార్కెట్‌ను ఏమాత్రం ఉత్సాహపరచ లేకపోయింది. ఫలితంగా 5.84\nశాతం(నిఫ్టీ) వరకు ఒకే రోజులో మార్కెట్‌ పతనమైంది. బ్యాంకింగ్‌, రియాల్టీ,\nమెటల్స్‌ రంగాలకు చెందిన షేర్లు భారీగా అమ్మకాల ఒత్తిళ్లకు లోనయ్యాయి. <br>\n<br>\nదాదాపు అన్ని సూచీలు భారీగా నష్టపోగా ఎఫ్‌ఎమ్‌సీజీ సెక్టార్‌ సూచీ ఒకటే\n0.97 శాతం లాభాన్ని నమోదు చేసింది. భారీగా అంచనాలు పెంచుకున్న పెట్టుబడుల\nఉప సంహరణ విషయానికి వస్తే కేవలం రూ.1100 కోట్ల మొత్తం లక్ష్యంగా చేసుకోవడం\nమార్కెట్‌కు మింగుడుపడలేదు. అలాగే ఎస్‌టీటీ విషయంలో ఎటువంటి మార్పులు\nలేకపోవడం, విదేశీ ప్రత్యక్ష పెట్టుబడుల గురించి ప్రస్తావన లేకపోవడం వంటివి\nమార్కెట్‌ను కిందకు లాగిన అంశాలు.<br>\n<br>\nఅయితే ఇంతటి పతనం చూసి ఇన్వెస్టర్లు బెంబేలు పడనవసరం లేదు. దీర్ఘకాలిక\nఇన్వెస్టర్లు అసలు ఆలోచించనవసరం లేదు. ఇంకా చెప్పాలంటే మంచి కంపెనీలు\nతక్కువలో దొరికినట్లయితే పోర్ట్‌పోలియో లోకి చేర్చడం ఉత్తమం. నిఫ్టీ 4,150\nపాయింట్లు పైనే ముగిసింది. ఇప్పటికీ బడ్జెట్‌ అంశం పూర్త యింది. కావున\nరేపటికి యాధావిధిగా మార్కెట్ల ఫండమెంటల్స్‌, గ్లోబల్‌ మార్కెట్ల ట్రెండ్‌\nఆధారంగా కొనసాగుతాయి.<br>\n<br>\nబడ్జెట్‌ 2008-09లో నాటి ఆర్థికమంత్రి చిదంబరం ప్రవేశపెట్టిన కమోడిటీస్‌\nట్రాన్‌ సాక్షన్‌ టాక్స్‌(సీటీటీ)ను తాజా బడ్జెట్‌లో రద్దు చేస్తున్నట్లు\nఆర్థికమంత్రి ప్రణబ్‌ముఖర్జీ ప్రకటించారు. ప్రధాని ఆర్థిక సలహామండలి\nసలహామేరకు ఈ నిర్ణయం తీసుకున్నట్లు ఆయన తెలియజేశారు. అసలునాటి ప్రతి పాదన\nప్రకారం, సీటీటీ 0.017 శాతంగా పేర్కొన్నారు. అంటే ప్రతి లక్ష రూపాయల\nట్రాన్‌సాక్షన్‌కు రూ.17 చెల్లించవలసి ఉంటుంది. <br>\n<br>\nఈ పన్నును సెక్యూరిటీ ట్రాన్‌ సాక్షన్‌ టాక్స్‌ తరహాలో ప్రతిపాదించినా\nరెగ్యులేటర్లు, ఎక్స్ఛేంజీలు తీవ్రంగా వ్యతిరేకించడంతో కార్యరూపం\nదాల్చలేదు. ఇక ఎస్‌టీటీ (సెక్యూరిటీస్‌ ట్రాన్‌సాక్షన్‌ టాక్స్‌)\nవిషయానికి వస్తే 1 అక్టోబర్‌ 2004 నుండి అమల్లోకి వచ్చిన ఈ విధానం\nప్రకారం, ఇన్వెస్టర్లు గుర్తించిన ఏ స్టాక్‌ ఎక్స్ఛేంజి నుండి లావాదేవీలు\nజరిపినా ఈ విధంగా చెల్లించాల్సి ఉంటుంది.</font><br>', '2009-08-11 16:30:55', 0, 0, 0),
