(61, '5', 'నమ్మిన వాళ్లే మోసం చేశారు -చిరంజీవి', '', 'నమ్మిన వాళ్లే మోసం చేశారని , అలాంటి వాళ్ళను నమ్మటం వల్లే క్యాడార్ ను', 'నమ్మిన వాళ్లే మోసం చేశారని , అలాంటి వాళ్ళను నమ్మటం వల్లే క్యాడార్ ను\n,ప్రజాదరణ కు దూరమైనట్లు అన్నారు. పార్టీ ఆవిర్భావ సమయం లో రాజకీయ\nపరిజ్ఞానం లేని వాళ్ళను ఎన్నుకోవటం నేను చేసిన పొరపాటు అని , ప్రజారాజ్యం\nఉనికిని భరించలేని రెండు పార్టీ లు అణగదొక్కే&nbsp; ప్రయత్నం చేస్తున్నాయని\nచిరంజీవి అన్నారు .', '2009-12-03 10:52:56', 0, 1, 5),
(62, '5', 'విజయలక్ష్మి ఏకగ్రీవం గా ఎన్నిక అయినట్లే', '', 'పులివెందలలో ఉపఎన్నికకు గాను నామినేషన్ గడువు ముగిసే లోపు', 'పులివెందలలో ఉపఎన్నికకు గాను నామినేషన్ గడువు ముగిసే లోపు ఒకే ఒక్క\nనామినేసన్ దాఖలు అయ్యింది ,అదికూడా దివంగత ముఖ్యమంత్రి రాజశేఖర్ రెడ్డి\nసతీమణి విజయలక్ష్మి నామినేసన్,ఆవిడ ఏకగ్రీవం గా ఎన్నిక అయినట్లే', '2009-12-03 11:55:56', 0, 1, 19),
(63, '5', 'నాగార్జున "రమ్మి" టైటిల్ వివాదం', '', '''కేడీ'' చిత్రం టైటిల్ ను కామాక్షి కళా మూవీస్ అధినేత డి.శివప్రసాద్ రెడ్డి', '''కేడీ'' చిత్రం టైటిల్ ను కామాక్షి కళా మూవీస్ అధినేత డి.శివప్రసాద్ రెడ్డి\nసోమవారంనాడు ప్రకటించారు. ఇదే సమావేశంలో పాల్గొన్న నాగార్జున మాట్లాడుతూ,\nఈ చిత్రానికి ''రమ్మీ'' అనే టైటిల్ ను అనుకున్నామనీ, అయితే ఆ టైటిల్ వేరే\nవాళ్ల దగ్గర ఉందని తెలిసి అడిగినప్పుడు 12 లక్షలు డిమాండ్ చేశారనీ అన్నారు\n<br> రమ్మీ చిత్రం టైటిల్ కోసం పన్నెండు లక్షలు అడిగారంటూ నాగార్జున చేసిన వ్యాఖ్యలపై రమ్మీ చిత్ర నిర్మాత మండిపడుతున్నారు. <br>\nటైటిల్ ను అమ్ముకోవాల్సిన అగత్యం తమకు ఎంతమాత్రం లేదన్నారు. టైటిల్\nబిజినెస్ కోసం తాము పరిశ్రమలోకి రాలేదనీ, అమెరికాలో ,''హైనెక్ కలర్స్''\nబ్యానర్ అధినేతలు తీవ్రంగా ఖండించారు.తమకు వ్యాపార సంస్థలు, మంచి బ్యాక్\nగ్రౌండ్ ఉందని స్పష్టం చేశారు', '2009-12-03 11:59:48', 0, 1, 6),
(64, '1', 'మహా మొండిని.. అనుకున్నది సాధిస్తా: చిరంజీవి', '', 'తాను వ్యక్తిగతంగా\nమహా మొండినని, అనుకున్న లక్ష్యాన్ని సాధించేందుకు ఎన్ని ', 'తాను వ్యక్తిగతంగా\nమహా మొండినని, అనుకున్న లక్ష్యాన్ని సాధించేందుకు ఎన్ని కష్టాలనైనా\nఎదుర్కొనేందుకు సిద్ధంగా ఉన్నట్టు ప్రజారాజ్యం పార్టీ అధినేత చిరంజీవి\nప్రకటించారు. ఎలాంటి ఆధారం లేకుండా చిత్ర పరిశ్రమలో అడుగుపెట్టినపుడు\nఎన్నో అవమానాలు, చీదరింపులు, ఛీత్కారాలు ఎదురయ్యాయని గుర్తు చేశారు.\nఅయినప్పటికీ.. సినీ రంగంలో తన లక్ష్యాన్ని సాధించడానికి పట్టుదలతో\nశ్రమించి, చివరకు అనుకున్న లక్ష్యాన్ని చేరుకున్నట్టు ఆయన తెలిపారు.అలాగే,\nపటిష్టమైన గేమ్‌తో ప్రజల ముందుకు వచ్చి, మార్పు తీసుకువచ్చి రాజకీయ రంగంలో\nకూడా సక్సెస్‌ను చవి చూస్తానని ఆయన ధీమా వ్యక్తం చేశారు. తన సొంత\nనియోజకవర్గంలో ఆయన పర్యటిస్తున్నారు. శ్రీ వేంకటేశ్వర విశ్వవిద్యాలయం\nశ్రీనివాస ఆడిటోరియంలో మదర్‌ థెరిస్సా ప్రతిభా పురస్కార మహోత్సవ సభ\nగురువారం జరిగింది. ఈ కార్యక్రమానికి చిరంజీవి ముఖ్య అతిథిగా పాల్గొని\nప్రతిభావంతులకు బహుమతులను ప్రదానం చేశారు.<br>ఈ\nసందర్భంగా చిరంజీవి ప్రసంగిస్తూ.. సినీ రంగంలో ఎదగడానికి క్రమశిక్షణతో\nపట్టుదలతో కృషిచేసి ప్రజల అభిమానంతో మెగాస్టార్‌ స్థాయికి ఎదిగినట్టు\nచెప్పారు. తనకు వచ్చిన అవకాశాలను ఎలా అందిపుచ్చుకుని గమ్యాన్ని ఎలా\nచేరుకోవాలనే అనునిత్యం ఆలోచన చేస్తుండేవాడినని చెప్పారు.<br><br>అలాగే,\nరాజకీయ రంగంలో తాను వేసిన తొలి అడుగులు తప్పుగా పడినట్టు చెప్పారు. ఇవి\nతెలియక వేసిన తప్పటడుగులని చిరంజీవి అన్నారు. ఏది ఏమైనా.. రాజకీయాల్లో\nతాను నిర్ధేశించుకున్న లక్ష్యాన్ని మాత్రం చేరుకునేందుకు చమటోడ్చేందుకు\nసిద్ధంగా ఉన్నట్టు చిరంజీవి ప్రకటించారు. ', '2009-12-04 17:22:31', 0, 1, 0),
(66, '3', 'సోనియాకు లేఖ: తెలంగాణ మంత్రుల నిర్ణయం', '', 'హైదరాబాద్: తెలంగాణ పరిణామాలపై తమ కాంగ్రెసు పార్టీ అధ్యక్షురాలు ', 'హైదరాబాద్: తెలంగాణ పరిణామాలపై తమ కాంగ్రెసు పార్టీ అధ్యక్షురాలు సోనియా\nగాంధీకి లేఖ రాయాలని తెలంగాణ మంత్రులు నిర్ణయించుకున్నారు. సోనియా నిర్ణయం\nప్రకారం నడుచుకుంటామని వారు సోనియాకు తెలియజేయాలని అనుకుంటున్నారు.\nతెలంగాణ విద్యార్థుల ఆందోళన నేపథ్యంలో తెలంగాణ మంత్రుల ముందటి కాళ్లకు\nబంధాలు వేసినట్లయింది. విద్యార్థులకు నచ్చజెప్పే ప్రయత్నం\nచేస్తున్నప్పటికీ ఫలితం కనిపించడం లేదు. మంత్రుల ఇళ్లను విద్యార్థులు\nముట్టిడిస్తున్నారు. తెలంగాణపై తాము కూడా దో ఒకటి చేస్తున్నామని\nఅనిపించుకోవడానికి వారు ఇప్పుడు ప్రయత్నాలు చేస్తున్నారు. హోం\nమంత్రి సబితా ఇంద్రారెడ్డి శనివారం ఉదయం ముఖ్యమంత్రి కె.రోశయ్యతో సమావేశమై\nతెలంగాణ పరిణామాలపై చర్చించారు. ఆ తర్వాత తెలంగాణ మంత్రులతో ఆమె\nసమావేశమయ్యారు. మళ్లీ రెండో సారి కూడా తెలంగాణ మంత్రులు సమావేశమయ్యారు.\nరెండు గంటల పాటు ఈ సమావేశం జరిగింది. తెలంగాణ విషయంలో తాము ఏ విధంగా\nముందుకు సాగాలనే విషయంలో వారు తీవ్ర అయోమయంలో ఉన్నట్లు కనిపిస్తున్నారు.\nతెలంగాణ మంత్రులు శుక్రవారం రాత్రి పిసిసి అధ్యక్షుడు డి. శ్రీనివాస్ తో\nసమావేశమయ్యారు. తెలంగాణ అంశాన్ని తాము సోనియా గాంధీకి విన్నవిస్తానని\nడిఎస్ చెప్పినట్లు మంత్రి సునీతా లక్ష్మారెడ్డి చెప్పారు. తాము కూడా\nతెలంగాణ కోసం కృషి చేస్తున్నామని మంత్రి కోమటి రెడ్డి వెంకటరెడ్డి\nచెప్పారు. ఈ స్థితిలో సోనియాకు లేఖ రాయాలని తెలంగాణ మంత్రులు\nనిర్ణయించుకున్నారు.', '2009-12-05 15:11:48', 0, 0, 0),
(67, '6', 'కంట తడి పెడుతున్న తెరాస నేతలు', '', 'హైదరాబాద్: తెలంగాణ రాష్ట్ర సమితి (తెరాస) శ్రేణుల్లో తీవ్ర విషాదం చోటు\nచేసుకుంది. ', 'హైదరాబాద్: తెలంగాణ రాష్ట్ర సమితి (తెరాస) శ్రేణుల్లో తీవ్ర విషాదం చోటు\nచేసుకుంది. తమ నేత కె. చంద్రశేఖర రావు ఆరోగ్య పరిస్థితిపై తెరాస నాయకులు,\nకార్యకర్తలు తీవ్ర ఆందోళనకు గురవుతున్న సూచనలు కనిపిస్తున్నాయి. తెరాస\nనాయకులు కంట తడి పెడుతున్నారు. తీవ్రమైన విషాదంతో తెరాస నాయకుల్లో గంభీర\nవాతావరణ చోటు చేసుకుంది. తెరాస శాసనసభ్యుడు హరీష్ రావు కంట పెట్టారు.\nదుఖ్కంతో ఆయన మీడియాతో కూడా మాట్లాడలేకపోయారు. తెరాస శాసనసభా పక్ష నాయకుడు\nఈటెల రాజేందర్ తీవ్రంగా కంట తడిపెట్టారు. బలవంతంగా దుఖ్కాన్ని\nఆపుకుంటున్నారు.<br><br> కెసిఆర్ ఆరోగ్య పరిస్థితిపై తీవ్రమైన ఆందోళన\nనెలకొన్న వాతావరణంలోనే కెసిఆర్ దీక్ష విరమించినా తమకు అభ్యంతరం లేదని\nతెలంగాణ విద్యార్థి సంఘాల సంయుక్త కార్యాచరణ సమితి (జెఇసి) నాయకులు\nప్రకటించారు. కెసిఆర్ దీక్ష విరమిస్తే బాగుండుననే వాతావరణం తెరాస\nవర్గాల్లో కూడా చోటు చేసుకుంది. గంభీర వాతావరణం నెలకొనడంతో భవిష్యత్తు\nకార్యాచరణను ఖరారు చేసుకోవడానికి తెరాస పోలిట్ బ్యూరో అత్యవసరంగా\nసమావేశమవుతోంది. అందుబాటులో ఉన్న పొలిట్ బ్యూరో సభ్యులు, సీనియర్ నేతలు\nవెంటనే పార్టీ కార్యాలయానికి రావాలని ఈటెల రాజేందర్ విజ్ఞప్తి చేశారు.<br><br>\nకాగా, విద్యార్థులు ఆత్మహత్యలకు పాల్పడవద్దని కెసిఆర్ తనయుడు, శాసనసభ్యుడు\nకెటి రామారావు విజ్ఞప్తి చేశారు. తాను ఈ విజ్ఞప్తి చేయడానికే బయటకు\nవచ్చానని ఆయన చెప్పారు. దండం పెడుతున్నానని, ఆత్మహత్యలు చేసుకోవద్దని ఆయన\nకోరారు. కెటిఆర్ కూడా తీవ్ర విషాదంలో మునిగిపోయి ఉన్నట్లు కనిపించారు.', '2009-12-05 15:35:13', 0, 0, 0),
(68, '1', 'భారత్ లో గూగుల్ నిషేధానికి డిమాండ్', '', 'న్యూఢిల్లీ: ఇంటర్నెట్‌ సెర్చింజన్‌ గూగుల్‌ను భారత్‌లో నిషేధించాలని\nబుధవారం సిపిఎం ', 'న్యూఢిల్లీ: ఇంటర్నెట్‌ సెర్చింజన్‌ గూగుల్‌ను భారత్‌లో నిషేధించాలని\nబుధవారం సిపిఎం నేత బృందాకరత్‌ కేంద్రాన్ని డిమాండ్‌ చేసారు. లింగ నిర్థరణ\nపరీక్షలకు సంబంధించిన సమాచారం నెట్‌లో ఉంచుతూ ఇక్కడి చట్టాలను గూగుల్‌\nయథేచ్చగా ఉల్లంఘిస్తోందని ఆమె మండిపడ్డారు.<br><br> ఈ విషయంలో ఇదివరకు\nభారత్‌ ఒకసారి గూగుల్‌ యాజమాన్యాన్ని హెచ్చరించిన విషయాన్ని బృందాకరత్‌\nగుర్తుచేసారు. గూగుల్‌ భారత విభాగం అధిపతిని తక్షణమే అరెస్టు చేసి ఈ\nఅంశంపై విచారణ జరపాలని బృందాకరత్‌ డిమాండ్‌ చేసారు.', '2009-12-05 16:02:10', 1, 0, 0),
(69, '7', 'ఎన్టీ రామారావు విగ్రహాలపై దాడులు', 'mixed tastes for congress last year', 'హైదరాబాద్: తెలంగాణ ఉద్యమం మాజీ ముఖ్యమంత్రి స్వర్గీయ ఎన్టీ రామారావు\n', 'హైదరాబాద్: తెలంగాణ ఉద్యమం మాజీ ముఖ్యమంత్రి స్వర్గీయ ఎన్టీ రామారావు\nవిగ్రహాలను లక్ష్యంగా ఎంచుకుంది. ఇప్పటి వరకు కాసు బ్రహ్మానంద రెడ్డి,\nపొట్టి శ్రీరాములు విగ్రహాలనే ధ్వంసం చేసిన ఆందోళనకారులు ఇప్పుడు ఎన్టీ\nరామారావు విగ్రహాలపై కూడా దాడి పూనుకుంటున్నారు. అంధ్ర పేర్లను తెలంగాణ\nపేర్లుగా మారుస్తూ నిరసన వ్యక్తం చేస్తున్నారు. తాజాగా ఎన్టీ రామారావు\nవిగ్రహాలపై దాడులు జరిగాయి.<br><br> రంగారెడ్డి జిల్లా వికారాబాదులోని\nఎన్టీఆర్ విగ్రహానికి ఆందోళనకారులు నల్ల రంగు పూశారు. దీన్ని తెలుగుదేశం\nపార్టీ నాయకులు నిరసిస్తున్నారు. తెలంగాణ స్థానికులకు ప్రయోజనం\nచేకూర్చడానికి 610ను జారీ చేసింది ఎన్టీ రామారావు ప్రభుత్వమేనని, తమ\nపార్టీ కూడా తెలంగాణకు అనుకూలంగా ఉందని, ఈ స్థితిలో ఎన్టీఆర్ విగ్రహాలను\nలక్ష్యం చేసుకోవడం సరి కాదని వారంటున్నారు. హైదరాబాదులోని మౌలాలిలో\nఎన్టీఆర్ విగ్రహంపై ఆందోళకారులు దాడి చేశారు. ఆ దాడిలో ఎన్టీఆర్ విగ్రహం\nచేయి విరిగింది.', '2009-12-05 16:19:19', 1, 0, 9),
(70, '1', 'గ్రేటర్ హైదరాబాద్'' ఒకరబ్బ సొత్తు కాదు: మంత్రి దానం', '', 'రాష్ట్ర రాజధాని\nహైదరాబాద్ ఒకరి ఆస్తి కాదని రాష్ట్ర వైద్య ఆరోగ్య శాఖామంత్రి, గ్రేటర్\nహైదరాబాద్ కాంగ్రెస్ అధ్యక్షుడు దానం నాగేందర్ అభిప్రాయపడ్డారు. తెలంగాణను\nవిడగొట్టే ముందు గ్రేటర్ హైదరాబాద్‌ను కేంద్రపాలిత ప్రాంతంగా\nప్రకటించాల్సిందేనని ఆయన డిమాండ్ చేశారు. ఇదే అంశంపై ఆయన పార్టీ అధినేత్రి\nసోనియా గాంధీ లేఖ రాశారు. ఆయనతో పాటు మరో మంత్రి ముఖేష్ గౌడ్ కూడా లేఖ\nపంపారు. ', 'రాష్ట్ర రాజధాని\nహైదరాబాద్ ఒకరి ఆస్తి కాదని రాష్ట్ర వైద్య ఆరోగ్య శాఖామంత్రి, గ్రేటర్\nహైదరాబాద్ కాంగ్రెస్ అధ్యక్షుడు దానం నాగేందర్ అభిప్రాయపడ్డారు. తెలంగాణను\nవిడగొట్టే ముందు గ్రేటర్ హైదరాబాద్‌ను కేంద్రపాలిత ప్రాంతంగా\nప్రకటించాల్సిందేనని ఆయన డిమాండ్ చేశారు. ఇదే అంశంపై ఆయన పార్టీ అధినేత్రి\nసోనియా గాంధీ లేఖ రాశారు. ఆయనతో పాటు మరో మంత్రి ముఖేష్ గౌడ్ కూడా లేఖ\nపంపారు. <br><br>ఈ\nలేఖలపై గ్రేటర్ హైదరాబాద్ పరిధికి చెందిన ఏడుగురు కాంగ్రెస్ ఎమ్మెల్యేలు\nసంతకాలు చేసినట్టు వినికిడి. ముఖ్యమంత్రి రోశయ్యతో మంత్రులు దానం,\nముఖేష్‌గౌడ్‌లు బుధవారం ఉదయం సమావేశమయ్యారు. ఈ సందర్భంగా వారు తెలంగాణ\nఅంశంపై చర్చించారు. ఆ తర్వాత తమ వాదనను వారు ముఖ్యమంత్రికి వినిపించారు.\nఆయన అనుమతితో పార్టీ అధినేత్రి సోనియాకు లేఖ రాశారు. <br><br>ఈ\nసందర్భంగా మంత్రి దానం మాట్లాడుతూ హైదరాబాద్‌ తెలంగాణ ప్రజల ఒక్కరి ఆస్తి\nకాదన్నారు. ఇక్కడ కోట్లాది మంది ఆంధ్ర, రాయలసీమ, ఇతర ప్రాంతాలకు చెందిన\nవారు ఉన్నారన్నారు. వీరందరి భవిష్యత్, సంక్షేమాన్ని దృష్టిలో ఉంచుకుని\nగ్రేటర్ హైదరాబాద్‌ను కేంద్ర పాలిత ప్రాంతంగా ప్రకటించాలని విజ్ఞప్తి\nచేశారు. అవసరమైతే ఇదే విషయంపై తాము ఆందోళన చేపట్టేందుకు సైతం సిద్ధంగా\nఉన్నట్టు వారు ప్రకటించారు.', '2009-12-09 17:31:00', 1, 0, 0),
(71, '2', 'కేసీఆరూ.. ఇక దీక్ష విరమించు: రోశయ్య విజ్ఞప్తి', '', 'ప్రత్యేక తెలంగాణ\nసాధన కోసం ఆమరణ దీక్ష కొనసాగిస్తున్న తెలంగాణ రాష్ట్ర సమితి అధ్యక్షుడు\nకె. చంద్రశేఖర రావు తక్షణమే దీక్షను విరమించాలని రాష్ట్ర ముఖ్యమంత్రి కె.\nరోశయ్య విజ్ఞప్తి చేశారు. ప్రత్యేక తెలంగాణపై చర్చకు శుక్రవారం సభలో ఆమోదం\nలభించిన పరిస్థితుల్లో కేసీఆర్ దీక్ష విరమించాలని రోశయ్య కోరారు.', 'ప్రత్యేక తెలంగాణ\nసాధన కోసం ఆమరణ దీక్ష కొనసాగిస్తున్న తెలంగాణ రాష్ట్ర సమితి అధ్యక్షుడు\nకె. చంద్రశేఖర రావు తక్షణమే దీక్షను విరమించాలని రాష్ట్ర ముఖ్యమంత్రి కె.\nరోశయ్య విజ్ఞప్తి చేశారు. ప్రత్యేక తెలంగాణపై చర్చకు శుక్రవారం సభలో ఆమోదం\nలభించిన పరిస్థితుల్లో కేసీఆర్ దీక్ష విరమించాలని రోశయ్య కోరారు.<br><br>రాజకీయ\nనాయకుడైన కేసీఆర్ ప్రాణాలు కాపాడే బాధ్యత ప్రభుత్వం మీద ఉంది కాబట్టి..\nకేసీఆర్ దీక్షకు స్వస్తి చెప్పాలని రోశయ్య అన్నారు. అలాగే ఎలాంటి విధ్వంసక\nచర్యలు జరగకుండా చూసుకునే బాధ్యత కూడా ప్రభుత్వంపైనే ఉందనే విషయాన్ని కూడా\nకేసీఆర్ అర్థం చేసుకోవాలని సీఎం సూచించారు. బంద్‌లు, విధ్వంసాలు జరిగితే\nనష్టం ఎవరికని? ఆయన ప్రశ్నించారు. తెలంగాణ ఇప్పటికిప్పుడే అయ్యే పనికాదు..\nశాంతియుతంగా ఉద్యమాన్ని నడిపించాలని రోశయ్య పేర్కొన్నారు. <br><br>ఇదే\nవిధంగా.. స్పీకర్ కిరణ్‌కుమార్ రెడ్డి తెరాస నేతలను ఉద్దేశించి\nమాట్లాడారు. ఇప్పటికే వైఎస్సార్ లాంటి మంచి నేతను పోగొట్టుకున్నాం. అలాగే\nఎన్నో ఏళ్లుగా రాజకీయాల్లో ఉండి, మంచి నాయకుడిగా పేరుపొందిన తెరాస అధినేత\nకేసీఆర్‌ను పోగొట్టుకోవడం ఇష్టంలేదని అన్నారు. అందుచేత కేసీఆర్ తక్షణమే\nఆమరణ నిరాహార దీక్షను విరమించాలని విజ్ఞప్తి చేశారు.', '2009-12-09 17:48:54', 1, 0, 0),
(72, '3', 'లాడెన్ ఉన్నత వరకు అల్‌ఖైదాను ఓడించలేం: యూఎస్ ', '', 'అంతర్జాతీయ\nమోస్ట్‌వాంటెడ్ తీవ్రవాది బిన్ లాడెన్ సజీవంగా ఉన్నంత వరకు అల్‌ఖైదాను\nఓడించలేమని ఆఫ్ఘనిస్థాన్‌లో పని చేస్తున్న అమెరికాకు చెందిన టాప్ మిలిటరీ\nకమాండర్ ఒకరు అభిప్రాయపడ్డారు. అందువల్ల లాడెన్‌ను సజీవంగా పట్టుకోవడమా\nలేదా హతమార్చడమా ఏదో ఒకటి చేయాల్సి వుందన్నారు. అంతవరకు అల్‌ఖైదా సంస్థను\nనిర్వీర్యం చేయలేమని కమాండర్ చెప్పడం గమనార్హం', 'అంతర్జాతీయ\nమోస్ట్‌వాంటెడ్ తీవ్రవాది బిన్ లాడెన్ సజీవంగా ఉన్నంత వరకు అల్‌ఖైదాను\nఓడించలేమని ఆఫ్ఘనిస్థాన్‌లో పని చేస్తున్న అమెరికాకు చెందిన టాప్ మిలిటరీ\nకమాండర్ ఒకరు అభిప్రాయపడ్డారు. అందువల్ల లాడెన్‌ను సజీవంగా పట్టుకోవడమా\nలేదా హతమార్చడమా ఏదో ఒకటి చేయాల్సి వుందన్నారు. అంతవరకు అల్‌ఖైదా సంస్థను\nనిర్వీర్యం చేయలేమని కమాండర్ చెప్పడం గమనార్హం. <br><br>దీనిపై\nఆయన మాట్లాడుతూ.. లాడెన్ పట్టుకోవడమా లేదా హతమార్చడం జరిగితేనే అల్‌ఖైదాను\nలేకుండా చేయగలుగుతామన్నారు. అప్పటి వరకు అల్‌ఖైదాను ఓడించడం అసాధ్యమని\nతాను భావిస్తున్నట్టు జనరల్ స్టాన్లీ మెక్‌క్రిస్టల్ అభిప్రాయపడ్డారు. <br><br>ప్రపంచ\nవ్యాప్తంగా ఉన్న అల్‌ఖైదా తీవ్రవాదులకు లాడెన్ ఒక ఐకాన్ లాంటి వ్యక్తి.\nఅందువల్ల అతన్ని హతం చేయడమో లేదా సజీవంగా పట్టుకోవడమో జరిగి తీరాలన్నారు.\nఇది అమెరికా ప్రజలకు ఎంతో ముఖ్యం. 2001, సెప్టెంబరు 11న జరిగిన దాడుల్లో\nవేలాది మందిని హతం చేసిన నేరానికి గాను లాడెన్‌ను చట్టం ముందు\nనిలబెట్టాల్సిన అవసరం ఎంతైనా ఉందన్నారు', '2009-12-09 17:51:51', 1, 0, 0),
(73, '1', 'తెలంగాణ కోసం త్యాగం చేసిన డిఎస్పీ నళిని కథ', '', 'వరంగల్: ఆఖరు బంతి సిక్సర్ గా మారి మ్యాచ్ గెలించినట్టయింది డిఎస్పీ నళిని ఉదంతం. <span style="border-bottom: 1px dotted #120FFF; color: #120FFF;" class="hi_kw_0 hi_link">తెలంగాణ <img class="hi_kw_0 hi_icon" src="http://cache2.hover.in/hi_link.gif" style="border: 0px none ;" alt="[^]" height="10px" width="10px"></span>\nరాష్ట సాధన కోసం డిఎస్పీ ఉద్యోగానికి ఆమె రాజీనామా చేసిన కొన్ని గంటల్లోనే\nప్రత్యేక తెలంగాణ ప్రకటన వెలువడడం విశేషం. ఈ విధంగా నళిని చరిత్ర\nపుటల్లోకి ఎక్కారు. మెదక్‌ డీఎస్పీ దోమకొండ నళిని బుధవారం రాజీనామా ప్రకటన\nచేయడం ఓరుగల్లులో కలకలం సృష్టించింది. ఈ విషయం ఇటు పోలీసు, అటు సామాన్య\nవర్గాల ప్రజలను ఆలోచనలో పడేసింది.', 'వరంగల్: ఆఖరు బంతి సిక్సర్ గా మారి మ్యాచ్ గెలించినట్టయింది డిఎస్పీ నళిని ఉదంతం. <span style="border-bottom: 1px dotted #120FFF; color: #120FFF;" class="hi_kw_0 hi_link">తెలంగాణ <img class="hi_kw_0 hi_icon" src="http://cache2.hover.in/hi_link.gif" style="border: 0px none ;" alt="[^]" height="10px" width="10px"></span>\nరాష్ట సాధన కోసం డిఎస్పీ ఉద్యోగానికి ఆమె రాజీనామా చేసిన కొన్ని గంటల్లోనే\nప్రత్యేక తెలంగాణ ప్రకటన వెలువడడం విశేషం. ఈ విధంగా నళిని చరిత్ర\nపుటల్లోకి ఎక్కారు. మెదక్‌ డీఎస్పీ దోమకొండ నళిని బుధవారం రాజీనామా ప్రకటన\nచేయడం ఓరుగల్లులో కలకలం సృష్టించింది. ఈ విషయం ఇటు పోలీసు, అటు సామాన్య\nవర్గాల ప్రజలను ఆలోచనలో పడేసింది.<br><br> ప్రత్యేక తెలంగాణ సాధన కోసం\nవివిధ వర్గాల ప్రజలు చేస్తున్న ఉద్యమానికి మద్దతు తెలిపిన నళిని\nమెట్టినిల్లు వరంగల్‌ జిల్లా. నల్గొండ జిల్లా భువనగిరికి చెందిన నళినికి\nజిల్లాలోని ఆత్మకూరు మండలం ఉల్లిగడ్డ దామెరకు చెందిన నరేందర్‌తో వివాహం\nజరిగింది. నరేందర్‌ ప్రభుత్వ ఉపాధ్యాయుడు. కాగా, ఈయన పాలకుర్తి ఎమ్మెల్యే\nఎర్రబెల్లి దయాకర్‌రావు వద్ద ప్రస్తుతం పీఏగా పనిచేస్తున్నారు. ఎంకాం,\nబీఈడీ, పీజీడీసీఏ, డిప్లొమా ఇన్‌ ఫార్మసీ పూర్తి చేసిన నళిని 2006లో\nపరకాలలో హాస్టల్‌ వెల్ఫేర్‌ ఆఫీసర్‌గా ఉద్యోగం పొందారు. అనంతరం 2007\nగ్రూప్‌-1 ద్వారా డీఎస్పీగా ఎంపికయ్యారు.<br><br> అప్పాలో శిక్షణ పొందిన\nనళిని కొద్దిరోజులు మామునూరు ఫోర్త్‌ బెటాలియన్‌లో శిక్షణ పొందారు. నళిని\nడీఎస్పీగా హన్మకొండ, హసన్‌పర్తి పోలీస్‌ స్టేషన్లలో మూడు వారాలపాటు\nప్రొబేషనరీ విధులు నిర్వర్తించారు. ఆ తర్వాత ఆమెను కరీంనగర్‌ డీఎస్పీగా\nనియమిస్తూ ప్రభుత్వం ఉత్తర్వులు జారీ చేసింది. అనంతరం కొద్ది రోజులకే\nనళిని మెదక్‌ డీఎస్పీగా బదిలీ అయ్యారు. ప్రస్తుతం మెదక్‌ డీఎస్పీగా\nకొనసాగుతున్న ఆమె తెలంగాణ ఉద్యమానికి మద్దతు తెలుపుతూ, పోలీసు శాఖలో ఆంధ్ర\nఅధికారుల నిరంకుశ పెత్తనాన్ని వ్యతిరేకిస్తూ సంచలనం సృష్టించారు.<br><br>\nడీఎస్పీ ఉద్యోగానికి రాజీనామా చేసి తెలంగాణ ఉద్యమానికి మద్దతు పలికిన\nనళిని నిర్ణయం పట్ల జిల్లా ప్రజలు హర్షం వ్యక్తం చేస్తున్నారు. ఆమె\nరాజీనామా ప్రకటన మీడియాలో రావడంతో కేయూలో దీక్ష చేస్తున్న విద్యార్థులు,\nజేఏసీ నేతలు ఆనందం వ్యక్తం చేశారు. ఆమె జిల్లాకు వస్తే అభినందన సభ ఏర్పాటు\nచేసి ఘనంగా సన్మానిస్తామని జేఏసీ, వివిధ సంఘాల నేతలు ప్రకటించారు.<br><br>\nపోలీసు శాఖలో ఆంధ్ర అధికారుల అరాచకాలను నిరసిస్తూ డీఎస్పీ ఉద్యోగానికి\nనళిని రాజీనామా చేయడంతో జిల్లా మేరు సంఘం హర్షం వ్యక్తం చేసింది. రాజీనామా\nచేసిన నళిని మేరు కులస్తురాలు కావడంతో గర్వపడుతున్నామని సంఘం జిల్లా\nఅధ్యక్షుడు బోల కొండ రవితేజ, పట్టణ అధ్యక్షుడు ఒడ్డెపల్లి వేణుగోపాల్‌ ఒక\nప్రకటనలో పేర్కొన్నారు.', '2009-12-10 10:44:32', 1, 0, 14);
