(74, '2', 'తెలంగాణ రాష్ట్ర ఏర్పాటు ప్రక్రియ ప్రారంభం: చిదంబరం ', '', 'ఎట్టకేలకు కేంద్ర\nప్రభుత్వం మెట్టుదిగింది. ప్రత్యేక తెలంగాణ రాష్ట్ర ఏర్పాటుకు పచ్చజెండా\nఊపింది. కాంగ్రెస్ కోర్ కమిటీ పలు దఫాలుగా చర్చలు జరిపి ఓ నిర్ణయానికి\nవచ్చింది. చివరకు బుధవారం రాత్రి 11.30 గంటలకు కేంద్ర హోంశాఖామంత్రి\nచిదంబరం విలేకరుల ముందుకు వచ్చి తెలంగాణ ప్రక్రియ ప్రారంభిస్తామని\nప్రకటించారు', 'ఎట్టకేలకు కేంద్ర\nప్రభుత్వం మెట్టుదిగింది. ప్రత్యేక తెలంగాణ రాష్ట్ర ఏర్పాటుకు పచ్చజెండా\nఊపింది. కాంగ్రెస్ కోర్ కమిటీ పలు దఫాలుగా చర్చలు జరిపి ఓ నిర్ణయానికి\nవచ్చింది. చివరకు బుధవారం రాత్రి 11.30 గంటలకు కేంద్ర హోంశాఖామంత్రి\nచిదంబరం విలేకరుల ముందుకు వచ్చి తెలంగాణ ప్రక్రియ ప్రారంభిస్తామని\nప్రకటించారు. <br><br>ఆంధ్రప్రదేశ్‌\nరాష్ట్ర అసెంబ్లీలో ఈ మేరకు తీర్మానం చేయాల్సిందిగా ముఖ్యమంత్రి రోశయ్యను\nఆదేశించినట్లు తెలిపారు. అదేవిధంగా ఈ ఉద్యమంలో భాగంగా తెరాస నేతలు,\nవిద్యార్థులపై పెట్టిన కేసులను ఎత్తివేస్తామని తెలిపారు.<br><br>ఇదే\nవిషయాన్ని టిఆర్‌ఎస్‌ అధినేత కేసీఆర్‌కు తెలియజేసి, ఆయన ఆమరణదీక్షను\nవిరమింపజేసేందుకు ముఖ్యమంత్రి రోశయ్య ఢిల్లీ నుంచి నేరుగా హైదరాబాద్‌\nనిమ్స్‌ ఆసుపత్రికి చేరుకోనున్నారు. అలాగే, తెరాస నాయకులు, విద్యార్థులు,\nఇతర సంఘాల నాయకులపై బనాయించిన కేసులన్నీ తక్షణం ఉపసంహరించుకోవాలని కూడా\nముఖ్యమంత్రిని ఆదేశించినట్లు చిదంబరం స్పష్టం చేశారు. <br><br>కేసీఆర్‌\nకోరిక నెరవేరినందువల్ల ఆయన వెంటనే దీక్ష విరమించాలని కేంద్ర ప్రభుత్వం\nతరపున కోరుతున్నట్లు, అలాగే విద్యార్థులు కూడా తాము రేపు తలపెట్టిన\nశాంతియాత్రను కూడా విరమించుకోవాలని చిదంబరం విజ్ఞప్తి చేశారు. ', '2009-12-10 10:48:56', 1, 0, 11),
(75, '1', 'లగడపాటిని నిమ్స్ నుంచి తరలిస్తారా?', 'lagadapati', 'హైదరాబాద్: విజయవాడ ప్రభుత్వాస్పత్రి నుంచి వచ్చిన కాంగ్రెసు పార్లమెంటు\nసభ్యుడు లగడపాటి రాజగోపాల్ ను ఎక్కువ రోజులు హైదరాబాదులో ఉంచే అవకాశాలు\nలేవని తెలుస్తోంది. హైదరాబాద్ నుంచి లగడపాటిని తరలించాలని ప్రభుత్వం\nఆలోచిస్తున్నట్లు సమాచారం. ఆయనను విజయవాడ ఆస్పత్రికి గానీ', 'హైదరాబాద్: విజయవాడ ప్రభుత్వాస్పత్రి నుంచి వచ్చిన కాంగ్రెసు పార్లమెంటు\nసభ్యుడు లగడపాటి రాజగోపాల్ ను ఎక్కువ రోజులు హైదరాబాదులో ఉంచే అవకాశాలు\nలేవని తెలుస్తోంది. హైదరాబాద్ నుంచి లగడపాటిని తరలించాలని ప్రభుత్వం\nఆలోచిస్తున్నట్లు సమాచారం. ఆయనను విజయవాడ ఆస్పత్రికి గానీ గుంటూరు జిల్లా\nమంగళగిరి ఎన్నారై ఆస్పత్రికి గానీ తరలించే అవకాశాలున్నట్లు తెలుస్తోంది.\nవిజయవాడ నుంచి మంగళగిరికి తరలించే ప్రయత్నాలు జరుగుతున్న సమయంలోనే ఆయన\nపోలీసుల కళ్లు గప్పి విజయవాడ నుంచి తప్పించుకుని హైదరాబాదులోని నిమ్స్&nbsp;\nకు వచ్చారు. నిమ్స్ లో ఆయన మిలీనియం బ్లాక్ లో ప్రస్తుతం చికిత్స\nపొందుతున్నారు. ఆయన సోమవారం నిమ్స్ లో ఇంతకు తెలంగాణ రాష్ట్ర సమితి\n(తెరాస) అధ్యక్షుడు కె. చంద్రశేఖర రావు చేరిన గదిలోనే చేరారు. ఆ తర్వాత\nఆయనను మిలీనియం బ్లాక్ కు చేర్చారు.<br><br> కాగా, లగడపాటి రాజగోపాల్\nరావడంతో నిమ్స్ వద్ద తీవ్ర ఉద్రిక్త పరిస్థితులు నెలకొన్నాయి. లగడపాటికి\nవ్యతిరేకంగా తెలంగాణవాదులు నినాదాలు చేశారు. లగడపాటి గోబ్యాక్ అంటూ\nనినాదాలు చేశారు. దీంతో నిమ్స్ వద్ద భారీ బందోబస్తు ఏర్పాటు చేశారు.\nనిమ్స్ వద్ద భద్రతా బాధ్యతలను ఐపియస్ అధికారి సురేంద్రబాబుకు అప్పగించారు.\nతెలంగాణవాదులను రెచ్చగొట్టే ఉద్దేశంతోనే లగడపాటి హైదరాబాదుకు వచ్చినట్లు\nభావిస్తున్నారు. ఆయనను నిమ్స్ నుంచి వేరే ప్రాంతానికి తరలించాలని\nకాంగ్రెసు తెలంగాణ నాయకులు కూడా కోరుతున్నారు. పైగా, వైయస్\nవివేకానందరెడ్డి, దేవినేని ఉమా మహేశ్వర రావులాంటి సమైక్యాంధ్ర\nఆందోళనకారులను కూడా నిమ్స్ కు తరలించాలనే డిమాండ్ వస్తోంది. దీంతో\nలడపాటిని మరో ప్రాంతానికి తరలించడమే భద్రతా కారణాల రీత్యా మంచిదనే భావన\nవ్యక్తమవుతోంది.', '2009-12-22 11:20:01', 0, 0, 2),
(76, '3', 'మిస్‌ వరల్డ్‌గా ఎంపికైన జబ్రాల్టర్‌ సుందరి', '', 'జబ్రాల్టర్‌ సుందరి ఈసారి ప్రపంచ సుందరి కిరీటం ఎత్తుకుపోయింది. మిస్‌\nజిబ్రాల్టర్‌ కియానే ఆల్డోరినో 2009 సంవత్సరానికి గాను ఈ అవార్డును\nగెలుచుకుంది. 22 ఏళ్ల కియానే హెచ్‌ఆర్‌ శాఖలో క్లర్కుగా పనిచేస్తోంది.\nమిస్‌ ఇండియా వరల్డ్‌ పూజా చోప్రా సహా', 'జబ్రాల్టర్‌ సుందరి ఈసారి ప్రపంచ సుందరి కిరీటం ఎత్తుకుపోయింది. మిస్‌\nజిబ్రాల్టర్‌ కియానే ఆల్డోరినో 2009 సంవత్సరానికి గాను ఈ అవార్డును\nగెలుచుకుంది. 22 ఏళ్ల కియానే హెచ్‌ఆర్‌ శాఖలో క్లర్కుగా పనిచేస్తోంది.\nమిస్‌ ఇండియా వరల్డ్‌ పూజా చోప్రా సహా మొత్తం 112 దేశాల సుందరీమణులు\nపాల్గొన్న ఈ పోటీలో 111 మంది సుందరీమణులని తలదన్ని ఈమె ఈ టైటిల్‌\nగెలుచుకుంది. రెండోస్థానంలో మిస్‌ మెక్సికో పెర్లా బెల్ట్రాన్‌, మూడో\nస్థానంలో మిస్‌ దక్షిణాఫ్రికా టటుమ్‌ కెష్వర్‌ నిలిచారు. చివరి రౌండులో\nఏడుగురు పోటీపడ్డారు. దక్షిణాఫ్రికా రాజధాని జొహాన్నెస్‌బెర్గ్‌లో జరిగిన\nఈ వేడుకలలో జడ్జిగా పాల్గొనేందుకు మాజీ మిస్‌వరల్డ్‌, బాలీవుడ్‌ బ్యూటీ\nప్రియాంకా చోప్రా కూడా వెళ్లింది. కంగ్రాట్స్ కియానే ఆల్టోరినో..', '2009-12-22 11:44:30', 0, 1, 0),
(77, '3', 'రష్యాలో భారీ పేలుడు: 102 మంది మృతి', '', 'మాస్కో: రష్యాలోని పెర్మ్ లో గల ఉరల్ నగరంలోని నైట్ క్లబ్ లో శుక్రవారం\nరాత్రి బారీ పేలుడు సంభవించింది. ఈ దుర్షటనలో 102 మంది మరణించగా, 135 మంది\nదాకా గాయపడ్డారు. గాయపడినవారిలో 85 మంది పరిస్థితి ఆందోళనకరంగా ఉన్నట్లు\nమీడియా వార్తలు తెలియజేస్తున్నాయి.', 'మాస్కో: రష్యాలోని పెర్మ్ లో గల ఉరల్ నగరంలోని నైట్ క్లబ్ లో శుక్రవారం\nరాత్రి బారీ పేలుడు సంభవించింది. ఈ దుర్షటనలో 102 మంది మరణించగా, 135 మంది\nదాకా గాయపడ్డారు. గాయపడినవారిలో 85 మంది పరిస్థితి ఆందోళనకరంగా ఉన్నట్లు\nమీడియా వార్తలు తెలియజేస్తున్నాయి.<br><br> పేలుడు సంభవించిన సమయంలో క్లబ్\nలో 200 మంది దాకా ఉన్నారు. చాలా మంది దాని ఉద్యోగులు, వారి కుటుంబ సభ్యులు\nకావడం గమనార్హం. బార్ ఎనిమిదో వార్షికోత్సవాన్ని నిర్వహిస్తుండగా ఈ సంఘటన\nజరిగింది. బాణా సంచా పేలి ఈ ప్రమాదం సంభవించినట్లు పోలీసులు చెబుతున్నారు.\nపేలుడుకు భయపడి బయటకు పారిపోవడానికి ప్రయత్నించినప్పుడు తొక్కిసలాట\nజరిగింది. ఈ సమయంలో ఊపిరాడక చాలా మంది మరణించినట్లు చెబుతున్నారు.', '2009-12-22 11:49:10', 0, 1, 2),
(78, '8', 'ఉత్కంఠ మ్యాచులో భారత్ గెలుపు', '', 'రాజ్ కోట్: తీవ్ర ఉత్కంఠ నెలకొన్న తొలి వన్డే క్రికెట్ మ్యాచులో భారత్\nవిజయం సాధించింది. కేవలం మూడు పరుగుల తేడాతో భారత్ శ్రీలంకపై విజయం\nసాధించింది. చివరి వరకు ఉత్కంఠ కొనసాగింది. శ్రీలంక నిర్ణీత 50 ఓవర్లలో\nభారత్ పెట్టిన 415 ', 'రాజ్ కోట్: తీవ్ర ఉత్కంఠ నెలకొన్న తొలి వన్డే క్రికెట్ మ్యాచులో భారత్\nవిజయం సాధించింది. కేవలం మూడు పరుగుల తేడాతో భారత్ శ్రీలంకపై విజయం\nసాధించింది. చివరి వరకు ఉత్కంఠ కొనసాగింది. శ్రీలంక నిర్ణీత 50 ఓవర్లలో\nభారత్ పెట్టిన 415 పరుగుల లక్ష్యాన్ని ఛేదించడంలో మూడు పరుగులు వెనక\nపడిపోయింది. శ్రీలంక 411 పరుగులు చేసింది. శ్రీలంక భారత్ లక్ష్యాన్ని\nసునాయసంగా ఛేదిస్తుందని అనుకున్న సమయంలో చివరి నిమిషాల్లో వెనకడుగు\nవేసింది. దిల్షాన్, తరంగ అద్భుతమైన ప్రారంభాన్ని అందించారు. సంగక్కర,\nదిల్షాన్ కలిసి పరుగుల వరద పారించారు. దిల్షాన్ 124 బంతుల్లో 160 పరుగులు\nచేశాడు. సంగక్కర 43 బంతుల్లో 90 పరుగులు చేశాడు. తరంగ 67 పరుగులు చేశారు.\nవీరి తర్వాత మరెవ్వరూ నిలదొక్కుకోకపోవడం శ్రీలంకకు శాపంగా మారింది.<br><br>\nఅంతకు ముందు శ్రీలంకపై జరుగుతున్న తొలి వన్డే మ్యాచులో భారత్ మంగళవారం\nభారీ స్కోరు సాధించింది. శ్రీలంకకు 415 పరుగుల లక్ష్యాన్ని\nనిర్దేశించింది. భారత్ కు ఇది వన్డేల్లో అత్యధిక స్కోరు. భారత్ నిర్ణీత 50\nఓవర్లలో ఏడు వికెట్ల నష్టానికి 414 పరుగులు చేసింది. ఇంతకు ముందు భారత\nవన్డేల్లో బెర్ముడాపై 414 పరుగులు అత్యధికం. వీరేంద్ర సెహ్వాగ్ తన సహజమైన\nధోరణిలో విరుచుకుపడి భారీ స్కోరుకు పునాది వేశాడు. సెహ్వాగ్ 102 బంతుల్లో\nఆరు సిక్స్లులు, 17 ఫోర్లతో 146 పరుగులు చేశాడు. సెహ్వాగ్ తో కలిసి తొలి\nవికెట్ కు 153 పరుగుల భాగస్వామ్యాన్ని, ఆ తర్వాత మహేంద్ర సింగ్ ధోనీతో\nకలిసి రెండో వికెట్ కు 156 పరుగుల భాగస్వామ్యాన్ని నెలకొల్పాడు. సెహ్వాగ్\nకు ఇది వన్డేల్లో 12వ సెంచరీ. 66 బంతుల్లో సెహ్వాగ్ సెంచరీ సాధించాడు.', '2009-12-22 12:02:55', 0, 1, 31),
(79, '8', 'ఇండియాకు మరో దెబ్బ: రైనాకు స్వైన్ ఫ్లూ', '', 'కటక్: శ్రీలంకతో జరుగుతున్న వన్డే సిరీస్ లో భారత్ కు మరో దెబ్బ తగిలింది.\nమూడు వన్డే క్రికెట్ మ్యాచు ప్రారంభం కానున్న కొద్ది గంటల్లో భారత\nబ్యాట్స్ మన్ సురేష్ రైనాకు తీవ్ర జ్వరం వచ్చింది. అతనికి స్వైన్ ఫ్లూ\nవచ్చినట్లు అనుమానిస్తున్నారు. కొద్ది రోజుల క్రితం బౌలర్ శ్రీశాంత్ కు\nస్వైన్ ఫ్లూ సోకింది. దీంతో అతను వన్డే సిరీస్ నుంచి తప్పుకోవాల్సి\n', 'కటక్: శ్రీలంకతో జరుగుతున్న వన్డే సిరీస్ లో భారత్ కు మరో దెబ్బ తగిలింది.\nమూడు వన్డే క్రికెట్ మ్యాచు ప్రారంభం కానున్న కొద్ది గంటల్లో భారత\nబ్యాట్స్ మన్ సురేష్ రైనాకు తీవ్ర జ్వరం వచ్చింది. అతనికి స్వైన్ ఫ్లూ\nవచ్చినట్లు అనుమానిస్తున్నారు. కొద్ది రోజుల క్రితం బౌలర్ శ్రీశాంత్ కు\nస్వైన్ ఫ్లూ సోకింది. దీంతో అతను వన్డే సిరీస్ నుంచి తప్పుకోవాల్సి\nవచ్చింది.<br><br> రైనాకు సోకింది స్వైన్ ఫ్లూ వ్యాధియేనా కాదా అనేది\nవైద్యులు నిర్ధారించాల్సి ఉంది. జ్వరం కారణంగా రైనా మూడో వన్డేలో ఆడే\nఅవకాశం లేదు.నిషేధం వల్ల కెప్టెన్ మహేంద్ర సింగ్ ధోనీ రెండు మ్యాచులకు\nదూరమవుతున్నాడు.', '2009-12-22 12:18:46', 1, 0, 9),
(80, '9', 'కాంగ్రెస్‌కు తీపి-చేదు కలయికగా 2009 సంవత్సరం! ', 'mixed tastes for congress last year', '125వ వ్యవస్థాపక\nదినోత్సవాలు ఘనంగా జరుపుకుంటున్న అఖిల భారత కాంగ్రెస్ పార్టీకి 2009\nసంవత్సరం తీపి, ', '125వ వ్యవస్థాపక\nదినోత్సవాలు ఘనంగా జరుపుకుంటున్న అఖిల భారత కాంగ్రెస్ పార్టీకి 2009\nసంవత్సరం తీపి, చేదు కలయికగా మిగిలిపోనుంది. ఈ యేడాది ఆగస్టు నెల వరకు ఆ\nపార్టీకి అన్నీ అనుకూలంగానే ఉన్నాయి. ఆంధ్రప్రదేశ్ రాష్ట్ర ముఖ్యమంత్రి\nవైఎస్.రాజశేఖర రెడ్డి దుర్మరణంతో చిక్కులు ఎదురయ్యాయని ఒకరకంగా\nచెప్పుకోవచ్చు. దీంతో పాటు కాంగ్రెస్ అధిష్టానం స్వయం తప్పిదాలు, ధరల\nపెరుగుదల, తెలంగాణ అంశాలు ఆ పార్టీకి లేనిపోని తలవంపులు తెచ్చిపెట్టాయి. <br>\n<br>\n<font యేడాదిలో="" ఆ="" ఆశాజ్యోతిగా="" భావిస్తున్న="" యువరాజు="" రాహుల్="" గాంధీ="" జాతీయ="" స్థాయిలో="" క్రియాశీలక="" పాత్ర="" పోషించే="" స్థాయికి="" ఎదిగారు.="" దేశానికి="" గుండెకాయలాంటి="" ఉత్తరప్రదేశ్‌లో="" పార్టీకి="" తిరిగి="" పునర్జీవం="" కల్పించారు.="" ఫలితంగా="" ఈ="" యేడాది="" మే="" నెలలో="" జరిగిన="" సార్వత్రిక="" ఎన్నికల్లో="" కాంగ్రెస్="" పార్టీ="" ఊహించని="" విజయాన్ని="" దక్కించుకుంది.=""><br>\n<br>\n18 సంవత్సరాల\nతర్వాత కాంగ్రెస్ పార్టీ 200 పైచిలుకు స్థానాలను కైవసం చేసుకుని అతిపెద్ద\nపార్టీగా అవతరించింది. ఈ విషయంలో అటు రాహుల్ గాంధీ, ఇటు పార్టీ అధినేత్రి\nసోనియా గాంధీ కృషి ప్రశంసనీయం. పార్టీకి తిరుగులేని విజయాన్ని చేకూర్చి\nపెట్టడంలో వీరిద్దరి కృషితో పాటు.. ఆర్థికవేత్త, ప్రధాని మన్మోహన్ సింగ్\nసమర్థవంతమైన పాలన ఎంతగానో దోహదపడింది. <br>\n<br> బలహీన\nప్రధాని అంటూ ప్రతిపక్షనేత అద్వానీతో పదేపదే విమర్శలను ఎదుర్కొన్న\nమన్మోహన్.. ముగిసిన సార్వత్రిక ఎన్నికల ఫలితాల్లో విజేతగా నిలిచి,\nపటిష్టమైన ప్రధానిగా తిరిగి రెండో సారి ప్రధాని పీఠాన్ని\nదక్కించుకున్నారు. ఆ తర్వాత జరిగిన మహారాష్ట్ర, అస్సోం, అరుణాచల్ ప్రదేశ్\nఎన్నికల్లో కూడా కాంగ్రెస్ విజయభేరీ మోగించింది. ఈ మూడు రాష్ట్రాల్లో\nకాంగ్రెస్ పార్టీ ప్రభుత్వాన్ని ఏర్పాటు చేసింది</font>', '2010-01-01 09:56:50', 0, 0, 26),
(81, '2', 'సమైక్యం వద్దు.. తెలంగాణయే ముద్దు: ', 'samikya andra', 'రాష్ట్ర ఆరోగ్య\nశాఖామంత్రి, గ్రేటర్ హైదరాబాద్ కాంగ్రెస్ అధ్యక్షుడు దానం నాగేందర్ <br>', 'రాష్ట్ర ఆరోగ్య\nశాఖామంత్రి, గ్రేటర్ హైదరాబాద్ కాంగ్రెస్ అధ్యక్షుడు దానం నాగేందర్ ప్లేటు\nఫిరాయించారు. దివంగత ముఖ్యమంత్రి వైఎస్.రాజశేఖర రెడ్డికి అత్యంత ప్రియ\nశిష్యుడిగా పేరుగాంచిన దానం... గ్రేటర్ హైదరాబాద్ నినాదాన్ని\nవదిలిపెట్టారు. సమైక్యాంధ్ర కంటే తెలంగాణాయే ముద్దు అని ప్రకటించారు.\nతెలంగాణ ఆత్మహత్యల కంటే సమైక్యాంధ్ర లేదా సీమాంధ్ర నేతల వ్యాపారాలు\nముఖ్యమా అంటూ ప్రశ్నించారు. <br><br>దీనిపై\nఆయన గురువారం హైదరాబాద్‌లో జూబ్లీహాల్‌ వద్ద మీడియాతో మాట్లాడుతూ.. ఏలూరు\nఎంపీ, సీమాంధ్ర ప్రతినిధి కావూరి సాంబశివరావు వంటి నేతలు వ్యాపార\nప్రయోజనాల కోసమే సమైక్యాంధ్ర ఉద్యమం చేస్తున్నారని ఆరోపించారు. అందువల్లే\nతెలంగాణ విషయంలో సీమాంధ్ర నేతలు అధిష్టానాన్ని తప్పుదారి పట్టిస్తున్నట్టు\nదుయ్యబట్టారు. <br><br>అందువల్ల\nసీమాంధ్ర నేతలు ఇప్పటికైనా నిజాలను గ్రహించి మానవతా దృక్పథంతో ఆలోచన\nచేయాలని పిలుపునిచ్చారు. కేంద్రాన్ని తప్పుదోవ పట్టించేందుకు సీమాంధ్ర\nనేతలు చేస్తున్న ప్రయత్నాలను తాను తీవ్రంగా ఖండిస్తున్నట్టు ప్రకటించారు.\nవీరికంటే ఎక్కువగా తాము ఒత్తిడి తీసుకుని రాగలమన్నారు. అదేసమయంలో\nరాజీనామాలతో సమస్యకు పరిష్కారం లభించదన్నారు. ', '2010-01-21 12:55:50', 0, 0, 0),
(82, '1', 'తెలుగు జాతి ఐక్యంగా ఉండాలి: ''గజల్ మాస్ట్రో'' శ్రీనివాస్', 'gagil srinivas', 'ఈ భూమి ఉన్నంత వరకు\nతెలుగుజాతి యావత్ ఐక్యంగా కలిసి మెలిసి ఉండాలన్నదే తన అభిమతమని గజల్\n', 'ఈ భూమి ఉన్నంత వరకు\nతెలుగుజాతి యావత్ ఐక్యంగా కలిసి మెలిసి ఉండాలన్నదే తన అభిమతమని గజల్\nమాస్ట్రో డాక్టర్ శ్రీనివాస్ అభిప్రాయపడ్డారు. తాను వ్యక్తిగతంగా\nసమైక్యవాదినేనని చెప్పారు. అయితే, ప్రస్తుత పరిస్థితుల్లో తెలంగాణ అంశంపై\nలోతుగా మాట్లాడటం ఇష్టంలేదన్నారు. <br><br>తమిళనాడు\nరాష్ట్ర రాజధాని చెన్నయ్‌లోని ప్రముఖ సాంస్కృతిక సంస్థ ఇండియన్ తెలుగు\nఅసోసియేషన్ (ఐటీఏ) ఆధ్వర్యంలో జరిగే సన్మాన కార్యక్రమానికి ఆయన చెన్నయ్‌కు\nవచ్చారు. ఈ సందర్భంగా ఆయన విలేకరులతో మాట్లాడారు. <br><br>తన\nస్వస్థలం తూర్పుగోదావరి జిల్లా పాలకొల్లు అని చెప్పారు. గత పదేళ్ళుగా\nభాగ్యనగరంలో ఉంటున్నానన్నారు. అక్కడకు వచ్చాకే తనకు తెలంగాణ ఉద్యమం ఉందనే\nవిషయం తెలియవచ్చందన్నారు. <br><br>రాష్ట్రానికి\nకాకుండా, దేశానికే తలమానికంగా ఉండే హైదరాబాద్‌లో తెలంగాణ ఉద్యమం\nలేవనెత్తడం ఎంతో మనోవేదనకు లోను చేస్తుందన్నారు. ఆయా ప్రాంతాల ప్రజల\nఅభిమతాలు ఎలా ఉన్నా.. తెలుగు ప్రజలు, తెలుగు జాతి, తెలుగు సమాజమంతా\nఐక్యంగా, కలిసి మెలిసి ఉండాలన్నదే తమ అభిమతమన్నారు. <br><br>అందుకోసమే\nతాము సమైక్యాంధ్ర నినాదాన్ని బలంగా వినిపిస్తూ.. ఒక పాటను కూడా\nఆలపించినట్టు చెప్పారు. ఈ పాటను చెన్నపురి వాసులకు వినిపించనున్నట్టు\nతెలిపారు. ఇకపోతే.. తాను వంద భాషల్లో గజల్స్ పాడటంతో గిన్నీస్ బుక్‌లో\nచోటు దక్కిందన్నారు. <br><br>త్వరలోనే\nమరో గిన్నీస్ బుక్ రికార్డు చేయనున్నట్టు ప్రకటించారు. ఈ వివరాలను\nత్వరలోనే మీడియాకు వెల్లడిస్తానని చెప్పారు. ఇకపోతే.. ప్రపంచ శాంతి కోసం\nతాను పరితపిస్తున్నట్టు చెప్పారు. ఇందుకోసం తీవ్రవాద బారిన పడి\nఅల్లాడుతున్న ఆఫ్ఘనిస్థాన్, పాకిస్థాన్ వంటి దేశాల్లో పలుమార్లు పర్యటించి\nశాంతి కోసం కృషి చేస్తున్నట్టు చెప్పారు. <br><br>మన\nవారసులకు ఆస్తిపాస్తులు ఇవ్వలేక పోయినా.. కల్మష వాతావరణం లేని, నవ సమాజం\nఇవ్వాలన్నదే తమ తపన అని చెప్పుకొచ్చారు. అదేసమయంలో ప్రాంతాల వెనుకుబాటు తన\nకూడా ఒక సమస్య కారాదన్నారు. అన్ని ప్రాంతాలను సమ దృష్టితో చూసి అభివృద్ధి\nచేయాల్సిన బాధ్యత పాలకులపై ఉందని గజల్ శ్రీనివాస్ తెలిపారు. ', '2010-01-26 16:54:59', 0, 1, 21);
