(1, 4, 'ప్రణబ్‌ బడ్జెట్‌ ప్రజారంజకమైనదేనా?', 3, 4, 2, '2009-12-04', '2009-07-09', 1),
(2, 5, 'రైల్వే బడ్జెట్‌లో రాష్ట్రానికి అన్యాయం జరిగిందా? ', 0, 1, 0, '2009-07-08', '2009-07-09', 0),
(3, 4, ' దూరంగా ఉంచేందుకు పాకిస్థాన్ జట్టు కోచ్ ఇంతిఖాబ్ ఆలం, మేనేజర్ యవార్ సయీద్ కుట్రపన్నారని ఆ దేశ సెలెక్షన్ కమిటీ మాజీ ఛైర్మన్ అబ్దుల్ ఖాదీర్ వాదనతో మీరు ఏకీభవిస్తారా...', 0, 1, 0, '2009-08-04', '2009-08-04', 0),
(4, 4, 'ఐపీఎల్ నిజంగానే టెస్ట్ క్రికెట్‌కు చేటు చేస్తుందా...?', 0, 0, 0, '2009-08-03', '2009-08-04', 0),
(5, 5, 'ఐపీఎల్ నిజంగానే టెస్ట్ క్రికెట్‌కు చేటు చేస్తుందా...?', 0, 0, 0, '2009-08-04', '2009-08-04', 0),
(6, 4, 'భారత బ్యాడ్మింటన్ క్రీడాకారిణి సైనా నెహ్వాల్ నెంబర్‌వన్ స్థానానికి చేరుకుంటుందా...?', 0, 0, 0, '2009-08-04', '2009-08-04', 0),
(7, 5, ' 	 ధోనీ సేన ట్వంటీ-20 ప్రపంచ‌కప్‌ను సాధించుకు వస్తుందంటారా...?', 1, 1, 1, '2009-08-03', '2009-08-04', 0),
(8, 4, 'వైఎస్ రాజశేఖర రెడ్డి కుమారుడైన జగన్‌కు ముఖ్యమంత్రి పదవిని కట్టబెట్టాలన్న అభిప్రాయంతో మీరు ఏకీభవిస్తారా...?', 0, 0, 0, '2009-09-17', '2009-09-17', 0),
(9, 4, ' వైఎస్ జగన్‌కు ఈసారి సీఎం పోస్టు ఛాన్స్ లేనట్టేనని అనుకోవచ్చా...?', 0, 0, 0, '2009-10-26', '2009-10-26', 0),
(10, 4, ' వైఎస్ జగన్‌కు ఈసారి సీఎం పోస్టు ఛాన్స్ లేనట్టేనని అనుకోవచ్చా...?', 1, 0, 0, '2010-01-09', '2009-10-26', 0);
