INSERT INTO `sahithi` (`id`, `cat_id`, `heading`, `eng_heading`, `summary`, `description`, `insert_date`, `homepage`, `active`, `views`) VALUES
(6, 1, 'సంక్రాంతి', '', 'ఆంధ్రులకు పెద్ద పండుగ <span style="font-weight: bold;">సంక్రాంతి.</span> ', '<p>ఆంధ్రులకు పెద్ద పండుగ సంక్రాంతి. "భిన్నత్వంలో ఏకత్వం" అనే వాక్యానికి సంక్రాంతి పండుగ బాగా నప్పుతుంది, <a href="http://te.wikipedia.org/wiki/%E0%B0%86%E0%B0%82%E0%B0%A7%E0%B1%8D%E0%B0%B0_%E0%B0%AA%E0%B1%8D%E0%B0%B0%E0%B0%A6%E0%B1%87%E0%B0%B6%E0%B1%8D" title="ఆంధ్ర ప్రదేశ్">ఆంధ్ర ప్రదేశ్</a>, <a href="http://te.wikipedia.org/wiki/%E0%B0%95%E0%B0%B0%E0%B1%8D%E0%B0%A3%E0%B0%BE%E0%B0%9F%E0%B0%95" title="కర్ణాటక">కర్ణాటక</a> లలో <i><b>సంక్రాంతి</b></i> అని; <a href="http://te.wikipedia.org/wiki/%E0%B0%A4%E0%B0%AE%E0%B0%BF%E0%B0%B3%E0%B0%A8%E0%B0%BE%E0%B0%A1%E0%B1%81" title="తమిళనాడు">తమిళనాడు</a> లో <i><b>పొంగల్</b></i> అని; <a href="http://te.wikipedia.org/wiki/%E0%B0%AE%E0%B0%B9%E0%B0%BE%E0%B0%B0%E0%B0%BE%E0%B0%B7%E0%B1%8D%E0%B0%9F%E0%B1%8D%E0%B0%B0" title="మహారాష్ట్ర">మహారాష్ట్ర</a>, <a href="http://te.wikipedia.org/wiki/%E0%B0%97%E0%B1%81%E0%B0%9C%E0%B0%B0%E0%B0%BE%E0%B0%A4%E0%B1%8D" title="గుజరాత్">గుజరాత్</a> లలో <i><b>మకర్‌సంక్రాంతి</b></i> అని; <a href="http://te.wikipedia.org/wiki/%E0%B0%AA%E0%B0%82%E0%B0%9C%E0%B0%BE%E0%B0%AC%E0%B1%81" title="పంజాబు" class="mw-redirect">పంజాబు</a>, <a href="http://te.wikipedia.org/wiki/%E0%B0%B9%E0%B0%B0%E0%B1%8D%E0%B0%AF%E0%B0%BE%E0%B0%A8%E0%B0%BE" title="హర్యానా">హర్యానా</a> లలో <i><b>లోరీ</b></i>\nఅని పిలవబడే ఈ పండుగను మూడు రోజుల పాటు జరుపుకుంటారు. పంట చేతికొచ్చిన\nఆనందంలో రైతులు ఈ పండుగ జరుపుకుంటారు. పండుగ జరుపుకునే మూడు రోజులలో మొదటి\nరోజును <i><b>భోగి</b></i> అని, రెండవ రోజును <i><b>సంక్రాంతి</b></i> అని, మూడవ రోజును <i><b>కనుమ</b></i> అని పిలుస్తారు. మకర సంక్రాంతితో ఉత్తరాయణం మొదలవుతుంది.</p>\n<p><a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AD%E0%B1%8B%E0%B0%97%E0%B0%BF&amp;action=edit&amp;redlink=1" class="new" title="భోగి (పేజీ లేదు)">భోగి</a>, <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AE%E0%B0%95%E0%B0%B0_%E0%B0%B8%E0%B0%82%E0%B0%95%E0%B1%8D%E0%B0%B0%E0%B0%AE%E0%B0%A3%E0%B0%82&amp;action=edit&amp;redlink=1" class="new" title="మకర సంక్రమణం (పేజీ లేదు)">మకర సంక్రమణం</a>, <a href="http://te.wikipedia.org/wiki/%E0%B0%95%E0%B0%A8%E0%B1%81%E0%B0%AE" title="కనుమ">కనుమ</a> - ఈ మూడు రోజులూ పండుగే కనుక, దీన్ని <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AA%E0%B1%86%E0%B0%A6%E0%B1%8D%E0%B0%A6_%E0%B0%AA%E0%B0%82%E0%B0%A1%E0%B1%81%E0%B0%97&amp;action=edit&amp;redlink=1" class="new" title="పెద్ద పండుగ (పేజీ లేదు)">పెద్ద పండుగ</a>\nఅంటారు. నిజానికి ధనుర్మాసారంభంతో నెల రోజులు మూమూలుగానే సంక్రాంతి\nవాతావరణం చలిచలిగా తెలుగునాట ప్రారంభమవుతుంది. ఆ నెల రోజులు తెలుగు\nపల్లెలు ఎంత అందంగా, ఆహ్లాదకరంగా అలరారుతూ ఉంటాయో చూసి తీరవలసిందే. <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AC%E0%B1%81%E0%B0%A1%E0%B0%AC%E0%B1%81%E0%B0%95%E0%B1%8D%E0%B0%95%E0%B0%B2%E0%B0%B5%E0%B0%BE%E0%B0%B3%E0%B1%8D%E0%B0%B2%E0%B1%81&amp;action=edit&amp;redlink=1" class="new" title="బుడబుక్కలవాళ్లు (పేజీ లేదు)">బుడబుక్కలవాళ్లు</a>, <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AA%E0%B0%97%E0%B0%9F%E0%B0%BF%E0%B0%B5%E0%B1%87%E0%B0%B7%E0%B0%A7%E0%B0%BE%E0%B0%B0%E0%B1%81%E0%B0%B2%E0%B1%81&amp;action=edit&amp;redlink=1" class="new" title="పగటివేషధారులు (పేజీ లేదు)">పగటివేషధారులు</a>, రకరకాల జానపద వినోద కళాకారులు తయారవుతారు. ఈ పండుగకు దాదాపు నెలరోజుల ముందునుంచే - అంటే <a href="http://te.wikipedia.org/wiki/%E0%B0%A7%E0%B0%A8%E0%B1%81%E0%B0%B0%E0%B1%8D%E0%B0%AE%E0%B0%BE%E0%B0%B8%E0%B0%82" title="ధనుర్మాసం" class="mw-redirect">ధనుర్మాసం</a> ఆరంభం నుండే - ప్రతీ రోజు తమ ఇళ్ళ ముంగిళ్ళను <a href="http://te.wikipedia.org/wiki/%E0%B0%B0%E0%B0%82%E0%B0%97%E0%B0%B5%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B1%81%E0%B0%B2%E0%B1%81" title="రంగవల్లులు" class="mw-redirect">రంగవల్లులు</a>, <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%97%E0%B1%8A%E0%B0%AC%E0%B1%8D%E0%B0%AC%E0%B1%86%E0%B0%AE%E0%B1%8D%E0%B0%AE&amp;action=edit&amp;redlink=1" class="new" title="గొబ్బెమ్మ (పేజీ లేదు)">గొబ్బెమ్మ</a>\nలతో అలంకరిస్తారు. ముగ్గులు వేయటానికి ప్రత్యేకంగా బియ్యపు పిండిని\nవాడతారు. కళ్లం నుంచి బళ్ల మీద ధాన్యం బస్తాలు వస్తూ ఉంటాయి. భోగినాడు\nభోగిమంట విధిగా వేయవలసిందే. ఆ సాయంత్రం పేరంటంలో పిల్లలకు భోగిపళ్లు\nతప్పవు. ఈ పెద్ద పండుగకు <a href="http://te.wikipedia.org/wiki/%E0%B0%95%E0%B1%8A%E0%B0%A4%E0%B1%8D%E0%B0%A4_%E0%B0%85%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B1%81%E0%B0%A1%E0%B1%81" title="కొత్త అల్లుడు" class="mw-redirect">కొత్త అల్లుడు</a>\nతప్పనిసరిగా అత్తవారింటికి వస్తాడు. మరదళ్ల ఎకసెక్కాలకు ఉడుక్కుంటాడు.\nఇవన్నీ సంక్రాంతి పండుగకు శోభ చేకూర్చే సర్వసామాన్య విషయాలు. రైతులు\nచెమటోడ్చి పండించిన పంటలు చేతికొచ్చే సమయంలో సంక్రాంతి పండుగ వస్తుంది\nకాబట్టి రైతుల పండుగగా దీన్ని అభివర్ణిస్తారు.</p>', '2009-08-25 11:48:50', 0, 1, 0),
(7, 1, 'దసరా  పండుగ <br>', '', '<span class="searchmatch"></span> తొమ్మిది రోజులు దేవీ నవరాత్రులు పదవ రోజు విజయ దశమి కలసి <span style="font-weight: bold;" class="searchmatch">దసరా</span> అంటారు.  <b>...</b>', '<p><b>దసరా</b> ఒక హిందువుల <a href="http://te.wikipedia.org/wiki/%E0%B0%AA%E0%B0%82%E0%B0%A1%E0%B1%81%E0%B0%97" title="పండుగ">పండుగ</a>. ఆశ్వయుజ శుద్ధ పాడ్యమి నుండి తొమ్మిది రోజులు <b>దేవీ నవరాత్రులు</b> పదవ రోజు <b>విజయ దశమి</b> కలసి <b>దసరా</b>\nఅంటారు. ఇది ముఖ్యముగా శక్తి ఆరాధనకు ప్రాధాన్యత ఇచ్చే పండుగ. ఈ పండుగకు\nనవరాత్రి, శరన్నవరాత్రి అనీ అంటారు. శరదృతువు ఆరంభంలో వచ్చే పండుగ కనుక ఈ\nపేరు వచ్చింది. కొందరు ఈ పండుగకు మొదటి మూడు రోజులు <a href="http://te.wikipedia.org/wiki/%E0%B0%AA%E0%B0%BE%E0%B0%B0%E0%B1%8D%E0%B0%B5%E0%B0%A4%E0%B0%BF" title="పార్వతి">పార్వతిదేవికి</a> తరవాతి మూడు రోజుల <a href="http://te.wikipedia.org/wiki/%E0%B0%B2%E0%B0%95%E0%B1%8D%E0%B0%B7%E0%B1%8D%E0%B0%AE%E0%B1%80" title="లక్ష్మీ" class="mw-redirect">లక్ష్మీ</a> దేవికి తరవాతి మూడురోజులు <a href="http://te.wikipedia.org/wiki/%E0%B0%B8%E0%B0%B0%E0%B0%B8%E0%B1%8D%E0%B0%B5%E0%B0%A4%E0%B0%BF" title="సరస్వతి">సరస్వతి</a>\nదేవికి పూజలు నిర్వహిస్తారు. ఈ సమయంలో పూజలో విద్యార్ధులు తమ పుస్తకాలను\nఉంచుతారు. ఇలా చేస్తే విద్యాభ్యాసంలో విజయం లభిస్తుందని విశ్వసిస్తారు.\nసామాన్యులే కాక యోగులు నవరాత్రులలో అమ్మవారిని పూజిస్తారు. ముఖ్యముగా\nశాక్తేయులు దీనిని ఆచరిస్తారు. <a href="http://te.wikipedia.org/wiki/%E0%B0%AC%E0%B1%8A%E0%B0%AE%E0%B1%8D%E0%B0%AE%E0%B0%B2_%E0%B0%95%E0%B1%8A%E0%B0%B2%E0%B1%81%E0%B0%B5%E0%B1%81" title="బొమ్మల కొలువు" class="mw-redirect">బొమ్మల కొలువు</a> పెట్టడం ఒక ఆనవాయితీ. <a href="http://te.wikipedia.org/wiki/%E0%B0%86%E0%B0%B2%E0%B0%AF%E0%B0%82" title="ఆలయం">ఆలయాలలో</a> అమ్మవారికి ఒక్కోరోజు ఒక్కో అలంకారం చేస్తారు. పదవరోజు పార్వేట ఉంటుంది. ఈ రోజు ప్రజలు ఒక ప్రదేశంలో కూడి వేడుక జరుపుకుంటారు. <a href="http://te.wikipedia.org/wiki/%E0%B0%9C%E0%B0%AE%E0%B1%8D%E0%B0%AE%E0%B0%BF_%E0%B0%9A%E0%B1%86%E0%B0%9F%E0%B1%8D%E0%B0%9F%E0%B1%81" title="జమ్మి చెట్టు">జమ్మి చెట్టు</a> ఉన్న ప్రదేశంలో పార్వేట చేయడం ఆనవాయితీ.</p>\n<p><br></p>\n<p><b>దసరా</b> పండుగ <b><a href="http://te.wikipedia.org/wiki/%E0%B0%B5%E0%B0%BF%E0%B0%9C%E0%B0%AF%E0%B0%A6%E0%B0%B6%E0%B0%AE%E0%B0%BF" title="విజయదశమి" class="mw-redirect">విజయదశమి</a></b> నాడు జరుపుకోవడం జరుగుతుంది. <a href="http://te.wikipedia.org/wiki/%E0%B0%A4%E0%B1%86%E0%B0%B2%E0%B1%81%E0%B0%97%E0%B1%81" title="తెలుగు">తెలుగు</a> వారు దసరాని పది రోజులు జరుపుకుంటారు. ముందు <a href="http://te.wikipedia.org/wiki/%E0%B0%A8%E0%B0%B5%E0%B0%B0%E0%B0%BE%E0%B0%A4%E0%B1%8D%E0%B0%B0%E0%B1%81%E0%B0%B2%E0%B1%81" title="నవరాత్రులు" class="mw-redirect">నవరాత్రులు</a> దుర్గ పూజ ఉంటుంది. <a href="http://te.wikipedia.org/wiki/%E0%B0%A4%E0%B1%86%E0%B0%B2%E0%B0%82%E0%B0%97%E0%B0%BE%E0%B0%A3%E0%B0%BE" title="తెలంగాణా" class="mw-redirect">తెలంగాణా</a> లో ఈ తొమ్మిది రోజులు అమావాస్య నుంచి నవమి వరకు <a href="http://te.wikipedia.org/wiki/%E0%B0%AC%E0%B0%A4%E0%B1%81%E0%B0%95%E0%B0%AE%E0%B1%8D%E0%B0%AE" title="బతుకమ్మ">బతుకమ్మ</a> ఆడుతారు. తెలంగాణా పల్లెల్లో ప్రతి అమావాస్య కి స్త్రీలు పట్టు పీతాంబరాలు దరించటం ఆనవాయితీ. విజయదశమి రోజున చరిత్ర ప్రకారం <a href="http://te.wikipedia.org/wiki/%E0%B0%B0%E0%B0%BE%E0%B0%AE%E0%B1%81%E0%B0%A1%E0%B1%81" title="రాముడు">రాముడు</a> రావణుని పై గెలిచిన సందర్భమే కాక <a href="http://te.wikipedia.org/wiki/%E0%B0%AA%E0%B0%BE%E0%B0%82%E0%B0%A1%E0%B0%B5%E0%B1%81%E0%B0%B2%E0%B1%81" title="పాండవులు">పాండవులు</a> వనవాసం వెళ్తూ <a href="http://te.wikipedia.org/wiki/%E0%B0%9C%E0%B0%AE%E0%B1%8D%E0%B0%AE%E0%B0%BF_%E0%B0%9A%E0%B1%86%E0%B0%9F%E0%B1%8D%E0%B0%9F%E0%B1%81" title="జమ్మి చెట్టు">జమ్మి చెట్టు</a> పై తమ ఆయుధాలను తిరిగి తీసిన రోజు. ఈ సందర్భమున రావణ వధ, జమ్మి ఆకుల పూజా చేయటం రివాజు. జగన్మాత అయిన దుర్గా దేవి, <a href="http://te.wikipedia.org/wiki/%E0%B0%AE%E0%B0%B9%E0%B0%BF%E0%B0%B7%E0%B0%BE%E0%B0%B8%E0%B1%81%E0%B0%B0%E0%B1%81%E0%B0%A1%E0%B1%81" title="మహిషాసురుడు">మహిషాసురుడనే</a>\nరాక్షసుని తో 9 రాత్రులు యుద్ధము చేసి అతనిని వధించి జయాన్ని పొందిన\nసందర్భమున 10వ రోజు ప్రజలంతా సంతోషముతో పండగ జరుపుకున్నారు, అదే విజయదశమి.\nదేవీ పూజ ప్రాధాన్యత ఈశాన్య భారతదేశములో హెచ్చుగా ఉంటుంది.</p>', '2009-08-25 11:51:03', 0, 1, 0),
(8, 1, 'దీపావళి', '', 'సమైక్యంగా జరుపుకునే పండుగే దివ్య దీప్తుల <b>దీపావళి</b>.', '<p>భిన్నత్వంలో ఏకత్వాన్ని సృజించే ఈ దీపావళి కోటి కాంతుల రవళి- విరిసే\nచైతన్య దీప్తుల జావళి. కొత్త ఆశలతో , ఆశయాలతో ఈ దీపావళి మానవ జీవితంలో\nపారమార్థిక వెలుగు <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%B0%E0%B1%87%E0%B0%96&amp;action=edit&amp;redlink=1" class="new" title="రేఖ (పేజీ లేదు)">రేఖ</a> లను పూయిస్తుందని హైందవజాతి ప్రగాఢ విశ్వాసం.</p>\n<p><b>" దీపం జ్యోతి పరబ్రహ్మమ్<br></b> <b>దీపం సర్వతమోహరమ్</b><br>\n<b>దీపేన సాధ్యతే సర్వమ్</b><br>\n<b>సంధ్యా దీపం నమామ్యహమ్</b> "<br></p>\n<p>అంటూ మహిళామణులంతా ప్రార్థిస్తూ ఆశ్వయుజ బహుళ చతుర్దశి నుండి కార్తీక\nమాసమంతా సంధ్యా సమయంలో దీపాలను వెలిగిస్తారు. చివరకు ఈ దీపాలను\nముత్తయిదువులు <a href="http://te.wikipedia.org/wiki/%E0%B0%95%E0%B0%BE%E0%B0%B0%E0%B1%8D%E0%B0%A4%E0%B1%80%E0%B0%95_%E0%B0%AA%E0%B1%8C%E0%B0%B0%E0%B1%8D%E0%B0%A3%E0%B0%AE%E0%B0%BF" title="కార్తీక పౌర్ణమి">కార్తీక పౌర్ణమికి</a>\nసముద్ర స్నానాలను ఆచరించి జీవనదులలో వదులుతారు. ఇవి సౌభాగ్యానికి,\nసౌశీల్యానికి, సౌజన్యానికి ప్రతీకలుగా భావిస్తారు. పైగా ఈ దీపావళి <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%B6%E0%B0%B0%E0%B0%A6%E0%B1%83%E0%B0%A4%E0%B1%81%E0%B0%B5%E0%B1%81&amp;action=edit&amp;redlink=1" class="new" title="శరదృతువు (పేజీ లేదు)">శరదృతువులో</a> అరుదెంచటం విశేషం. మనోనిశ్చలతకు, సుఖశాంతులకు అనువైన కాలమిది.</p><p><br></p><p><a href="http://te.wikipedia.org/wiki/%E0%B0%86%E0%B0%B6%E0%B1%8D%E0%B0%B5%E0%B0%AF%E0%B1%81%E0%B0%9C_%E0%B0%AC%E0%B0%B9%E0%B1%81%E0%B0%B3_%E0%B0%9A%E0%B0%A4%E0%B1%81%E0%B0%B0%E0%B1%8D%E0%B0%A6%E0%B0%B6%E0%B0%BF" title="ఆశ్వయుజ బహుళ చతుర్దశి">ఆశ్వయుజ బహుళ చతుర్దశి</a> <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%A8%E0%B0%B0%E0%B0%95_%E0%B0%9A%E0%B0%A4%E0%B1%81%E0%B0%B0%E0%B1%8D%E0%B0%A6%E0%B0%B6%E0%B0%BF&amp;action=edit&amp;redlink=1" class="new" title="నరక చతుర్దశి (పేజీ లేదు)">నరక చతుర్దశి</a> గా ప్రసిద్ధి పొందింది. <a href="http://te.wikipedia.org/wiki/%E0%B0%A8%E0%B0%B0%E0%B0%95%E0%B0%BE%E0%B0%B8%E0%B1%81%E0%B0%B0%E0%B1%81%E0%B0%A1%E0%B1%81" title="నరకాసురుడు">నరకాసురుడు</a> నే రాక్షసుడు చెలరేగి సాధు జనాలను పీడిస్తూ దేవ, మర్త్య లోకాలలో సంక్షోభాన్ని కలిగిస్తుంటాడు. <a href="http://te.wikipedia.org/wiki/%E0%B0%95%E0%B1%83%E0%B0%A4%E0%B0%AF%E0%B1%81%E0%B0%97%E0%B0%82" title="కృతయుగం" class="mw-redirect">కృతయుగం</a> లో హిరణ్యాక్షుని వధించిన <a href="http://te.wikipedia.org/wiki/%E0%B0%B5%E0%B0%B0%E0%B0%BE%E0%B0%B9%E0%B0%B8%E0%B1%8D%E0%B0%B5%E0%B0%BE%E0%B0%AE%E0%B0%BF" title="వరాహస్వామి" class="mw-redirect">వరాహస్వామి</a> కి, భూదేవికి అసుర సంధ్యా సమయంలో జన్మిస్తాడు నరకుడు. అతడు లోక కంటకుడైనా <a href="http://te.wikipedia.org/wiki/%E0%B0%AE%E0%B0%B9%E0%B0%BE%E0%B0%B5%E0%B0%BF%E0%B0%B7%E0%B1%8D%E0%B0%A3%E0%B1%81%E0%B0%B5%E0%B1%81" title="మహావిష్ణువు" class="mw-redirect">మహావిష్ణువు</a>\nవధించరాదని, తల్లియైన తన చేతిలోనే మరణించేలా వరం పొందుతుంది భూదేవి.\nమహావిష్ణువు ద్వాపరయుగంలో శ్రీకృష్ణ భగవానునిగా అవతరించినప్పుడు భూదేవి <a href="http://te.wikipedia.org/wiki/%E0%B0%B8%E0%B0%A4%E0%B1%8D%E0%B0%AF%E0%B0%AD%E0%B0%BE%E0%B0%AE" title="సత్యభామ">సత్యభామ</a> గా జన్మింస్తుంది.</p>\n<p>అప్పటికి నరకాసురుడు లోక కంటకుడై చేస్తున్న అధర్మకృత్యాలను అరికట్టడానికి సత్యభామా సమేతంగా తరలి వెళ్తాడు <a href="http://te.wikipedia.org/wiki/%E0%B0%B6%E0%B1%8D%E0%B0%B0%E0%B1%80%E0%B0%95%E0%B1%83%E0%B0%B7%E0%B1%8D%E0%B0%A3%E0%B1%81%E0%B0%A1%E0%B1%81" title="శ్రీకృష్ణుడు" class="mw-redirect">శ్రీకృష్ణుడు</a>. వారి మధ్యజరిగిన భీకర సంగ్రామంలో భూదేవి అంశ అయిన సత్యభామ శరాఘాతాలకు మరణిస్తాడు నరకుడు.</p>\n<p>తన పుత్రుని పేరైనా కలకాలం నిలిచి ఉండేలా చేయమని సత్యభామ\nప్రార్థించడంతో ఆ రోజు నరక చతుర్థశిగా పిలువబడుతుందని వరం ప్రసాదిస్తాడు\nశ్రీకృష్ణుడు. నరకుని చెరనుండి సాధుజనులు, పదహారువేలమంది రాజకన్యలు\nవిడిపించబడ్డారు, ధ్రర్మం సుప్రతిష్టమైంది.</p>\n<p>నరకుని మరణానికి సంతోషంతో మర్నాడు <a href="http://te.wikipedia.org/wiki/%E0%B0%85%E0%B0%AE%E0%B0%BE%E0%B0%B5%E0%B0%BE%E0%B0%B8%E0%B1%8D%E0%B0%AF" title="అమావాస్య">అమావాస్య</a> చీకటిని పారద్రోలుతూ దీపాలతో తోరణాలు వెలిగించి బాణాసంచా కాల్చి పండుగ జరుపుకోవడం, అదే దీపావళి పండుగగా ప్రసిద్ది చెందడం జరిగాయి.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></p><p>దీపావళి అంటే దీపోత్సవం. ఆ రోజు దీప లక్ష్మి తన కిరణాలతో అమావాస్య\nచీకట్లను పాలద్రోలి జగత్తును తేజోవంతం చేస్తుంది. ఆ వేళ సర్వశుభాలు,\nసంపదలు ప్రసాదించే లక్ష్మీదేవిని పూజించడం అనాదిగా వస్తున్న సాంప్రదాయం.\nదివ్వెల పండుగ దీపావళినాడు లక్ష్మీదేవిని పూజించడానికి కారణం శాస్త్రాలలో\nక్రింది విధంగా చెప్పబడింది.</p>\n<p><b>తైలే లక్ష్మీర్జలే గంగా దీపావళి తిథౌవసేత్!<br></b> <b>అలక్ష్మీ పరిహారార్థం తైలాభ్యంగో విధీయతే!.<br></b></p>\n<p>దీపావళినాడు నూనెలో ( ముఖ్యంగా <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%A8%E0%B1%81%E0%B0%B5%E0%B1%8D%E0%B0%B5%E0%B1%81%E0%B0%B2%E0%B0%A8%E0%B1%82%E0%B0%A8%E0%B1%86&amp;action=edit&amp;redlink=1" class="new" title="నువ్వులనూనె (పేజీ లేదు)">నువ్వులనూనె</a>)\nలక్ష్మీదేవి, నదులు, బావులు, చెరువులు మొదలైన నీటి వనరులలో గంగాదేవి\nసూక్ష్మ రూపంలో నిండి వుంటారు. కనుక ఆ రోజు నువ్వుల నూనెతో తలంటుకుని\nసూర్యోదయానికి ముందు నాలుగు ఘడియలు అరుణోదయ కాలంలో అభ్యంగన <a href="http://te.wikipedia.org/wiki/%E0%B0%B8%E0%B1%8D%E0%B0%A8%E0%B0%BE%E0%B0%A8%E0%B0%82" title="స్నానం">స్నానం</a> తప్పకుండా చేయాలి. ఇలా చేయుడం వల్ల దారిద్ర్యం తొలగుతుంది, గంగానదీ స్నాన ఫలం లభిస్తుంది, నరక భయం ఉండదనేది పురాణాలు చెపుతున్నాయి.</p>\n<p>అమావాస్యనాడు స్వర్గస్థులైన పితరులకు తర్పణం విడవడం విధి కనుక దీపావళినాడు తైలాభ్యంగన స్నానం తరువాత పురుషులు జలతర్పణం చేస్తారు. <b>యమాయ తర్పయామి, తర్పయామి తర్పయామి''</b> అంటూ మూడుసార్లు దోసెట్లో <a href="http://te.wikipedia.org/wiki/%E0%B0%A8%E0%B1%80%E0%B0%B0%E0%B1%81" title="నీరు">నీరు</a> విడిచిపెట్టడం వల్ల పితృదేవతలు సంతుష్టిచెంది ఆశీర్వదిస్తారు.</p>\n<p>స్త్రీలు అభ్యంగన స్నానానంతరం కొత్త బట్టలు కట్టుకుని ఇండ్ల ముందు రంగురంగుల <a href="http://te.wikipedia.org/wiki/%E0%B0%AE%E0%B1%81%E0%B0%97%E0%B1%8D%E0%B0%97%E0%B1%81%E0%B0%B2%E0%B1%81" title="ముగ్గులు" class="mw-redirect">ముగ్గులు</a> తీర్చి గుమ్మాలకు పసుపు , కుంకుమలు రాసి మామిడాకు <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%A4%E0%B1%8B%E0%B0%B0%E0%B0%A3%E0%B0%BE%E0%B0%B2%E0%B1%81&amp;action=edit&amp;redlink=1" class="new" title="తోరణాలు (పేజీ లేదు)">తోరణాలు</a> కట్టి సాయంత్రం లక్ష్మీపూజకు సన్నాహాలు చేసుకొంటారు. రకరకాలైన రుచికరమైన భక్ష్యభోగ్యాలతో నైవేద్యానికి <a href="http://te.wikipedia.org/w/index.php?title=%E0%B0%AA%E0%B0%BF%E0%B0%82%E0%B0%A1%E0%B0%BF%E0%B0%B5%E0%B0%82%E0%B0%9F%E0%B0%B2%E0%B1%81&amp;action=edit&amp;redlink=1" class="new" title="పిండివంటలు (పేజీ లేదు)">పిండివంటలు</a>\nసిద్దం చేయడం, మట్టి ప్రమిదలలో నువ్వుల నూనె పోసి పూజాగృహంలో, ఇంటి బయట\nదీప తోరణాలు అమర్చడం, ఆ రోజంతా ఎక్కడలేని హడావుడి, ఆనందోత్సాహాలు\nవెల్లివిరుస్తాంటాయి.</p>', '2009-08-25 11:53:11', 1, 1, 0),
(9, 2, 'బేతాళ కథల', '', '<a href="http://te.wikipedia.org/wiki/%E0%B0%97%E0%B1%8B%E0%B0%A6%E0%B0%BE%E0%B0%B5%E0%B0%B0%E0%B0%BF" title="గోదావరి"></a>తీరాన, ప్రతిష్ఠానపురానికి విక్రమార్కుడు రాజు.', 'గుణాఢ్యుడు <a href="http://te.wikipedia.org/wiki/%E0%B0%B8%E0%B0%82%E0%B0%B8%E0%B1%8D%E0%B0%95%E0%B1%83%E0%B0%A4%E0%B0%AE%E0%B1%81" title="సంస్కృతము">సంస్కృతములో</a>\nరచించిన "బృహత్ కథ" బేతాళకథలకు మూలం. ఈ కథలను కొంతకాలము తరువాత\n"కథాసరిత్సాగరం" సంపుటి లోనికి చేర్చారు. మూలంలో 25 కథలు మాత్రమే ఉన్నాయి.\nచివరి కథలో బేతాళుడి ప్రశ్నలకు విక్రమార్కుడు జవాబులు చెప్పలేకపోతాడట.\nఅంతటితో ఆ కథలు సమాప్తమవుతాయి. కాని, బేతాళ కథలలోని చివరి కథ అందుబాటులో\nలేదు.<br>&nbsp; ఒక భిక్షువు ఆయనకు రోజూ ఒక పండు లోపల రత్నము పెట్టి ఇస్తూ, ఆయన ప్రాపకం\nసంపాదించటానికి ప్రయత్నించేవాడు. అలా పండులో రత్నం పెట్టి ఇస్తున్నట్లు,\nకొన్ని రోజుల వరకు రాజుకు తెలియదు. ఆ విషయం తెలిసిన రోజున, విక్రమార్కుడు\nభిక్షువు యొక్క విశ్వాసానికి మెచ్చి, కారణం చెప్తేగాని మర్నాడు పండు\nతీసుకోనని చెప్తాడు. దానికి బిక్షువు, తను ఒక మంత్రాన్ని సాధించదలచాననీ\nఅందుకు ఒక వీరుడి సహాయం కావాలనీ, విక్రమార్కుని నుండి తానా సహాయం\nఆశిస్తున్నాననీ అడుగుతాడు. విక్రమార్కుడు తగిన సహాయం చెయ్యటానికి\nఒప్పుకుంటాడు. బిక్షువు, రాబోయే కృష్ణ చతుర్దశి రాత్రి చీకటి పడగానే\nరాజును మహా శ్మశానానికి రమ్మంటాడు.\n<p>అలాగే విక్రమార్కుడు వెళ్తాడు. అక్కడే ఉన్న భిక్షువు, రాజును శింశుపా\nవృక్షం మీద వేళ్ళాడుతున్న పురుషుడి శవం తెచ్చి, తన సమీపంలో ఉంచమంటాడు.\nరాజు ఆ చెట్టు ఎక్కి వేళ్ళాడుతున్న శవాన్ని తాడు కోసి కింద పడవేస్తాడు.\nకిందపడగానే, శవం ఏడవటం మొదలుపెడుతుంది. బేతాళుదు ఆ శవాన్ని ఆవహించి ఉన్న\nసంగతి తెలుసుకోలేక విక్రమార్కుడు, <i>ఎందుకు నవ్వుతావు, పోదాం పద</i>\nఅంటాడు. రాజుకు ఇలా మౌనభంగం అవగానే నేలమీది శవం మాయమై, మళ్ళీ చెట్టు మీద\nవేళ్ళాడుతూ కనపడుతుంది. విక్రమార్కుడు బేతాళుడు పూని ఉన్న ఆ శవాన్ని మళ్ళీ\nకిందపడేసి, భుజం మీద వేసుకుని మౌనంగా శ్మశానం కేసి నడవటం మొదలు పెడతాడు.</p>\n<p>అప్పుడు శవంలోని బేతాళుడు, "రాజా, నీకు వినోదంగా ఉండటానికి ఒక కథ చెబుతాను విను" అంటూ ఒక కథ చెప్తాడు. కథ చివర ప్రశ్న వేసి, "<i>ఈ ప్రశ్నకు సమాధానం తెలిసి కూడా చెప్పక పొయ్యావో, నీ తల పగిలి పోతుంది</i>"\nఅంటాడు. విక్రమార్కుడు తన మౌనం వీడి ప్రశ్నకు తగిన సమాధానం చెపుతాడు. ఆ\nవిధంగా, విక్రమార్కుడికి మౌనభంగం జరగగానే, బేతాళుడు శవంతో సహా మాయమై,\nతెరిగి చెట్టు ఎక్కుతాడు.<sup id="cite_ref-0" class="reference"><a href="http://te.wikipedia.org/wiki/%E0%B0%AC%E0%B1%87%E0%B0%A4%E0%B0%BE%E0%B0%B3_%E0%B0%95%E0%B0%A5%E0%B0%B2%E0%B1%81#cite_note-0">[1]</a></sup></p>', '2009-08-25 17:19:42', 0, 1, 0),
(10, 2, 'అమరావతి కధలు', '', 'ఈ ధారావాహిక అమరావతిలోనే చిత్రీకరించబడటం విశేషం.', '<p><b>అమరావతి కధలు</b>సత్యం శంకరమంచి రచించిన తెలుగు కధాసంపుటి అమరావతి గ్రామం, అక్కడి ప్రజలు ఇతివృత్తంగా రచించిన ఈ 100 కధలు మొదట ఆంధ్రజ్యోతివారపత్రికలో సుమారు రెండు సంవత్సరాలు 1975-77 మధ్య ప్రచురించబడ్డాయి.ఏ కథా\nకూడ ఒక పేజి కంటే ఎక్కువ ఉండేది కాదు. అప్పట్లో కాయితం (News Print) కరువు\nఉండేది. ఆ కారణాన,ఆంధ్రజ్యోతి పత్రిక ప్రస్తుతపు వారపత్రిక సైజులో కాకుండా\nఅందులో సగం సైజులో అంటే చందమామ మాసపత్రిక సైజులో కొన్నాళ్ళు వచ్చింది.\nకారణమేమయినా, కథలన్నీ కూడ రచయిత చక్కగా కుదించి వ్రాశారు. అంత చిన్నకథలో\nకూడ ఎంతో కథా శిల్పాన్ని ప్రదర్శించిన రచయిత సత్యం శంకరమంచి అభినందనీయులు.\nచక్కని తేట తెలుగులో, సరళమైన భాషలో గ్రామీణ వాతావరణాన్ని ప్రతిబింబించుతూ,\nప్రజల వేషభాషలు, ఆచారవ్యవహారాలు, కష్టసుఖాలు, జీవన విధానం గురించి విపులం\nవ్రాసారు శంకరమంచి సత్యం .</p>\n<p>ఈ కథా సంపుటికి 1979వ సంవత్సరానికి ఆంధ్ర రాష్ట్ర సాహిత్య అకాడమీ\nబహుమతి లభించింది. ప్రముఖ సినీ దర్శకులు శ్యామ్ బెనగళ్ ఈ కథలను హిందీలో\nధారావాహికగా చిత్రీకరించారు. ఈ ధారావాహిక దూరదర్శన్ లో ప్రసారం అయ్యి ఈ\nకథా సంపుటి ప్రాచుర్యం మరింత పెంచింది. ఈ ధారావాహిక అమరావతిలోనే చిత్రీకరించబడటం విశేషం.</p>', '2009-08-25 17:49:29', 1, 1, 0),
